JOURNALINSTANCE = {
    [63] = {"Мертвые копи", "Говорят, что когда-то казна Штормграда на треть пополнялась из добычи в Мертвых копях, но после ужасных событий Первой войны рудник оказался заброшен. Долгие годы грабители обходили его стороной, побаиваясь слухов о привидениях, пока наконец эти темные лабиринты не захватило Братство Справедливости – шайка бывших рабочих, решивших стать на воровской путь. Они превратили рудник в свою базу для осуществления подрывных действий против Штормграда.", "interface\\encounterjournal\\ui-ej-dungeonbutton-deadmines.blp", "interface\\lfgframe\\lfgicon-deadmines.blp", "interface\\encounterjournal\\ui-ej-background-deadmines.blp", "interface\\encounterjournal\\ui-ej-lorebg-deadmines.blp", 36, 1581, 9, 0, 63, 886},
    [64] = {"Крепость Темного Клыка", "На южных склонах Серебряного Бора высится Крепость Темного Клыка, отбрасывая мрачную тень на деревушку Погребальных Костров. Зло бродит среди руин, которые служат пристанищем сумасшедшему магу Аругалу и его воргенам. Беспокойные души барона Сильверлейна и командира Спрингвейла жаждут отмщения за захват крепости и убийство своего народа.", "interface\\encounterjournal\\ui-ej-dungeonbutton-shadowfangkeep.blp", "interface\\lfgframe\\lfgicon-shadowfangkeep.blp", "interface\\encounterjournal\\ui-ej-background-shadowfangkeep.blp", "interface\\encounterjournal\\ui-ej-lorebg-shadowfangkeep.blp", 33, 0, 5, 0, 64, 891},
    [76] = {"Зул'Гуруб", "Некогда Зул\'Гуруб был столицей племени Гурубаши, которые безраздельно правили в бескрайних южных джунглях. Именно здесь Мастер проклятий Джин\'до призвал в Азерот жестокого и кровожадного духа – Хаккара Свежевателя Душ. А в последнее время это место стало центром нового союза зандаларов и гурубаши, мечтающих воссоздать единую империю троллей.", "interface\\encounterjournal\\ui-ej-dungeonbutton-zulgurub.blp", "interface\\lfgframe\\lfgicon-zulgurub.blp", "interface\\encounterjournal\\ui-ej-background-zulgurub.blp", "interface\\encounterjournal\\ui-ej-lorebg-zulgurub.blp", 309, 0, 3, 16, 76, 964},
    [77] = {"Зул'Аман", "Эхо давней вражды все еще слышится в древней столице племени Амани, Зул\'Амане. Тролли племени откликнулись на призыв вождя, и вот Зул\'джин уже на пути к восстановлению былой славы империи. Тролли объединившихся племен жаждут вернуть свои земли и отомстить за былые обиды.", "interface\\encounterjournal\\ui-ej-dungeonbutton-zulaman.blp", "interface\\lfgframe\\lfgicon-zulaman.blp", "interface\\encounterjournal\\ui-ej-background-zulaman.blp", "interface\\encounterjournal\\ui-ej-lorebg-zulaman.blp", 568, 3508, 4, 16, 77, 866},
    [227] = {"Непроглядная Пучина", "Непроглядная Пучина, капище богини ночных эльфов Элуны, долгое время считалась утерянной. По слухам, Великий Раскол разрушил храм, и тот погрузился в морскую пучину. Спустя много веков, члены культа Сумеречного Молота, доведенные до безумия кошмарами и призрачными голосами, пришли в это место. Они принесли в жертву бессчетное количество невинных душ, а наградой им стало новое задание: защитить одно из самых ценных творений Древних Богов, пока оно не наберется сил и не обрушит на мир свою темную мощь.", "interface\\encounterjournal\\ui-ej-dungeonbutton-blackfathomdeeps.blp", "interface\\lfgframe\\lfgicon-blackfathomdeeps.blp", "interface\\encounterjournal\\ui-ej-background-blackfathomdeeps.blp", "interface\\encounterjournal\\ui-ej-lorebg-blackfathomdeeps.blp", 48, 0, 15, 0, 227, 873},
    [228] = {"Глубины Черной горы", "Глубины Черной горы служат домом дворфам Черного Железа под предводительством императора Даграна Тауриссана. Как и его предшественники, Дагран служит неумолимому повелителю пламени Рагнаросу, который был призван в этот мир сотни лет назад. Могущественные и непредсказуемые огненные элементали привлекли в это горное царство служителей культа Сумеречного Молота. Теперь они вместе со слугами Рагнароса вовлекают дворфов во все более опасные авантюры, способные обречь весь Азерот на погибель.", "interface\\encounterjournal\\ui-ej-dungeonbutton-blackrockdepths.blp", "interface\\lfgframe\\lfgicon-blackrockdepths.blp", "interface\\encounterjournal\\ui-ej-background-blackrockdepths.blp", "interface\\encounterjournal\\ui-ej-lorebg-blackrockdepths.blp", 230, 0, 1, 0, 228, 880},
    [229] = {"Нижняя часть пика Черной горы", "Потрясающая крепость, вырезанная в огненном сердце Черной горы, веками служила образцом мощи клана Черного Железа. Но не так давно черный дракон Нефариан и его род захватили верхние ярусы крепости и развязали жестокую войну с дворфами. Армии драконов нашли союзника в лице вождя Ренда Чернорука и его \'Орды\', и теперь их объединенные силы хозяйничают на Пике Черной горы, проводя эксперименты, призванные расширить их ряды, и строя планы по уничтожению дворфов Черного Железа.", "interface\\encounterjournal\\ui-ej-dungeonbutton-blackrockspire.blp", "interface\\lfgframe\\lfgicon-blackrockspire.blp", "interface\\encounterjournal\\ui-ej-background-blackrockspire.blp", "interface\\encounterjournal\\ui-ej-lorebg-blackrockspire.blp", 229, 0, 16, 0, 229, 882},
    [230] = {"Забытый Город", "Некогда великий город Эльдре\'Талас, хранивший многие тайны калдорай, был разрушен. Теперь он стал обителью темных, злобных сил. Между враждующими кланами, которые в свое время бились насмерть за контроль над энергией Забытого Города, установился шаткий мир. Теперь им приходится довольствоваться источниками силы на своих территориях, и они не торопятся захватывать весь город.", "interface\\encounterjournal\\ui-ej-dungeonbutton-diremaul.blp", "interface\\lfgframe\\lfgicon-diremaul.blp", "interface\\encounterjournal\\ui-ej-background-diremaul.blp", "interface\\encounterjournal\\ui-ej-lorebg-diremaul.blp", 429, 0, 3, 0, 230, 879},
    [231] = {"Гномреган", "Город Гномреган, построенный глубоко в недрах горы Дун Морог, был ярким свидетельством ума и смекалки гномов. Но когда в столицу вторглись трогги, Сикко Термоштепсель предал главного механика, и Гномреган подвергся воздействию радиации, а большинство его жителей погибли. Выжившие гномы в спешке бежали, но поклялись вернуться – и вернуть себе свой дом.", "interface\\encounterjournal\\ui-ej-dungeonbutton-gnomeregan.blp", "interface\\lfgframe\\lfgicon-gnomeregan.blp", "interface\\encounterjournal\\ui-ej-background-gnomeregan.blp", "interface\\encounterjournal\\ui-ej-lorebg-gnomeregan.blp", 90, 0, 2, 0, 231, 875},
    [232] = {"Мародон", "Легенда гласит, что от Зейтара, сына Кенария, и принцессы элементалей земли Терадрас ведет свое начало жестокий род кентавров. Лишь только эти безжалостные создания появились на свет, как они убили своего отца. Говорят, что обезумевшая от горя Терадрас заточила душу возлюбленного в Мародоне, и что после этого события скверна поглотила подземелье. Теперь эти пещеры доверху заполнены злобными призраками кентавров и свирепыми элементалями.", "interface\\encounterjournal\\ui-ej-dungeonbutton-maraudon.blp", "interface\\lfgframe\\lfgicon-maraudon.blp", "interface\\encounterjournal\\ui-ej-background-maraudon.blp", "interface\\encounterjournal\\ui-ej-lorebg-maraudon.blp", 349, 0, 8, 0, 232, 884},
    [233] = {"Курганы Иглошкурых", "По легендам, там, где пал полубог Агамагган, из его крови выросли шипастые лозы. В последнее время разведчики неоднократно встречали в этих землях нежить, и есть опасения, что Плеть замышляет вторгнуться в Калимдор.", "interface\\encounterjournal\\ui-ej-dungeonbutton-razorfendowns.blp", "interface\\lfgframe\\lfgicon-razorfendowns.blp", "interface\\encounterjournal\\ui-ej-background-razorfendowns.blp", "interface\\encounterjournal\\ui-ej-lorebg-razorfendowns.blp", 129, 0, 6, 0, 233, 887},
    [234] = {"Лабиринты Иглошкурых", "По легендам, там, где пал полубог Агамагган, из его крови выросли шипастые лозы. В самом обширном сплетении гигантских лоз поселились свинобразы. Они называют себя иглошкурами, а последнее пристанище Агамаггана почитают как священное место.", "interface\\encounterjournal\\ui-ej-dungeonbutton-razorfenkraul.blp", "interface\\lfgframe\\lfgicon-razorfenkraul.blp", "interface\\encounterjournal\\ui-ej-background-razorfenkraul.blp", "interface\\encounterjournal\\ui-ej-lorebg-razorfenkraul.blp", 47, 0, 7, 0, 234, 888},
    [236] = {"Стратхольм", "Стратхольм был настоящей жемчужиной северного Лордерона, но сейчас все помнят лишь его сокрушительное падение. Именно здесь принц Артас когда-то ослушался своего наставника, благородного паладина Утера Светоносного, и вырезал сотни горожан, якобы зараженных чумой нежити. С тех пор в городе царят смерть, предательство и отчаяние.", "interface\\encounterjournal\\ui-ej-dungeonbutton-stratholme.blp", "interface\\lfgframe\\lfgicon-stratholme.blp", "interface\\encounterjournal\\ui-ej-background-stratholme.blp", "interface\\encounterjournal\\ui-ej-lorebg-stratholme.blp", 329, 0, 19, 0, 236, 892},
    [237] = {"Храм Атал'Хаккара", "Тысячи лет назад империя Гурубаши погрязла в гражданской войне, развязанной сектой священников – атал\'аи, которые хотели призвать в Азерот аватару бога крови Хаккара Свежевателя Душ, которому они поклонялись. Гурубаши изгнали атал\'аи на Болото Печали, где те построили храм Атал\'Хаккара. Изера, Аспект рода зеленых драконов, затопила этот храм в болоте и оставила там стражей, призванных следить за тем, чтобы ритаулы призыва больше никогда не повторились.", "interface\\encounterjournal\\ui-ej-dungeonbutton-sunkentemple.blp", "interface\\lfgframe\\lfgicon-sunkentemple.blp", "interface\\encounterjournal\\ui-ej-background-sunkentemple.blp", "interface\\encounterjournal\\ui-ej-lorebg-sunkentemple.blp", 109, 0, 22, 0, 237, 687},
    [238] = {"Тюрьма", "Глубоко под стоками Штормграда скрыта тюрьма строгого режима. За порядком в этой клоаке, полной опасных рецидивистов, следит тюремщик Телвотер. Совсем недавно заключенные подняли бунт и расправились со стражей. С тех пор в подземной тюрьме воцарился кромешный ад.", "interface\\encounterjournal\\ui-ej-dungeonbutton-thestockade.blp", "interface\\lfgframe\\lfgicon-stormwindstockades.blp", "interface\\encounterjournal\\ui-ej-background-thestockade.blp", "interface\\encounterjournal\\ui-ej-lorebg-thestockade.blp", 34, 0, 20, 0, 238, 874},
    [239] = {"Ульдаман", "Ульдаман – древний подземный склеп титанов. Говорят, они хотели поставить там эксперимент, но он провалился, и тогда титаны покинули город и начали работать над новым проектом, связанным с возникновением дворфов. Слухи о несметных богатствах, содержащих в себе тайные знания, привлекали искателей сокровищ в глубины Ульдамана. Но раскрыть его тайны не так-то легко – Ульдаман охраняют каменные стражи, дикие трогги, захватчики из Черного Железа. В забытом городе путника подстерегают и другие опасности...", "interface\\encounterjournal\\ui-ej-dungeonbutton-uldaman.blp", "interface\\lfgframe\\lfgicon-uldaman.blp", "interface\\encounterjournal\\ui-ej-background-uldaman.blp", "interface\\encounterjournal\\ui-ej-lorebg-uldaman.blp", 70, 0, 21, 0, 239, 876},
    [240] = {"Пещеры Стенаний", "Много лет назад прославленный друид ночных эльфов Наралекс спустился в темные Пещеры Стенаний со своими спутниками. Своим названием пещеры обязаны похожим на плач звукам, сопровождающим вырывающийся на свободу пар. Он намеревался использовать подземные источники, чтобы вернуть Степям их былое плодородие, но стоило ему окунуться в Изумрудный Сон, как его прекрасное видение обернулось жутким кошмаром. С тех самых пор над этим местом нависло страшное проклятие.", "interface\\encounterjournal\\ui-ej-dungeonbutton-wailingcaverns.blp", "interface\\lfgframe\\lfgicon-wailingcaverns.blp", "interface\\encounterjournal\\ui-ej-background-wailingcaverns.blp", "interface\\encounterjournal\\ui-ej-lorebg-wailingcaverns.blp", 43, 0, 18, 0, 240, 749},
    [241] = {"Зул'Фаррак", "Племя Песчанной Бури ревностно хранило Зул\'Фаррак, бывший когда-то жемчужиной Танариса. Но рвение не спасло их, и постепенно большую часть земель пришлось отдать завоевателям. Теперь обитатели Зул\'Фаррака трудятся над созданием чудовищной армии мертвых троллей, которая должна захватить прилежащие территории. А еще говорят, что в недрах города спит древнее существо – и если оно проснется, то на Танарис прольется кровавый дождь.", "interface\\encounterjournal\\ui-ej-dungeonbutton-zulfarrak.blp", "interface\\lfgframe\\lfgicon-zulfarak.blp", "interface\\encounterjournal\\ui-ej-background-zulfarrak.blp", "interface\\encounterjournal\\ui-ej-lorebg-zulfarrak.blp", 209, 0, 4, 0, 241, 871},
    [247] = {"Аукенайские гробницы", "Дренорским изгнанникам смерть казалась неприятным и неблаговидным последствием жизни. Поэтому дренеи скрывали своих мертвых в подземном некрополе Аукиндоне. Этот чудо-лабиринт раскинулся под самым лесом Тероккар.", "interface\\encounterjournal\\ui-ej-dungeonbutton-auchindoun.blp", "interface\\lfgframe\\lfgicon-auchindoun.blp", "interface\\encounterjournal\\ui-ej-background-auchindoun.blp", "interface\\encounterjournal\\ui-ej-lorebg-auchindoun.blp", 558, 0, 2, 0, 247, 722},
    [248] = {"Бастионы Адского Пламени", "Практически неприступная цитадель Адского Пламени, расположенная в самом центре одноименного полуострова в Запределье, служила плацдармом для войск Орды в ходе Первой и Второй войн.", "interface\\encounterjournal\\ui-ej-dungeonbutton-hellfirecitadel.blp", "interface\\lfgframe\\lfgicon-hellfirecitadel.blp", "interface\\encounterjournal\\ui-ej-background-hellfirecitadel.blp", "interface\\encounterjournal\\ui-ej-lorebg-hellfirecitadel.blp", 543, 0, 3, 0, 248, 848},
    [250] = {"Гробницы Маны", "Дренорским изгнанникам смерть казалась неприятным и неблаговидным последствием жизни. Поэтому дренеи скрывали своих мертвых в подземном некрополе Аукиндоне. Этот чудо-лабиринт раскинулся под самым лесом Тероккар.", "interface\\encounterjournal\\ui-ej-dungeonbutton-auchindoun.blp", "interface\\lfgframe\\lfgicon-auchindoun.blp", "interface\\encounterjournal\\ui-ej-background-auchindoun.blp", "interface\\encounterjournal\\ui-ej-lorebg-auchindoun.blp", 557, 0, 5, 1, 250, 842},
    [252] = {"Сетеккские залы", "Дренорским изгнанникам смерть казалась неприятным и неблаговидным последствием жизни. Поэтому дренеи скрывали своих мертвых в подземном некрополе Аукиндоне. Этот чудо-лабиринт раскинулся под самым лесом Тероккар.", "interface\\encounterjournal\\ui-ej-dungeonbutton-auchindoun.blp", "interface\\lfgframe\\lfgicon-auchindoun.blp", "interface\\encounterjournal\\ui-ej-background-auchindoun.blp", "interface\\encounterjournal\\ui-ej-lorebg-auchindoun.blp", 556, 0, 11, 0, 252, 833},
    [253] = {"Темный лабиринт", "Дренорским изгнанникам смерть казалась неприятным и неблаговидным последствием жизни. Поэтому дренеи скрывали своих мертвых в подземном некрополе Аукиндоне. Этот чудо-лабиринт раскинулся под самым лесом Тероккар.", "interface\\encounterjournal\\ui-ej-dungeonbutton-auchindoun.blp", "interface\\lfgframe\\lfgicon-auchindoun.blp", "interface\\encounterjournal\\ui-ej-background-auchindoun.blp", "interface\\encounterjournal\\ui-ej-lorebg-auchindoun.blp", 555, 0, 13, 0, 253, 834},
    [254] = {"Аркатрац", "Могучую крепость Бурь построили таинственные наару: разумные существа из чистой энергии и заклятые враги Пылающего Легиона. Эта крепость не просто исполняет роль оплота наару, но снабжена технологией перехода в другие измерения, что позволяет ей в мгновение ока перемещаться в новое место.", "interface\\encounterjournal\\ui-ej-dungeonbutton-tempestkeep.blp", "interface\\lfgframe\\lfgicon-tempestkeep.blp", "interface\\encounterjournal\\ui-ej-background-tempestkeep.blp", "interface\\encounterjournal\\ui-ej-lorebg-tempestkeep.blp", 552, 0, 1, 1, 254, 841},
    [256] = {"Кузня Крови", "Практически неприступная цитадель Адского Пламени, расположенная в самом центре одноименного полуострова в Запределье, служила плацдармом для войск Орды в ходе Первой и Второй войн.", "interface\\encounterjournal\\ui-ej-dungeonbutton-hellfirecitadel.blp", "interface\\lfgframe\\lfgicon-hellfirecitadel.blp", "interface\\encounterjournal\\ui-ej-background-hellfirecitadel.blp", "interface\\encounterjournal\\ui-ej-lorebg-hellfirecitadel.blp", 542, 0, 6, 0, 256, 835},
    [257] = {"Ботаника", "Могучую крепость Бурь построили таинственные наару: разумные существа из чистой энергии и заклятые враги Пылающего Легиона. Эта крепость не просто исполняет роль оплота наару, но снабжена технологией перехода в другие измерения, что позволяет ей в мгновение ока перемещаться в новое место.", "interface\\encounterjournal\\ui-ej-dungeonbutton-tempestkeep.blp", "interface\\lfgframe\\lfgicon-tempestkeep.blp", "interface\\encounterjournal\\ui-ej-background-tempestkeep.blp", "interface\\encounterjournal\\ui-ej-lorebg-tempestkeep.blp", 553, 0, 4, 0, 257, 839},
    [258] = {"Механар", "Могучую крепость Бурь построили таинственные наару: разумные существа из чистой энергии и заклятые враги Пылающего Легиона. Эта крепость не просто исполняет роль оплота наару, но снабжена технологией перехода в другие измерения, что позволяет ей в мгновение ока перемещаться в новое место.", "interface\\encounterjournal\\ui-ej-dungeonbutton-tempestkeep.blp", "interface\\lfgframe\\lfgicon-tempestkeep.blp", "interface\\encounterjournal\\ui-ej-background-tempestkeep.blp", "interface\\encounterjournal\\ui-ej-lorebg-tempestkeep.blp", 554, 0, 7, 0, 258, 840},
    [259] = {"Разрушенные залы", "Практически неприступная цитадель Адского Пламени, расположенная в самом центре одноименного полуострова в Запределье, служила плацдармом для войск Орды в ходе Первой и Второй войн.", "interface\\encounterjournal\\ui-ej-dungeonbutton-hellfirecitadel.blp", "interface\\lfgframe\\lfgicon-hellfirecitadel.blp", "interface\\encounterjournal\\ui-ej-background-hellfirecitadel.blp", "interface\\encounterjournal\\ui-ej-lorebg-hellfirecitadel.blp", 540, 0, 10, 1, 259, 843},
    [260] = {"Узилище", "В глубинах Зангартопи сокрыт захваченный подвластный нагам Резервуар Кривого Клыка. Этот резервуар с его гигантскими трубами и клапанами, казалось, мог бы вмещать армии, но назначение у него совсем не военное.", "interface\\encounterjournal\\ui-ej-dungeonbutton-coilfangreservoir.blp", "interface\\lfgframe\\lfgicon-coilfang.blp", "interface\\encounterjournal\\ui-ej-background-coilfangreservoir.blp", "interface\\encounterjournal\\ui-ej-lorebg-coilfangreservoir.blp", 547, 0, 15, 1, 260, 838},
    [261] = {"Паровое подземелье", "В глубинах Зангартопи сокрыт захваченный подвластный нагам Резервуар Кривого Клыка. Этот резервуар с его гигантскими трубами и клапанами, казалось, мог бы вмещать армии, но назначение у него совсем не военное.", "interface\\encounterjournal\\ui-ej-dungeonbutton-coilfangreservoir.blp", "interface\\lfgframe\\lfgicon-coilfang.blp", "interface\\encounterjournal\\ui-ej-background-coilfangreservoir.blp", "interface\\encounterjournal\\ui-ej-lorebg-coilfangreservoir.blp", 545, 0, 9, 0, 261, 837},
    [262] = {"Нижетопь", "В глубинах Зангартопи сокрыт захваченный подвластный нагам Резервуар Кривого Клыка. Этот резервуар с его гигантскими трубами и клапанами, казалось, мог бы вмещать армии, но назначение у него совсем не военное.", "interface\\encounterjournal\\ui-ej-dungeonbutton-coilfangreservoir.blp", "interface\\lfgframe\\lfgicon-coilfang.blp", "interface\\encounterjournal\\ui-ej-background-coilfangreservoir.blp", "interface\\encounterjournal\\ui-ej-lorebg-coilfangreservoir.blp", 546, 0, 8, 0, 262, 836},
    [271] = {"Ан'кахет: Старое Королевство", "Империя Азжол-Неруб находилась на пике своего могущества, когда армии Короля-лича прибыли в Нордскол. Несмотря на ожесточенное сопротивление, войскам Плети удалось захватить подземное царство и вырезать его жителей, нерубов. Опаленная годами войн и запустевшая, обширная империя поделена на два фронта.", "interface\\encounterjournal\\ui-ej-dungeonbutton-ahnkahettheoldkingdom.blp", "interface\\lfgframe\\lfgicon-ahnkalet.blp", "interface\\encounterjournal\\ui-ej-background-ahnkahettheoldkingdom.blp", "interface\\encounterjournal\\ui-ej-lorebg-ahnkahettheoldkingdom.blp", 619, 0, 3, 1, 271, 522},
    [272] = {"Азжол-Неруб", "Империя Азжол-Неруб находилась на пике своего могущества, когда армии Короля-лича прибыли в Нордскол. Несмотря на ожесточенное сопротивление, войскам Плети удалось захватить подземное царство и вырезать его жителей, нерубов. Опаленная годами войн и запустевшая, обширная империя поделена на два фронта.", "interface\\encounterjournal\\ui-ej-dungeonbutton-azjolnerub.blp", "interface\\lfgframe\\lfgicon-azjolnerub.blp", "interface\\encounterjournal\\ui-ej-background-azjolnerub.blp", "interface\\encounterjournal\\ui-ej-lorebg-azjolnerub.blp", 601, 0, 3, 0, 272, 533},
    [273] = {"Крепость Драк'Тарон", "Крепость Драк\'Тарон, расположенная на окраине королевства Зул’Драк, когда-то служила мощным форпостом драккари. Но в результате вторжения сил Плети крепость оказалась во власти Короля-лича. Ее погибшие защитники были обращены в нежить. Теперь они продвигаются вглубь земель драккари.", "interface\\encounterjournal\\ui-ej-dungeonbutton-draktharonkeep.blp", "interface\\lfgframe\\lfgicon-draktharon.blp", "interface\\encounterjournal\\ui-ej-background-draktharonkeep.blp", "interface\\encounterjournal\\ui-ej-lorebg-draktharonkeep.blp", 600, 0, 8, 0, 273, 534},
    [274] = {"Гундрак", "Троллям Зул\'драка во что бы то ни стало требовалось спасти свое королевство от уничтожения, и они восстали против Древних Богов. Божества дикой природы превратились в источники неисчерпаемой силы, а кровь их стала главным оружием против армии Короля-лича, в рядах которой присутствовали и тролли. Герои уже отправлялись в эти неспокойные земли, чтобы сразиться с дикими драккари и их безумными пророками.", "interface\\encounterjournal\\ui-ej-dungeonbutton-gundrak.blp", "interface\\lfgframe\\lfgicon-gundrak.blp", "interface\\encounterjournal\\ui-ej-background-gundrak.blp", "interface\\encounterjournal\\ui-ej-lorebg-gundrak.blp", 604, 0, 5, 1, 274, 530},
    [275] = {"Чертоги Молний", "Покидая Азерот, титаны доверили лучшим защитникам охрану Ульдуара, таинственного города, укрытого пиками Грозовой гряды. Первым среди своих братьев был назван страж по имени Локен, но осознав, какую мощь оставили после себя титаны, он поддался тьме и вверг город в пучину хаоса.", "interface\\encounterjournal\\ui-ej-dungeonbutton-hallsoflightning.blp", "interface\\lfgframe\\lfgicon-hallsoflightning.blp", "interface\\encounterjournal\\ui-ej-background-hallsoflightning.blp", "interface\\encounterjournal\\ui-ej-lorebg-hallsoflightning.blp", 602, 0, 15, 1, 275, 525},
    [276] = {"Залы Отражений", "Противостояние защитников Азерота и армии Короля-лича продолжалось долгие годы. За это время пало множество героев, а после смерти они были вынуждены присоединиться к чудовищной армии нежити. В ходе этого безустанного противостояния Тирион Фордринг из Серебряного Авангарда объединил силы с рыцарями Черного Клинка под командованием Дариона Могрейна. Теперь эта объединенная армия, получившая название Пепельный союз, собирается взять штурмом цитадель Ледяной Короны.", "interface\\encounterjournal\\ui-ej-dungeonbutton-hallsofreflection.blp", "interface\\lfgframe\\lfgicon-hallsofreflection.blp", "interface\\encounterjournal\\ui-ej-background-hallsofreflection.blp", "interface\\encounterjournal\\ui-ej-lorebg-hallsofreflection.blp", 668, 0, 6, 0, 276, 603},
    [277] = {"Чертоги Камня", "Покидая Азерот, титаны доверили лучшим защитникам охрану Ульдуара, таинственного города, укрытого пиками Грозовой гряды. Первым среди своих братьев был назван страж по имени Локен, но осознав, какую мощь оставили после себя титаны, он поддался тьме и вверг город в пучину хаоса.", "interface\\encounterjournal\\ui-ej-dungeonbutton-hallsofstone.blp", "interface\\lfgframe\\lfgicon-hallsofstone.blp", "interface\\encounterjournal\\ui-ej-background-hallsofstone.blp", "interface\\encounterjournal\\ui-ej-lorebg-hallsofstone.blp", 599, 0, 14, 0, 277, 526},
    [278] = {"Яма Сарона", "Противостояние защитников Азерота и армии Короля-лича продолжалось долгие годы. За это время пало множество героев, а после смерти они были вынуждены присоединиться к чудовищной армии нежити. В ходе этого безустанного противостояния Тирион Фордринг из Серебряного Авангарда объединил силы с рыцарями Черного Клинка под командованием Дариона Могрейна. Теперь эта объединенная армия, получившая название Пепельный союз, собирается взять штурмом цитадель Ледяной Короны.", "interface\\encounterjournal\\ui-ej-dungeonbutton-pitofsaron.blp", "interface\\lfgframe\\lfgicon-pitofsaron.blp", "interface\\encounterjournal\\ui-ej-background-pitofsaron.blp", "interface\\encounterjournal\\ui-ej-lorebg-pitofsaron.blp", 658, 0, 16, 1, 278, 602},
    [280] = {"Кузня Душ", "Противостояние защитников Азерота и армии Короля-лича продолжалось долгие годы. За это время пало множество героев, а после смерти они были вынуждены присоединиться к чудовищной армии нежити. В ходе этого безустанного противостояния Тирион Фордринг из Серебряного Авангарда объединил силы с рыцарями Черного Клинка под командованием Дариона Могрейна. Теперь эта объединенная армия, получившая название Пепельный союз, собирается взять штурмом цитадель Ледяной Короны.", "interface\\encounterjournal\\ui-ej-dungeonbutton-theforgeofsouls.blp", "interface\\lfgframe\\lfgicon-theforgeofsouls.blp", "interface\\encounterjournal\\ui-ej-background-theforgeofsouls.blp", "interface\\encounterjournal\\ui-ej-lorebg-theforgeofsouls.blp", 632, 0, 10, 0, 280, 601},
    [281] = {"Нексус", "Аспект из рода синих драконов, Малигос, вознамерился вновь обрести контроль над силами магии. Он начал ожесточенную борьбу за то, чтобы разорвать связь смертных с тайной энергией Азерота. Теперь синие драконы направляют потоки энергии всего мира к Нексусу, гигантскому логову Малигоса.", "interface\\encounterjournal\\ui-ej-dungeonbutton-thenexus.blp", "interface\\lfgframe\\lfgicon-thenexus.blp", "interface\\encounterjournal\\ui-ej-background-thenexus.blp", "interface\\encounterjournal\\ui-ej-lorebg-thenexus.blp", 576, 0, 11, 1, 281, 520},
    [282] = {"Окулус", "Аспект из рода синих драконов, Малигос, вознамерился вновь обрести контроль над силами магии. Он начал ожесточенную борьбу за то, чтобы разорвать связь смертных с тайной энергией Азерота. Теперь синие драконы направляют потоки энергии всего мира к Нексусу, гигантскому логову Малигоса.", "interface\\encounterjournal\\ui-ej-dungeonbutton-theoculus.blp", "interface\\lfgframe\\lfgicon-theoculus.blp", "interface\\encounterjournal\\ui-ej-background-theoculus.blp", "interface\\encounterjournal\\ui-ej-lorebg-theoculus.blp", 578, 0, 12, 0, 282, 528},
    [283] = {"Аметистовая крепость", "Изящные шпили и исполненные волшебством улицы Даларана как никогда прекрасны, но в могучих стенах Аметистовой Крепости заключена нечистая сила. В крепости издревле держали в неволе всех тех, кто угрожал благополучию города. За узниками крепости неотступно наблюдает Кирин-Тор. Неожиданное нападение поставило под сомнение неприступность крепостных стен и подвергло опасности горожан.", "interface\\encounterjournal\\ui-ej-dungeonbutton-violethold.blp", "interface\\lfgframe\\lfgicon-theviolethold.blp", "interface\\encounterjournal\\ui-ej-background-violethold.blp", "interface\\encounterjournal\\ui-ej-lorebg-violethold.blp", 608, 0, 2, 0, 283, 536},
    [285] = {"Крепость Утгард", "Долгое время крепость Утгард считалась заброшенной. Она была лишь памятником погибшей цивилизации, сгинувшей среди обрывов Ревущего фьорда. Но недавно что-то пробудило спящих обитателей крепости – врайкулов.", "interface\\encounterjournal\\ui-ej-dungeonbutton-utgardekeep.blp", "interface\\lfgframe\\lfgicon-utgarde.blp", "interface\\encounterjournal\\ui-ej-background-utgardekeep.blp", "interface\\encounterjournal\\ui-ej-lorebg-utgardekeep.blp", 574, 0, 9, 0, 285, 523},
    [286] = {"Вершина Утгард", "Долгое время крепость Утгард считалась заброшенной. Она была лишь памятником погибшей цивилизации, сгинувшей среди обрывов Ревущего фьорда. Но недавно что-то пробудило спящих обитателей крепости – врайкулов.", "interface\\encounterjournal\\ui-ej-dungeonbutton-utgardepinnacle.blp", "interface\\lfgframe\\lfgicon-utgardepinnacle.blp", "interface\\encounterjournal\\ui-ej-background-utgardepinnacle.blp", "interface\\encounterjournal\\ui-ej-lorebg-utgardepinnacle.blp", 575, 0, 4, 1, 286, 524},
    [741] = {"Огненные недра", "В глубинах Черной Горы лежат Огненные Недра. Именно здесь, в сердце Черной Горы, не в силах совладать с гражданской войной среди дворфов, император Таурисcан привел в наш мир Повелителя Огня - Рагнароса. Хотя Повелитель Огня не может удалиться от пылающих Недр, говорят, что дворфы из клана Темной Стали находятся под властью его духов-приспешников, собирающих армию созданий из ожившего камня. Пылающее озеро, в котором спит Рагнарос, служит вратами в обитель стихий огня, через которые и пробираются в наш мир зловредные духи стихий. Первый среди прислужников Рагнароса — Мажордом Экзекутус. Этот коварный гуманоид — единственный, кто может пробудить Повелителя Огня от сна.", "interface\\encounterjournal\\ui-ej-dungeonbutton-moltencore.blp", "interface\\lfgframe\\lfgicon-moltencore.blp", "interface\\encounterjournal\\ui-ej-background-moltencore.blp", "interface\\encounterjournal\\ui-ej-lorebg-moltencore.blp", 409, 0, 1, 16, 741, 877},
    [742] = {"Логово Крыла Тьмы", "Логово Крыла Тьмы расположено на самой вершине пика Черной горы. Этот величественный шпиль, высеченный из древнего камня, был выстроен по задумке дракона, и теперь в его темных залах проводит свои кошмарные эксперименты старший сын Смертокрыла – Нефариан. Он управляет могучими существами, словно марионетками, и скрещивает потомство различных драконьих родов. Результаты его трудов ужасают, и если он добьется успеха, он сможет воплотить в жизнь еще более зловещие планы. Но владыка Черной горы – не простой исследователь, а могучий дракон, обосновавшийся в хорошо укрепленном логове. Могут ли смертные бросить ему вызов? ", "interface\\encounterjournal\\ui-ej-dungeonbutton-blackwinglair.blp", "interface\\lfgframe\\lfgicon-blackwinglair.blp", "interface\\encounterjournal\\ui-ej-background-blackwinglair.blp", "interface\\encounterjournal\\ui-ej-lorebg-blackwinglair.blp", 469, 0, 2, 16, 742, 885},
    [743] = {"Руины Ан'Киража", "В последние часы войны Зыбучих Песков объединенные силы ночных эльфов и четырех драконьих кланов пробились в самое сердце киражской империи, к городу Ан\'Кираж. Но у самых ворот они столкнулись с невиданным прежде сопротивлением силитидов. В конце концов, окончательно победить силитидов и их киражских хозяев не удалось. Их заключили за магическим барьером, а проклятый город остался лежать в руинах. С тех пор прошла тысяча лет, но киражские силы не дремали. Из ульев явились новые враги, и в руинах Ан\'Киража вновь кишат силитиды и киражи. Чтобы Азерот не пал под очередным ударом киражской армии, надо устранить возникшую угрозу. ", "interface\\encounterjournal\\ui-ej-dungeonbutton-ruinsofahnqiraj.blp", "interface\\lfgframe\\lfgicon-aqruins.blp", "interface\\encounterjournal\\ui-ej-background-ruinsofahnqiraj.blp", "interface\\encounterjournal\\ui-ej-lorebg-ruinsofahnqiraj.blp", 509, 0, 4, 16, 743, 881},
    [744] = {"Храм Ан'Киража", "В сердце Ан\'Киража лежит древний храмовый квартал. Построенный в незапамятные времена, он напоминает о неназываемых богах и служит огромным инкубатором для киражской армии. Вот уже тысячу лет, со дня окончания войны Зыбучих Песков, императоры-близнецы заключены в собственном храме. Их едва удерживает магический барьер, воздвигнутый бронзовым драконом Анахроносом и ночными эльфами. Скипетр Зыбучих Песков восстановлен, а печать разбита, и путь во внутреннее святилище Ан\'Киража открыт. Среди кишащих силитидов за храмом Ан\'Киража, киражские легионы готовятся к вторжению. Их надо остановить любой ценой, прежде чем армии инсектоидов снова обрушатся на Калимдор и начнется вторая война Зыбучих Песков! ", "interface\\encounterjournal\\ui-ej-dungeonbutton-templeofahnqiraj.blp", "interface\\lfgframe\\lfgicon-aqtemple.blp", "interface\\encounterjournal\\ui-ej-background-templeofahnqiraj.blp", "interface\\encounterjournal\\ui-ej-lorebg-templeofahnqiraj.blp", 531, 0, 5, 16, 744, 893},
    [745] = {"Каражан", "Каражан, также известный, как Башня Медива – является по сути своей покинутой магической башней, расположенной в перевале Мертвого Ветра, под местом, в котором сходятся все силовые линии мира Азерот. Башня известна благодаря ее последнему хозяину – Медиву, последнему стражу ордена Тирисфаля. После того, как Медив был убит Кадгаром, Лотаром и Гароной, башня закрылась от внешнего мира. Но недавно Каражан пробудился – что-то темное заняло башню, по ее коридорам отныне ходят неупокоенные духи и демоны... и даже присутствие самого Медива все еще чувствуется, даже спустя десятилетия после его смерти. ", "interface\\encounterjournal\\ui-ej-dungeonbutton-karazhan.blp", "interface\\lfgframe\\lfgicon-karazhan.blp", "interface\\encounterjournal\\ui-ej-background-karazhan.blp", "interface\\encounterjournal\\ui-ej-lorebg-karazhan.blp", 532, 0, 1, 16, 745, 867},
    [746] = {"Логово Груула", "Когда коварный драконий Аспект Смертокрыл проведал о Темном Портале и Дреноре, он ни минуты не сомневался, что дренорцы едва ли посмеют когда-нибудь перечить черным драконам. А потому он запрятал кладки яиц по всему миру. В Острогорье он оставил у кладки очень слабую охрану — и жестоко на этом просчитался. На драконов-стражников напали гронны, обитатели Острогорья. Их предводитель Груул насадил всех стражей на вершины утесов. Сегодня острогорские огры чтут Груула Драконобоя как божество. Его могучие сыновья свирепствуют и дома, в горах, и на равнинах Награнда. Груул невероятно силен и опытен в бою, и если бы ему вздумалось напасть на Орду или Альянс в Запределье, он стал бы крайне опасным противником. ", "interface\\encounterjournal\\ui-ej-dungeonbutton-gruulslair.blp", "interface\\lfgframe\\lfgicon-gruulslair.blp", "interface\\encounterjournal\\ui-ej-background-gruulslair.blp", "interface\\encounterjournal\\ui-ej-lorebg-gruulslair.blp", 565, 0, 2, 16, 746, 864},
    [747] = {"Логово Магтеридона", "Поверженного властителя преисподней оставили в живых и заключили в цитадели Адского Пламени. Скованный железными цепями и узами магии, он находится на грани жизни и смерти, а подданные Иллидана каждый день выкачивают проклятую кровь из его вен. На этой крови было выращено целое новое войско – варварские орки Скверны. И дабы остановить его, Магтеридон должен быть уничтожен.", "interface\\encounterjournal\\ui-ej-dungeonbutton-magtheridonslair.blp", "interface\\lfgframe\\lfgicon-hellfirecitadelraid.blp", "interface\\encounterjournal\\ui-ej-background-magtheridonslair.blp", "interface\\encounterjournal\\ui-ej-lorebg-magtheridonslair.blp", 544, 0, 3, 16, 747, 865},
    [748] = {"Змеиное святилище", "Кто властвует над водами, тому покорно все Запределье. Этот урок леди Вайш, преданная сподвижница и доверенное лицо Иллидана Ярости Бури, усвоила на службе у своего повелителя. Вскоре после Третьей войны, когда Иллидан обратился за помощью к нагам, на его призыв откликнулся отряд под предводительством леди Вайш. Она последовала за Иллиданом со всей неистовостью слепой преданности. Сейчас колдунья обосновалась в Змеином Святилище и внимательно следит оттуда за ходом операций в Кривом Клыке. Вайш куда как больше по нутру воды Резервуара, чем холодная каменная темница Черного храма. Здесь она может присматривать за своими подданными и самолично руководить осушением Зангартопи.", "interface\\encounterjournal\\ui-ej-dungeonbutton-coilfangreservoir.blp", "interface\\lfgframe\\lfgicon-serpentshrinecavern.blp", "interface\\encounterjournal\\ui-ej-background-coilfangreservoir.blp", "interface\\encounterjournal\\ui-ej-lorebg-coilfangreservoir.blp", 548, 0, 5, 16, 748, 862},
    [749] = {"Око", "Запределье стало главным фронтом сражения с Пылающим Легионом, и наару воспользовались Крепостью Бурь, чтобы добраться до расколотой планеты. Но после высадки крепость оккупировал принц Кель\'тас и его армия эльфов крови. Они быстро взяли под свой контроль и корабли-спутники. Теперь принц, ведомый неясными целями, пытается разобраться в технологиях наару, чтобы овладеть энергией хаоса самой Пустоверти.", "interface\\encounterjournal\\ui-ej-dungeonbutton-tempestkeep.blp", "interface\\lfgframe\\lfgicon-tempestkeep.blp", "interface\\encounterjournal\\ui-ej-background-tempestkeep.blp", "interface\\encounterjournal\\ui-ej-lorebg-tempestkeep.blp", 550, 0, 6, 16, 749, 861},
    [753] = {"Склеп Аркавона", "Над промерзшим Драконьим Погостом и негостеприимной, пустынной Борейской Тундрой возвышается плато, которое жители Нордскола назвали Ледяными Оковами. Веками оно оставалось не потревоженным, и ледяные ветра беспрепятственно проносились, завывая, между древними укреплениями, построенными титанами. Однако изобилие даров земли и стратегическое положение укреплений титанов превратили Ледяные Оковы в главное поле битвы между Ордой и Альянсом. Кроме того, не прекращаются слухи, будто бы под крепостью Ледяных Оков обитает древний титан. Можно лишь представить себе, какие богатства сокрыты в этой сокровищнице... ", "interface\\encounterjournal\\ui-ej-dungeonbutton-vaultofarchavon.blp", "interface\\lfgframe\\lfgicon-vaultofarchavon.blp", "interface\\encounterjournal\\ui-ej-background-vaultofarchavon.blp", "interface\\encounterjournal\\ui-ej-lorebg-vaultofarchavon.blp", 624, 0, 2, 16, 753, 532},
    [754] = {"Наксрамас", "Наксрамас, полный новой силы, вновь появился уже над истерзанным войной Драконим Погостом, и вновь им командует Кел\'Тузад, скрывающийся в ледяном сердце цитадели. Его воинство осадило Крепость Стражей Зимы, но война против Плети становится все более ожесточенной. Падение Наксрамаса может переломить ход битвы с Королем-личом, поражение же может ознаменовать его победу. ", "interface\\encounterjournal\\ui-ej-dungeonbutton-naxxramas.blp", "interface\\lfgframe\\lfgicon-naxxramas.blp", "interface\\encounterjournal\\ui-ej-background-naxxramas.blp", "interface\\encounterjournal\\ui-ej-lorebg-naxxramas.blp", 533, 0, 3, 16, 754, 535},
    [755] = {"Обсидиановое святилище", "Во время войны Нексуса предводительница красных драконов Алекстраза Хранительница Жизни поручила своим отпрыскам узнать о любой опасности, которая может скрываться внутри Драконьего Союза. Красные драконы быстро обнаружили гнездо с яйцами сумеречных драконов, порочными созданиями Смертокрыла Разрушителя, спрятанное в Обсидиановом святилище рода черных драконов. Красные драконы, изнуренные борьбой с Плетью и с синими драконами, не решились открыто выступить против Обсидианового святилища, опасаясь еще больших потерь среди союзников. Вместо этого супруг Алекстразы Кориалстраз сообщил о яйцах сумеречных драконов своим союзникам - даларанскому Совету Шести, в надежде что отважные герои очистят святилище от сумеречных детей Смертокрыла.", "interface\\encounterjournal\\ui-ej-dungeonbutton-obsidiansanctum.blp", "interface\\lfgframe\\lfgicon-chamberofaspects.blp", "interface\\encounterjournal\\ui-ej-background-obsidiansanctum.blp", "interface\\encounterjournal\\ui-ej-lorebg-obsidiansanctum.blp", 615, 0, 4, 16, 755, 531},
    [756] = {"Око Вечности", "Чтобы решить, как поступить с безрассудным Малигосом, Алекстраза и другие драконы решили держать совет в Храме Драконьего Покоя. Собравшимся пришлось согласиться с тем, что спасти Хранителя Магии уже нельзя. С помощью красных драконов герои Азерота смогут сделать то, что прежде казалось невозможным: сразиться с Малигосом в Оке Вечности. Победа над Малигосом может спасти Азерот, но неизбежно ознаменует начало новой эпохи: мир наполнится магической энергией, и не будет дракона, которому хватило бы сил контролировать ее. Смерть Малигоса грозит обернуться бедой не только для драконьих родов, но и для всего мира. ", "interface\\encounterjournal\\ui-ej-dungeonbutton-eyeofeternity.blp", "interface\\lfgframe\\lfgicon-malygos.blp", "interface\\encounterjournal\\ui-ej-background-eyeofeternity.blp", "interface\\encounterjournal\\ui-ej-lorebg-eyeofeternity.blp", 616, 0, 7, 16, 756, 527},
    [757] = {"Испытание крестоносца", "Испытание крестоносца - турнир Альянса и Орды, призванный отобрать лучших чемпионов, дабы они, возглавив силы Пепельного Союза, проникли в самое сердце Плети - Цитадель Ледяной Короны. Но пройти испытание могут лишь самые сильные воители. Им предстоит пройти бои с чудовищами, другими воинами, и с могущественными слугами Короля-Лича.", "interface\\encounterjournal\\ui-ej-dungeonbutton-trialofthecrusader.blp", "interface\\lfgframe\\lfgicon-argentraid.blp", "interface\\encounterjournal\\ui-ej-background-trialofthecrusader.blp", "interface\\encounterjournal\\ui-ej-lorebg-trialofthecrusader.blp", 649, 0, 7, 16, 757, 543},
    [758] = {"Цитадель Ледяной Короны", "Цитадель Ледяной Короны - огромная крепость Плети и последний оплот Короля-Лича. Расположенная в ледяных пустошах Ледяной Короны на Нордсколе, Цитадель была воздвигнута вокруг Ледяного Трона, хранившего в себе дух Нер\'зула, пока Артас Менетил не стал новым Королем-Личом. В этой крепости, созданной из саронита, сокрылись самые мощные и отвратительные приспешники Плети - огромная армия живых мертвецов, которая стоит на страже Короля-Лича от тех, кто пытается уничтожить его. Судьба мира зависит от победы или поражения героев, осадивших эту цитадель.", "interface\\encounterjournal\\ui-ej-dungeonbutton-icecrowncitadel.blp", "interface\\lfgframe\\lfgicon-icecrowncitadel.blp", "interface\\encounterjournal\\ui-ej-background-icecrowncitadel.blp", "interface\\encounterjournal\\ui-ej-lorebg-icecrowncitadel.blp", 631, 0, 9, 16, 758, 604},
    [760] = {"Логово Ониксии", "Небольшая пещера на юге Пылевых топей. Эта пещера - укрытие Ониксии и её стражей, оставшихся стражей Черных Драконов. Здесь же спрятаны все её драгоценные яйца - страшен будет удел приблизившегося к ним!", "interface\\encounterjournal\\ui-ej-dungeonbutton-onyxia.blp", "interface\\lfgframe\\lfgicon-onyxiaencounter.blp", "interface\\encounterjournal\\ui-ej-background-onyxiaslair.blp", "interface\\encounterjournal\\ui-ej-lorebg-onxyiaslair.blp", 249, 0, 8, 16, 760, 718},
    [761] = {"Рубиновое святилище", "После обнаружения кладки яиц сумеречных драконов в Обсидиановом святилище, Кориалстраз попросил Совет Шести отправить искателей приключений уничтожить их. Это было сделано быстро и без лишнего шума. И хотя все со временем успокоилось, по необъяснимым причинам связь со стражами Рубинового святилища была утеряна. Привратники, стоявшие у портала, оказались убитыми, а магические камни – разрушены. Нынешнее положение Рубинового святилища неизвестно, и ещё меньше известно о напавших на него, так как число чёрных драконов в Нордсколе слишком мало для подобного нападения. Что же за сила посмела напасть на оплот красных драконов, и как они смогли проскользнуть мимо стражников незамеченными?", "interface\\encounterjournal\\ui-ej-dungeonbutton-rubysanctum.blp", "interface\\lfgframe\\lfgicon-rubysanctum.blp", "interface\\encounterjournal\\ui-ej-background-rubysanctum.blp", "interface\\encounterjournal\\ui-ej-lorebg-rubysanctum.blp", 724, 0, 12, 16, 761, 609},
    [762] = {"Огненная Пропасть", "Огненная Пропасть залегает глубоко под Оргриммаром. Ee вулканическими пещерами некогда владели дикие трогги, пока туда не пришли жуткие сектанты из клана Пламенеющего Клинка. Сектанты вызвали в этот мир жуткое создание, имя которому Тарагаман Ненасытный. С помощью его мощи, ходят слухи, что они хотят выбраться из подземелья и захватить Оргриммар. В помощь себе они также призвали к себе в ряды сатира Баззалана, который будет руководить армией сектантов.", "interface\\encounterjournal\\UI-EJ-DUNGEONBUTTON-RagefireChasm.blp", "interface\\lfgframe\\lfgicon-RAGEFIRECHASM.blp", "interface\\encounterjournal\\ui-ej-background-ragefirechasm.blp", "interface\\encounterjournal\\ui-ej-lorebg-ragefirechasm.blp", 389, 0, 17, 0, 762, 680},
    [763] = {"Монастырь Алого Ордена - Кладбище", "Зловещее и мрачное место, полное могил и потемневших надгробий. На этом заброшенном участке земли царит тишина, прерываемая лишь шорохом ветра и далёкими звуками нежити, бродящей среди могил.", "interface\\encounterjournal\\UI-EJ-DUNGEONBUTTON-ScarletMonastery.blp", "interface\\lfgframe\\lfgicon-SCARLETMONASTERY.blp", "interface\\encounterjournal\\ui-ej-background-ScarletMonastery.blp", "interface\\encounterjournal\\ui-ej-lorebg-ScarletMonastery", 189, 10360, 10, 0, 763, 889},
    [764] = {"Монастырь Алого Ордена - Собор", "Монастырь был когда-то великим бастионом Света для священников Лордерона. Во время Третьей войны в момент нашествия Чумы, монастырь был захвачен религиозными фанатиками из Алого Ордена. Фанатики были против всех остальных рас, неважно Орда или Альянс. Они считали что все окружающие их - потенциальные носители Чумы и их надо уничтожить. Отчеты показывают что главной силой Ордена является Командир Алого ордена Могрейн - командующий многочисленными войсками Ордена. Однако, истинным главой Ордена является Верховный инквизитор Вайтмейн - ужасная жрица, использующая воскрешение поверженных воинов, сражающихся после на её стороне.", "interface\\encounterjournal\\UI-EJ-DUNGEONBUTTON-ScarletMonastery.blp", "interface\\lfgframe\\lfgicon-SCARLETMONASTERY.blp", "interface\\encounterjournal\\ui-ej-background-ScarletMonastery.blp", "interface\\encounterjournal\\ui-ej-lorebg-ScarletMonastery.blp", 190, 10361, 11, 0, 764, 940},
    [765] = {"Монастырь Алого Ордена - Библиотека", "В Библиотеке Монастыря Алого Ордена хранятся древние знания, включая многие известные заклинания магов из Кирин-Тора. Когда монастырь был захвачен фанатиками, они получили доступ к очень опасным тайнам этой библиотеки. Самый могущественный чародей Алого Ордена, Доан, изучает эти тайны, чтобы направить свою силу на борьбу с нежитью и всеми нечеловеческими расами.", "interface\\encounterjournal\\UI-EJ-DUNGEONBUTTON-ScarletHalls.blp", "interface\\lfgframe\\lfgicon-ScarletHalls.blp", "interface\\encounterjournal\\ui-ej-background-ScarletHalls.blp", "interface\\encounterjournal\\ui-ej-lorebg-ScarletHalls.blp", 191, 10362, 12, 0, 765, 938},
    [766] = {"Монастырь Алого Ордена - Оружейная", "Самые неистовые бойцы, которые отразили все нападения на монастырь в эти темные времена, участвуют в подготовке новой армии в Оружейной Монастыря Алого ордена. Солдат новой армии объединяет безграничная ненависть к нежити, и они готовы принести любую жертву ради победы ордена.", "interface\\encounterjournal\\UI-EJ-DUNGEONBUTTON-ScarletHalls.blp", "interface\\lfgframe\\lfgicon-ScarletHalls.blp", "interface\\encounterjournal\\ui-ej-background-ScarletHalls.blp", "interface\\encounterjournal\\ui-ej-lorebg-ScarletHalls.blp", 192, 10363, 13, 0, 766, 939},
    [767] = {"Некроситет", "Скрытый среди жутковатых склепов под Каэр Дарроу, Некроситет широко известен в кругах тех, кто хочет обрести власть над смертью. Пост ректора некротических наук занимает темный магистр Гандлинг как самый жестокий и коварный практик некромантии.", "interface\\encounterjournal\\UI-EJ-DUNGEONBUTTON-Scholomance.blp", "interface\\lfgframe\\LFGICON-SCHOLOMANCE.BLP", "interface\\encounterjournal\\UI-EJ-BACKGROUND-Scholomance.blp", "interface\\encounterjournal\\UI-EJ-LOREBG-Scholomance.blp", 289, 0, 14, 0, 767, 890},
    [768] = {"Черные топи ", "В Глубине пещер Времени пробудился погруженный в раздумья дракон Ноздорму. Еще на заре мироздания бронзовые драконы неусыпно хранили запутанный лабиринт временных потоков и следили за хрупким равновесием времени.", "interface\\encounterjournal\\UI-EJ-DUNGEONBUTTON-CavernsOfTime.blpp", "interface\\lfgframe\\LFGIcon-CavernsOfTime.BLP", "interface\\encounterjournal\\UI-EJ-BACKGROUND-CavernsOfTime.blp", "interface\\encounterjournal\\UI-EJ-LOREBG-CavernsOfTime.blp", 269, 0, 16, 1024, 768, 844},
    [769] = {"Очищение Стратхольма", "В Глубине пещер Времени пробудился погруженный в раздумья дракон Ноздорму. Еще на заре мироздания бронзовые драконы неусыпно хранили запутанный лабиринт временных потоков и следили за хрупким равновесием времени.", "interface\\encounterjournal\\UI-EJ-DUNGEONBUTTON-TheCullingOfStratholme.blp", "interface\\lfgframe\\LFGIcon-CavernsOfTime.BLP", "interface\\encounterjournal\\UI-EJ-BACKGROUND-TheCullingOfStratholme.blp", "interface\\encounterjournal\\UI-EJ-LOREBG-TheCullingOfStratholme.blp", 595, 0, 13, 1024, 769, 521},
    [771] = {"Ульдуар", "Ульдуар представляет собой загадочное подземное царство льда и камня. С момента его недавнего открытия многие задавались вопросом, каково могло быть первоначальное предназначение структуры. Некоторые думали, что это город, построенный, чтобы возвещать славу его создателей. Некоторые думали, что это хранилище, содержащее бесчисленные сокровища, возможно, даже реликвии самих могучих Титанов. Такие предположения были ошибочными. За воротами Ульдуара нет города, нет хранилища сокровищ, нет окончательного ответа на загадки Титанов. Все, что ожидает тех, кто осмелится ступить в Ульдуар, - это ужас, который даже Титаны не могут, и не хотят уничтожить, зло, которое они просто... сдерживают.", "interface\\encounterjournal\\UI-EJ-DUNGEONBUTTON-Ulduar.blp", "interface\\lfgframe\\LFGIcon-Ulduar.blp", "interface\\encounterjournal\\UI-EJ-BACKGROUND-Ulduar.blp", "interface\\encounterjournal\\UI-EJ-LOREBG-Ulduar.blp", 603, 0, 6, 16, 771, 529},
    [772] = {"Старые предгорья Хилсбрада", "В Глубине пещер Времени пробудился погруженный в раздумья дракон Ноздорму. Еще на заре мироздания бронзовые драконы неусыпно хранили запутанный лабиринт временных потоков и следили за хрупким равновесием времени.", "interface\\encounterjournal\\UI-EJ-DUNGEONBUTTON-CavernsOfTime.blpp", "interface\\lfgframe\\LFGIcon-CavernsOfTime.BLP", "interface\\encounterjournal\\UI-EJ-BACKGROUND-CavernsOfTime.blp", "interface\\encounterjournal\\UI-EJ-LOREBG-CavernsOfTime.blp", 560, 0, 12, 1024, 772, 845},
    [773] = {"Бронзовое Святилище", "Со времени нападения на Рубиновое Святилище остальные врата в Храме Драконьего Покоя были запечатаны - во избежание повторения подобной трагедии. Все меры предосторожности - сторожевые заклинания, бдительные стражи, незримые соглядатаи - все было пущено в ход для обеспечения безопасности Святилищ. Но несмотря на все эти ухищрения в какой-то момент печать на вратах в Бронзовое Святилище стала ослабевать, несмотря на все усилия стражей-хранителей. Словно нечто подтачивало её изнутри. Сама печать тоже неуловимо изменилась - это заметили лишь Бронзовые драконы, чье чувство времени и мира отлично от всех остальных. Рядом с запечатанными вратами они ощущали... тревогу. Словно происходит нечто, чего не должно быть никогда. Наконец печать потеряла устойчивость, и портал в Бронзовое Святилище вновь был отворен. Но он был... странным. Неправильным. Искаженным, словно вывернутым наизнанку. Соридорми из Пещер Времени изучила портал и вынесла вердикт: он ведет куда-то за пределы нашей реальности, в иную временную линию - все еще портал в Бронзовое Святилище, но не наше.. После экстренного совещания драконы обратились за помощью к героям Азерота, продемонстрировавшим свою устойчивость к любым испытаниям и умение выбираться из любой передряги. Опыт, полученный в Пещерах Времени, поможет им докопаться до причин произошедшего... Во всяком случае, так думали Драконы.", "interface\\encounterjournal\\UI-EJ-DUNGEONBUTTON-BronzeSanctum.blp", "interface\\lfgframe\\LFGIcon-HourofTwilight.blp", "interface\\encounterjournal\\UI-EJ-BACKGROUND-BronzeSanctum.blp", "interface\\encounterjournal\\UI-EJ-LOREBG-BronzeSanctum.blp", 734, 0, 10, 16, 773, 924},
    [774] = {"Тол'Гародская тюрьма", "Тол\'Гародская тюрьма была одним из самых защищенных из построенных людьми темниц для разных существ, пока в один момент магический барьер тюрьмы не пал и темные силы не завладели управлением защитных систем. И пока Орда и Альянс сражаются за территории, давно забытые кошмары ждут подходящего момента, чтобы напомнить о себе.", "interface\\encounterjournal\\UI-EJ-DUNGEONBUTTON-BaradinHold.blp", "interface\\lfgframe\\LFGIcon-BaradinHold.blp", "interface\\encounterjournal\\UI-EJ-BACKGROUND-BaradinHold.blp", "interface\\encounterjournal\\UI-EJ-LOREBG-BaradinHold.blp", 838, 0, 11, 16, 774, 954},
    [776] = {"Категории", "Мир Азерота полон безжалостных существ, которые держали в страхе целые континенты, но с приходом в наш мир Сируса, он помог нам объединить героев под своим началом и противостоять этим чудовищам.", "interface\\encounterjournal\\UI-EJ-DUNGEONBUTTON-BrokenIsles.blp", "interface\\lfgframe\\UI-EJ-Home-Icon", "interface\\encounterjournal\\UI-EJ-BACKGROUND-BrokenIsles.blp", "interface\\encounterjournal\\UI-EJ-LOREBG-BrokenIsles.blp", 1, 0, 13, 336, 776, 4},
    [777] = {"Мир", "Многие угрозы миру на Азероте таятся в древних хранилищах или на вершинах парящих цитаделей, однако, некоторые предпочитают не скрываться. Все, у кого есть голова на плечах, стараются держаться подальше от подобных ужасных созданий, однако отважные герои зачастую желают испытать свои силы, сразившись с самыми могучими противниками.", "interface\\encounterjournal\\UI-EJ-DUNGEONBUTTON-WORLD.blp", "interface\\lfgframe\\UI-EJ-Home-Icon", "interface\\encounterjournal\\UI-EJ-BACKGROUND-WORLD.blp", "interface\\encounterjournal\\UI-EJ-LOREBG-WORLD.blp", 10009, 0, 0, 80, 777, 945},
    [778] = {"Битва за гору Хиджал", "В глубине Пещер Времени пробудился Ноздорму, предводитель стаи бронзовых драконов, которые испокон веков оберегали лабиринты времени и следили за хрупким равновесием.Впрочем, не для всех принципы баланса и неприкосновенности истории — святыня. Драконы Бесконечности и их прислужники в бездумном стремлении изменить прошлое, настоящее и будущее раз за разом совершают нападения на пути времени Азерота. Равновесие времен в опасности, и если не спасти прошлое, то... не будет и будущего.", "interface\\encounterjournal\\UI-EJ-DUNGEONBUTTON-CavernsOfTime.blp", "interface\\lfgframe\\LFGIcon-CavernsOfTime.BLP", "interface\\encounterjournal\\UI-EJ-BACKGROUND-CavernsOfTime.blp", "interface\\encounterjournal\\UI-EJ-LOREBG-CavernsOfTime.blp", 534, 0, 7, 272, 778, 863},
    [785] = {"Черный храм", "Давным-давно храм Карабора был самым почитаемым местом на Дреноре, но жрецы, возносившие там молитвы, давно мертвы, убиты жестокими орками, попавшими под власть демонической скверны. После этой бойни чернокнижники Совета Теней захватили святилище и дали ему новое имя – Черный храм.", "interface\\encounterjournal\\UI-EJ-DUNGEONBUTTON-BlackTemple.blp", "interface\\lfgframe\\LFGIcon-BlackTemple.BLP", "interface\\encounterjournal\\UI-EJ-BACKGROUND-BlackTemple.blp", "interface\\encounterjournal\\UI-EJ-LOREBG-BlackTemple.blp", 564, 0, 8, 1808, 785, 847},
}
JOURNALENCOUNTER = {
    [63] = {
        {89, "Рак\'Зор", [[ Огры — крайне забавный народ. Огромная физическая мощь и крайне простой разум Рак'Зора позволили Эдвину ван Клифу нанять этого огра как телохранителя, оплачивая его 'труд' только после предъявления голов нарушителей. ]], 0.365270, 0.612275, 1, 886, 2010, 63, -1, 0, 1},
        {90, "Крошшер Снида", [[ Когда никому неизвестный инженер Снид еще трудился на благо картеля Трюмных Вод, он получил от Братства Справедливости заманчивое предложение на сумму, которую он не заработал бы за всю жизнь. Гоблин спешно принял его и отрекся от прежних хозяев... Впрочем, так поступил бы любой смышленый гоблин. ]], 0.501996, 0.868264, 1, 886, 2020, 63, -1, 0, 2},
        {91, "Гилнид", [[ В создании механических конструктов Гилниду нет равных. Аморальный, даже по гоблинским меркам, Гилнид был изгнан из Бухты, когда его безумный эксперимент вышел из-под контроля на городском рынке. Гилнида не интересует политика, и не играет никакой роли в принятии решений Братства, но Братство спонсирует его эксперименты и предоставляет ему запчасти. Уважение Эдвина ван Клифа к его безумным талантам безгранично. ]], 0.124751, 0.758982, 2, 886, 20009, 63, -1, 0, 3},
        {92, "Капитан Зеленямс", [[ Зеленямс, пират до мозга костей, был нанят Эдвином ван Клифом, который нуждался в команде для чудовищного корабля-джаггернаута. Зеленямс и его команда будут стоять насмерть, ведь обладание подобным кораблем - предел их мечтаний. ]], 0.604791, 0.387724, 2, 886, 2044, 63, -1, 0, 4},
        {95, "Эдвин ван Клиф", [[ Эдвин ван Клиф начинал как квартирным вором в городе Штормград, а его специализацией был обход механических средств защиты. После разрушения города Орда, он обучался строительству из камня и был одним из первых, предложивших свои услуги в перестройке разрушенной столицы. Также он был одним из первых, кто потребовал оплату за свои услуги, за что и был изгнан из города. Ван Клиф собрал группу строителей и инженеров всех мастей, оказавшихся в грязной яме за воротами Штормграда, и основал Братство Справедливости. ]], 0.654691, 0.402695, 2, 886, 2060, 63, -1, 0, 6},
        {11637, "Мистер Каюк", [[ Мистер Смайт первый помощник капитана Зеленямса. Ему нравится играть со своими жертвами, заставляя их поверить в то, что они могут победить, и при этом он постепенно использует все более смертоносное оружие. ]], 0.560000, 0.264000, 2, 886, 20872, 63, -1, 0, 5},
    },
    [64] = {
        {96, "Ретилгор", [[ Ретилгору было доверено сторожить пленников Крепости Темного Клыка, и он намерен оправдать это доверие верной службой. Помимо ярости и физической мощи, присущей всем воргенам, Ретилгор обладает темной способностью - вытягиванием жизненных сил. ]], 0.664671, 0.732036, 1, 891, 2107, 64, -1, 0, 1},
        {97, "Барон Сильверлейн", [[ Барон Сильверлейн некогда был хозяином крепости, захваченной воргенами Аругала. Теперь его неупокоенный дух охраняют растерзавшие его люди-волки, и горе каждому, кто осмелится вторгнуться в его владения. ]], 0.304392, 0.773952, 2, 891, 2118, 64, -1, 0, 2},
        {98, "Командир Спрингвейла", [[ Призрак верного солдата, командира Спрингвейла, бродит по комнате советов, готовый в любой момент обрушить свое нечестивое могущество на захватчиков и отомстить за гибель своего повелителя – барона Сильверлейна. ]], 0.280439, 0.597305, 1, 891, 2137, 64, -1, 0, 3},
        {99, "Фенрус Пожиратель", [[ Огромный черный волк, питомец и страж Аругала, наделенный чудовищной силой и ядовитой слюной, который обитает на верхних этажах башни Аругала, в библиотеке. Горе тому авантюристу, кто попадется на глаза этому чудовищу! ]], 0.544910, 0.537425, 0, 891, 2156, 64, -1, 0, 4},
        {100, "Архимаг Аругал", [[ Некогда Аругал был членом Кирин-Тора, что в Даларане. Однако после того, как Плеть вторглась в Даларан и разрушила его, а многие павшие волшебники были подняты в виде нежити, наполняя Плеть новой силой, Аругал бежал в Крепость Темного Клыка, вокруг которой расположилась деревня Погребальных Костров. Игнорируя предупреждения, он выпустил проклятье воргенов на эти земли, о чем впоследствии глубоко пожалел. Обезумев от вины за случившееся, Аругал принял воргенов как своих детей и заперся в Крепости Темного Клыка. ]], 0.684632, 0.335329, 0, 891, 2164, 64, -1, 0, 5},
    },
    [76] = {
        {175, "Верховный жрец Веноксис", [[ Веноксис был послан убить Хаккара, но оказался порабощен жестоким духом, а затем был убит героями Азерота. Благодаря усилиям приспешников Хаккара его вернули из мира духов и вновь поставили на стражу Зул'Гуруба, где ему теперь прислуживают ядовитые змеи ]], 0.509980, 0.537425, 0, 793, 2793, 76, -1, 0, 0},
        {176, "Мандокир Повелитель Крови", [[ Мандокир Повелитель Крови - яростный воин, повелевающий воителями Гурубаши. Восседая на своем ящере, он наблюдает за обретением воинского мастерства его слугами, и горе тому из них, кто не оправдает доверие Повелителя Крови - он будет мгновенно обезглавлен лично Мандокиром. ]], 0.604791, 0.799401, 0, 793, 2610, 76, -1, 0, 1},
        {177, "Тайник Безумия – Гри\'лек", [[ Среди мятежных духов Тайника Безумия – Гри'лек, зловещий тролль, которого лоа лишили способностей к регенерации, Ренатаки, печально известный воин-изувер, Хазза'рах – провидец, истязаемый видениями будущего, и Вушулай, могучий боец, исполненный силой бурь. ]], 0.599801, 0.462575, 0, 793, 2504, 76, -1, 0, 2},
        {178, "Тайник Безумия – Хазза\'рах", [[ Среди мятежных духов Тайника Безумия – Гри'лек, зловещий тролль, которого лоа лишили способностей к регенерации, Ренатаки, печально известный воин-изувер, Хазза'рах – провидец, истязаемый видениями будущего, и Вушулай, могучий боец, исполненный силой бурь. ]], 0.636700, 0.462575, 0, 793, 2495, 76, -1, 0, 3},
        {179, "Тайник Безумия – Ренатаки", [[ Среди мятежных духов Тайника Безумия – Гри'лек, зловещий тролль, которого лоа лишили способностей к регенерации, Ренатаки, печально известный воин-изувер, Хазза'рах – провидец, истязаемый видениями будущего, и Вушулай, могучий боец, исполненный силой бурь. ]], 0.599801, 0.514970, 0, 793, 2501, 76, -1, 0, 4},
        {180, "Тайник Безумия – Вушулай", [[ Среди мятежных духов Тайника Безумия – Гри'лек, зловещий тролль, которого лоа лишили способностей к регенерации, Ренатаки, печально известный воин-изувер, Хазза'рах – провидец, истязаемый видениями будущего, и Вушулай, могучий боец, исполненный силой бурь. ]], 0.601905, 0.414711, 0, 793, 2498, 76, -1, 0, 5},
        {181, "Верховная жрица Арлокк", [[ Арлокк — верховная жрица, избранница лоа пантеры Бетекк. Следуя соглашению, недавно заключенному между племенами Гурубаши и Зандаларами, Арлокк напустила своих диких питомцев на ничего не подозревающих, обитателей окружающих земель. ]], 0.480040, 0.200599, 0, 793, 2693, 76, -1, 0, 6},
        {184, "Мастер проклятий Джин\'до", [[ Некроманты, как правило, мрачные и замкнутые личности, но мастер проклятий Джин'до вышел далеко за рамки этого шаблона. В своих чертогах, возле алтаря кипящей крови, который находится в Зул'Гурубе, царит вечное веселье — мертвецы, поднятые его волей, танцуют наравне с самим некромантом. Но не стоит позволять образу безумца обмануть вас: Джин'до опасный противник, и без сомнения, могущественный колдун. ]], 0.317338, 0.245509, 0, 793, 2508, 76, -1, 0, 8},
        {185, "Хаккар Свежеватель Душ", [[ Хаккар Свежеватель Душ – жестокий и кровожадный дух, который решил прийти на помощь троллям. Открыв племени Гурубаши секреты крови, он помог им захватить большую часть Тернистой долины и несколько островов Южных морей. Но за свою помощь Хаккар потребовал очень дорогую цену. Его призвали в этот мир вновь, и он восседает в Зул'Гурубе, набирая силу и ожидая своего часа." ]], 0.485030, 0.395210, 0, 793, 2899, 76, -1, 0, 9},
        {192, "Верховный жрец Текал", [[ Верховный жрец Текал — верховный жрец Зандалари Ширваллы, тигриного лоа. Посланный в Зул'Гуруб, чтобы остановить Хаккара Пожирателя Душ, он в конечном итоге был обращен богом крови. Аспект Текала, позволяющий Хаккару периодически приходить в ярость. ]], 0.653000, 0.336000, 0, 793, 951, 76, -1, 0, 7},
    },
    [77] = {
        {11683, "Жертвоприношение Танзара", [[ Несколько авантюристов и исследователей из группы Харрисона были пленены троллями Амани. Если спасти их вовремя, до того как их принесут в жертву, они непременно вознаградят своих спасителей. ]], 0.000000, 0.000000, 0, 781, 0, 77, 1, 0, 7},
        {11684, "Жертвоприношение Краза", [[ Несколько авантюристов и исследователей из группы Харрисона были пленены троллями Амани. Если спасти их вовремя, до того как их принесут в жертву, они непременно вознаградят своих спасителей. ]], 0.000000, 0.000000, 0, 781, 0, 77, 1, 0, 8},
        {11685, "Жертвоприношение Ашли", [[ Несколько авантюристов и исследователей из группы Харрисона были пленены троллями Амани. Если спасти их вовремя, до того как их принесут в жертву, они непременно вознаградят своих спасителей. ]], 0.000000, 0.000000, 0, 781, 0, 77, 1, 0, 9},
        {186, "Акил\'зон", [[ Акил'зон, бывший шаман племени Амани, обладает сверхъестественным даром управлять стихией воздуха. Его способности привлекли внимание Повелителя проклятий Малакрасса, который нашел в его лице достойное вместилище для духа орлиного бога.

|cFFA52A2AСмерть Акил'зона добавит к таймеру жертвоприношения дополнительные 10 минут.|r ]], 0.355290, 0.230539, 0, 866, 2521, 77, 1, 0, 0},
        {187, "Налоракк", [[ Повелитель проклятий Малакрасс счел Налоракка, известного своей неукротимой яростью и дикой силой, идеальным вместилищем для сущности бога-медведя.

|cFFA52A2AСмерть Налоракка добавит к таймеру жертвоприношения дополнительных 15 минут.|r ]], 0.405190, 0.773993, 0, 866, 2867, 77, 1, 0, 1},
        {188, "Джан\'алай", [[ Дракондоры – стремительные хищники, разрывающие жертв на куски острыми как бритва когтями. Один из искуснейших разбойников племени Амани, Джан'алай, очень ценил эти качества и даже разработал похожие приемы для своих атак.

|cFFA52A2AСмерть Джан'алай не добавит к таймеру жертвоприношения дополнительного времени.|r ]], 0.554891, 0.709581, 0, 866, 2621, 77, 1, 0, 2},
        {189, "Халаззи", [[ Азеротские рыси – неукротимые охотники, полосующие жертву когтями и разрывающие зубами. Повелитель проклятий Малакрасс посчитал, что сущность бога-рыси стоит поместить в тело одного из искуснейших охотников племени.

|cFFA52A2AСмерть Халаззи не добавит к таймеру жертвоприношения дополнительного времени.|r ]], 0.584831, 0.238024, 0, 866, 2804, 77, 1, 0, 3},
        {190, "Повелитель проклятий Малакрасс", [[ Ходят слухи, что самый ужасный знахарь племени Амани, Повелитель проклятий Малакрасс, совершил невозможное и заключил сущности нескольких могучих звериных богов в тела своих защитников… оставив для себя самую зловещую сущность. ]], 0.714572, 0.529940, 0, 866, 2706, 77, 1, 0, 4},
        {191, "Зул\'джин", [[ Зул'джин, легенда, однорукий тролль, сражение с которым не под силу даже самым могучим из его рода. Поставивший возрождение империи Амани целью своего существования, он собирает воинов своего племени в Зул'Амане и ищет способы получения новых сил. Именно на него возложена великая миссия – вернуть племени былую славу. Империя Амани возрождается ради мщения.. ]], 0.904193, 0.529940, 0, 866, 2875, 77, 1, 0, 5},
        {11001, "Жертвоприношение Харкора", [[ Несколько авантюристов и исследователей из группы Харрисона были пленены троллями Амани. Если спасти их вовремя, до того как их принесут в жертву, они непременно вознаградят своих спасителей. ]], 0.000000, 0.000000, 0, 781, 12371, 77, 1, 0, 6},
    },
    [227] = {
        {368, "Гхаму-ра", [[ Когда культ Сумеречного Молота прибыл на эти земли, его последователи пленили одного из последних мирных обитателей храма Элуны. Долгие годы сектанты издевались над гигантской черепахой, терзая ее тело и душу, пока бедное существо не обезумело. Сектанты нарекли зверя Гхаму-ра, и теперь они тщатся обуздать его ярость, чтобы защитить свое логово. ]], 0.333333, 0.606870, 1, 873, 20010, 227, -1, 0, 1},
        {426, "Гелихаст", [[ Услышав зов Древних богов, Гелихаст отозвался на него, силой проложив себе путь в Непроглядную пучину и убив десяток ничего не подозревающих послушников культа Сумеречного Молота своими двумя мечами. Культ, потрясенный его жестокостью и свирепостью, позволил ему остаться, и Гелихаст построил собственный алтарь, чтобы приносить жертвы и получать благословения от зловещих сил, обитающих в развалинах храма.  ]], 0.543284, 0.564179, 1, 873, 20011, 227, -1, 0, 3},
        {436, "Леди Саревесс", [[ Культ Сумеречного Молота выделил для Леди Саревесс собственную пещеру в Непроглядной пучине, постоянно принося ей в жертву живых существ. Последователи культа надеялись, что ее ритуалы и исследования дадут им магическую защиту, позволяющую поклоняться ужасной гидре, обитающей в пучине, при этом исключая возможность стать ее обедом. ]], 0.111940, 0.389552, 1, 873, 9476, 227, -1, 0, 2},
        {437, "Повелитель сумрака Келрис", [[ Когда последователи культа обнаружили в недрах Непроглядной пучины странное трехголовое существо, повелитель сумрака Келрис решил, что эта гидра – вестник возвращения Древних богов... И его шанс получить бессмертие. Келрис лично наблюдал за тем, как растет гидра, и даже скармливал ей собственных подданных, чтобы утолить ее бесконечный голод. ]], 0.523880, 0.808209, 2, 873, 9507, 227, -1, 0, 7},
        {444, "Аку\'май", [[ Аку'май – воплощение древнего зла – наделен небольшой долей силы Древних богов. Трехголовая гидра наводит на всех ужас из-за своей бессмысленной кровожадности и страсти к пожиранию живой плоти, но культ Сумеречного Молота почитает Аку'мая как вестника того, что Древние боги скоро вернутся. ]], 0.855224, 0.864179, 2, 873, 9442, 227, -1, 0, 8},
        {447, "Старина Серракис", [[ Многие животные, что плавали под руинами Алтаря Луны, были убиты и съедены после того, как в руинах обосновался культ Сумеречного Молота, но самого большого крепкозуба поймать не удалось никому, а те, кто все же пытался, неизбежно погибали. Старина Серракис - опасный зверь, и горе тому, кто попадется ему в зубы. ]], 0.586567, 0.308955, 3, 873, 20012, 227, -1, 0, 5},
    },
    [228] = {
        {369, "Верховный дознаватель Герштан", [[ Последовательница культа Сумеречного молота Герштан предпочитает все самое лучшее: экзотическую пищу, дорогую одежду и инкрустированные драгоценными камнями орудия пыток. Днем и ночью в тюремных камерах клана Черного Железа раздаются истошные вопли ее пленников. Герштан гордо называет эти леденящие душу звуки своей симфонией криков, и никогда не упустит возможности дополнить свое произведение еще одним голосом. ]], 0.474044, 0.922131, 1, 880, 4630, 228, -1, 0, 1},
        {370, "Лорд Роккор", [[ Лорд Роккор презирает подлость и коварство других элементалей огня. Чтобы не служить рядом с ними в Огненных недрах, он умышленно разгневал Повелителя огня. Рискованный гамбит Роккора удался: его изгнали из недр и отправили в одиночестве охранять глубины Черной горы. ]], 0.556011, 0.670082, 1, 880, 4472, 228, -1, 0, 2},
        {371, "Псарь Гребмар", [[ Много лет назад осиротевший дворф начал разводить сторожевых псов и псов-спутников. Сейчас Гребмар Блохобородый относится к своим гончим, как к членам семьи. Когда псарь со своими верными друзьями не занимается патрулированием глубины Черной горы, он угощает их лучшим элем Черного Железа из 'Угрюмого обжоры'. ]], 0.535002, 0.573466, 1, 880, 4626, 228, -1, 0, 3},
        {372, "Зал Правосудия", [[ За преступления, совершенные против дворфов из клана Черного Железа, есть только одно наказание – смерть. Древняя традиция требует, чтобы виновный заплатил за содеянное кровью в Зале Правосудия, сражаясь с дикими тварями, привезенными со всего Азерота. До сего дня доподлинно неизвестно, удалось ли кому-то выжить после этой жестокой битвы. ]], 0.497785, 0.645796, 1, 880, 4547, 228, -1, 0, 4},
        {373, "Пиромант Зерно Мудрости", [[ Некогда уважаемый Служитель Земли Зерно Мудрости по неизвестным причинам присоединился к культу Сумеречного молота. В глубинах Черной горы он заинтересовался работой известного архитектора клана Черного Железа – Франклорна Искусника. Причина столь необычного интереса неясна, но Зерно Мудрости остается верен культу и готов бороться с его врагами. ]], 0.549180, 0.948770, 2, 880, 4496, 228, -1, 0, 5},
        {374, "Лорд Опалитель", [[ Барон Геддон научил Опалителя правильно использовать свои разрушительные способности, но барон вряд ли подозревал, что его протеже достигнет таких ужасающих успехов. Опасаясь, что Опалитель попытается свергнуть его, Геддон отправил пылающего элементаля из Огненных недр охранять легендарную Черную наковальню, принадлежавшую клану Черного Железа. ]], 0.564208, 0.311475, 1, 880, 4476, 228, -1, 0, 6},
        {375, "Тюремщик Стилгисс", [[ После долгих лет верной службы императору Тауриссану хитроумному магу Стилгиссу доверили охранять казну клана в Черном хранилище. Хороший друг дворфа, псарь Гребмар, в честь этого подарил ему одного из своих злобных псов – Верека. Маг нашел, как распорядиться подарком: Верек постоянно находится рядом с ним, чтобы устрашать тех, кто попытается украсть казну. ]], 0.602459, 0.659836, 2, 880, 4386, 228, -1, 0, 7},
        {376, "Финий Темнострой", [[ Главный архитектор Финий Темнострой получил этот титул, выдавая идеи более талантливых каменщиков за свои. Его невежество и коварство вернули его предшественника Франклорна Искусника с того света. Призрак предыдущего главного архитектора хочет отнять у Темностроя свой невероятно могущественный молот 'Железный друг', пока не произошла трагедия. ]], 0.635246, 0.211066, 1, 880, 4538, 228, -1, 0, 8},
        {377, "Бейл\'Гор", [[ По дороге из черного железа бродит огромный огненный великан Бейл'Гор – свидетельство мастерства дворфов. Он заточен в глубинах Черной горы. Рагнарос нашел этого гиганта на Огненных Просторах и поставил охранять запечатанные двери на одном из концов дороги. Согласно легенде только повелитель Огня и старейшины клана Черного Железа знают, что лежит за этими таинственными вратами. ]], 0.251366, 0.534836, 1, 880, 4532, 228, -1, 0, 9},
        {378, "Генерал Кузня Гнева", [[ Посвятив всю свою жизнь научным изысканиям, генерал Кузня Гнева стал экспертом по военной истории и тактике дворфов. Недавно он разгневал императора Даграна Тауриссана, написав скандальный труд о причинах поражения его клана в военных конфликтах прошлого. Но если не считать этой политической оплошности, Кузня Гнева предан клану Черного Железа до мозга костей. Он будет биться до последнего, защищая свой народ и своего императора. ]], 0.363388, 0.823770, 2, 880, 4508, 228, -1, 0, 10},
        {379, "Повелитель големов Аргелмах", [[ Аргелмах начал создавать големов по своему образу и подобию из-за одержимости бессмертием. Ходят слухи, что он также увлекся темной магией, и его творения могут служить вместилищем для его души, если тело будет уничтожено. ]], 0.364754, 0.651639, 2, 880, 4501, 228, -1, 0, 11},
        {380, "Харли Чернопых", [[ Сказать, что Чернопых – завсегдатай 'Угрюмого обжоры', значит не сказать ничего. За десять с лишним лет этот пьянчуга покинул таверну лишь один раз, чтобы украсть совершенно секретный рецепт Громоварского светлого. По какому-то странному стечению обстоятельств, Чернопых протрезвел ровно настолько, чтобы самому сделать это пиво, и теперь он утверждает, что оно дало ему невероятную силу и храбрость. ]], 0.505668, 0.704778, 2, 880, 4494, 228, -1, 0, 12},
        {381, "Фаланг", [[ До недавнего времени пьяные потасовки в 'Угрюмом обжоре' были обыденным делом. Справиться с этой проблемой кабатчику Штоппору Наливалсу помог могучий голем-вышибала Фаланг. Его задача – поддерживать порядок в заведении и выдворять буйных посетителей, остужая их пыл кулаками. ]], 0.458206, 0.564745, 2, 880, 4504, 228, -1, 0, 13},
        {383, "Штоппор Наливалс", [[ Говорят, что в 'Угрюмом обжоре' все знают, как тебя зовут. Этим духом товарищества таверна обязана усилиям Штоппора Наливалса – лепрогнома, который начал новую жизнь в глубинах Черной горы после падения Гномрегана. Несмотря на то, что раньше он был чернокнижником, Штоппор очень гордится своей работой трактирщика и следит, чтобы кружки его клиентов всегда оставались полными. ]], 0.477220, 0.657122, 2, 880, 4485, 228, -1, 0, 15},
        {384, "Посол Огнехлыст", [[ За верную службу Рагнаросу Огнехлыст был назначен на должность посла клана Черного Железа. Это порочное создание поначалу презирало своих союзников-дворфов, но со временем он проникся уважением к их жажде разрушения. В знак солидарности Огнехлыст охраняет зал Зачарования – священное для дворфов место, в котором они совершенствуют свое оружие. ]], 0.538251, 0.485656, 2, 880, 4482, 228, -1, 0, 16},
        {385, "Семеро", [[ Много столетий назад заклинатель-тан Тауриссан и семь его самых могучих сподвижников из клана Черного Железа по ошибке призвали Рагнароса в Азерот и обрекли весь клан на рабство. Семеро погибли во время ритуала, и их проклятые души скитаются в глубинах Черной горы. Они обречены на вечное служение своему хозяину – новому повелителю клана Черного Железа. ]], 0.538251, 0.247951, 2, 880, 4471, 228, -1, 0, 17},
        {386, "Магмус", [[ Посол Огнехлыст поручил огненному великану Магмусу охрану тронного зала Императора Даграна Тауриссана, но и это не избавило правителя клана Черного Железа от страха. Опасаясь убийц, Император отдал под управление Магмуса огнедышащие статуи, стоящие у входа в императорские покои. ]], 0.796448, 0.118852, 2, 880, 4480, 228, -1, 0, 18},
        {387, "Император Дагран Тауриссан", [[ Император Дагран Тауриссан правит вместе с принцессой Мойрой из соперничающего клана Бронзобород. Не утихают споры о том, зачаровал ли он принцессу или она сознательно вышла за него замуж. Как бы то ни было, правление Тауриссана сулит клану мрачное будущее. Пока он жив, клан Черного Железа служит Рагнаросу и является серьезной угрозой королевствам Азерота. ]], 0.909836, 0.118852, 2, 880, 4645, 228, -1, 0, 19},
    },
    [229] = {
        {11577, "Пиростраж Углевзор", [[ Могущественный огненный элементаль, которого держали в плену в верхних частях Пика Черной горы, Пиростраж Углевзор был пленником нескольких колдунов. Однако, когда колдуны выходили из транса и уничтожались, Провидец угля вырывался и пытался уничтожить все, что находилось рядом с ним. Проход к остальной части шпиля был разрешен только тогда, когда Пиростраж Углевзор был устранен. ]], 0.303000, 0.273000, 6, 882, 20232, 229, -1, 0, 2},
        {11578, "Солакар Пламя Гнева", [[ Завоевание благосклонности среди черных драконов — это двусмысленное благословение. Солакару поручена забота о потомстве дракона Нефариана, но его предупредили, что он заплатит ужасную цену за каждого детеныша, который умрет под его надзором — или просто не оправдает ожиданий. ]], 0.377000, 0.375000, 6, 882, 20238, 229, -1, 0, 2},
        {11579, "Вождь Ренд Чернорук", [[ После того, как Орда потерпела поражение во Второй войне, Ренд Чернорук, сын первого вождя, привел остатки своего клана на Пик Черной горы и сразился с дворфами Черного Железа за владение цитаделью. Ренд объединил своих орков с Нефарианом и стаей черных драконов, которые разбили дворфов и изгнали их из верховий Черной горы. ]], 0.485000, 0.255000, 7, 882, 20241, 229, -1, 0, 2},
        {11580, "Зверь", [[ Зверь — гончая, которую можно найти в Горне, в Верхнем Пике Черной горы. Этот прислужник Рагнароса был схвачен силами Нефариана, подвергнут пыткам для развлечения, а затем переучен, чтобы охранять шпиль от злоумышленников. Один из таких злоумышленников, Финкль Эйнхорн, был проглочен Зверем целиком в ямах на Огненном проливе. С защитой своего лавового костюма гном оставался в чреве Зверя в течение некоторого времени. ]], 0.644000, 0.305000, 7, 882, 20251, 229, -1, 0, 2},
        {11581, "Лорд Вальтхалак", [[ Лорд Вальтхалак — драконид, который вызывается в Верхней Черной горе в Горне с помощью Жаровни Призыва. Знатный и колдун огромной силы, Вальтхалак был генералом Вершины Черной Горы до того, как генерал Драккисат пришел к власти. ]], 0.617000, 0.437000, 7, 882, 20254, 229, -1, 0, 2},
        {11582, "Горалук Треснувшая Наковальня", [[ Горалук Треснувшая Наковальня — орк из Черной горы, обитающий в верхнем пике Черной горы. Он продал свою душу сатиру Лораксу, но нарушил сделку и убежал с Заготовкой рунической кирасы, спрятавшись в пиках Черной Горы. ]], 0.288000, 0.258000, 7, 882, 20258, 229, -1, 0, 2},
        {11583, "Джед Руновед", [[ Джед Руновед — яростный орк, и член Легиона Чернорука. Встретить его не так-то просто; он бродит по комнате Горалука Треснувшая Наковальня и в Печи, где обитает Зверь. ]], 0.393000, 0.258000, 7, 882, 20261, 229, -1, 0, 2},
        {11584, "Генерал Драккисат", [[ Генерал Драккисат был черным драконом, правителем армий драконов Нефариана, сына Смертокрыла. С вершины Верхнего пика Черной горы он руководил своими войсками в их войне, чтобы изгнать дворфов Черного Железа из недр Черной горы. Его личным оружием был Черный клинок Шахрама. ]], 0.350000, 0.497000, 7, 882, 20264, 229, -1, 0, 2},
        {388, "Вождь Омокк", [[ Вождь Омокк правит своими ограми железной рукой. Многие вассалы вызывали его на поединок в надежде занять его место, но все погибали, не успев нанести ни одного удара. Эта неизменная удача вождя Омокка дала повод для слухов о том, что вождя защищает темная магия. ]], 0.386612, 0.590164, 3, 882, 4523, 229, -1, 0, 1},
        {389, "Темная охотница Вос\'гаджин", [[ Вос'гаджин славится среди троллей красотой и гипнотическими способностями. Она в совершенстве владеет не только ремеслом темных охотников, легко насылая проклятия и сглаз, но и лечебными заклятьями. ]], 0.553279, 0.692623, 2, 882, 4525, 229, -1, 0, 2},
        {390, "Воевода Вун", [[ Во время Второй войны Вун водил небольшие отряды на опасные задания вглубь эльфийской территории. Хитрый тролль присоединился к лже-Орде не потому, что разделял позицию Чернорука, а потому, что хотел стать ее главным стратегом. Для Вуна лже-Орда – жертва войны, поэтому ему бывает так приятно побеждать превосходящего силой противника. ]], 0.524590, 0.545082, 1, 882, 4527, 229, -1, 0, 3},
        {391, "Мать Дымная Паутина", [[ Сотни лет назад кирки дворфов Черного Железа разбудили Мать Дымную Паутину в ее подземном логове. Гигантская паучиха выбралась на свободу. С тех пор ее стая не перестает расти, наводняя Пик Черной горы, так что даже орки Чернорука избегают соваться на ее территорию. ]], 0.620736, 0.741415, 2, 882, 4543, 229, -1, 0, 4},
        {392, "Аррок Смертный Вопль", [[ Смертный Вопль – истинный предводитель огров Пика Черной горы. Он даровал своему подручному, Омокку, темную силу над подвластными ему ограми. Омокк увлекся дарованной ему властью и безжалостно убивает всех, кто выступает против него. ]], 0.454918, 0.557377, 4, 882, 4552, 229, -1, 0, 5},
        {393, "Интендант Зигрис", [[ Орк-охотник Зигрис стал известен тем, что по окончании Первой войны выслеживал беженцев из Штормграда и загонял их, как зверей. Он ненавидит гнетущую тесноту коридоров Пика Черной горы и верит, что в один прекрасный день снова будет охотиться под открытым небом. ]], 0.539617, 0.844263, 5, 882, 4568, 229, -1, 0, 6},
        {394, "Халикон", [[ Халикон может гордиться своей родословной – среди ее предков были только самые верные и свирепые ворги. За годы, проведенные в Черной горе, она успела произвести на свет многочисленное потомство. Ходят слухи, что Халикон – демон, принесенный в дар Ренду Черноруку одним из властителей Преисподней Пылающего Легиона. ]], 0.379781, 0.840164, 5, 882, 4572, 229, -1, 0, 7},
        {395, "Гизрул Поработитель", [[ Немногие из Темной Орды видели нелюдимого и непредсказуемого Гирзула. Он появляется, лишь когда его призывает супруга, Халикон. Два этих чудовища породили самых больших и лютых воргов, известных за всю историю орков. ]], 0.394808, 0.793032, 5, 882, 4584, 229, -1, 0, 8},
        {396, "Властитель Змейталак", [[ Змейталак следит за подготовкой войск нижней части Пика Черной горы к атаке на дворфов Черного Железа. Он не питает никаких симпатий к лже-Орде и ее диким солдатам и не пожалеет войск Чернорука ради защиты своего господина – Нефариана. ]], 0.575137, 0.600410, 6, 882, 4587, 229, -1, 0, 9},
    },
    [230] = {
        {402, "Зеврим Терновое Копыто", [[ Зеврим Терновое Копыто, который отчаянно хотел продемонстрировать Пылающему Легиону свою силу, сказал своим хозяевам, что сможет поработить несгибаемых древних, которые все еще обитали в Забытом городе. Когда его собственных сил оказалось недостаточно, Терновое Копыто начал использовать энергию других живых существ, убивая их на жертвенном алтаре и отбирая их энергию в момент последнего вздоха. ]], 0.575137, 0.743852, 0, 879, 4655, 230, -1, 0, 1},
        {403, "Гидротварь", [[ Когда сатир Зеврим Терновое Копыто пытался получить контроль над элементалями Забытого Города, он сосредоточил свои усилия на Гидротвари, которая мирно жила в бассейне у алтаря. Когда Зеврим начал проводить омерзительные ритуалы жертвоприношений, элементаль утратил покой и начал нападать на слуг Зеврима. Многие годы Зеврим использовал энергию своих жертв, чтобы доводить Гидротварь до состояния необузданной ярости и медленно, но верно подчинял элементаля своей воле. ]], 0.536885, 0.715164, 0, 879, 5004, 230, -1, 0, 2},
        {404, "Лефтендрис", [[ Темная энергия Забытого города привлекла Лефтендрис, которая надеялась утолить свою бесконечную жажду познания темной магии. Используя сухожилия и связки существ, принесенных в жертву, она соткала сеть, которая позволяла забирать оскверненную энергию из восточного крыла. Она с радостью обнаружила, что созданная ей сеть позволяет собрать огромные запасы невероятной силы, которой хватит на то, чтобы уничтожить всех ее врагов. ]], 0.438525, 0.481557, 0, 879, 4994, 230, -1, 0, 3},
        {405, "Алззин Перевертень", [[ Алззин Перевертень всегда хотел просто-напросто осквернить весь Фералас, но ему не удавалось добиться никаких результатов, пока он не нашел алтарь Эльдре'Таласа в Забытом городе. Используя силу порабощенных древних, Алззин направил всю жизненную силу лесов, окружающих город, в свое логово, что позволило ему распоряжаться ей по своему усмотрению. ]], 0.566940, 0.288934, 0, 879, 4921, 230, -1, 0, 4},
        {406, "Тендрис Криводрев", [[ Тендрис Криводрев был преданным защитником Эльдре'Таласа, его судьба была неразрывно связана с судьбой города. После того, как эти земли сотряс Раскол, он остался верен городу, но скверна, проникавшая в руины за последние десять тысяч лет, все же поразила его. ]], 0.336066, 0.536885, 2, 879, 4913, 230, -1, 0, 5},
        {407, "Иллиана Воронья Ольха", [[ Иллиана Воронья Ольха, вместе со своей верной спутницей Феррой, когда-то считалась одной из лучших охотниц принца Тортелдрина, но потом отказалась убить своих друзей по его приказу. В наказание за неповиновение принц убил Иллиану и ее медведицу и использовал свои демонические умения, чтобы связать их души с телами, и теперь они обречены вечно защищать Забытый город в облике нежити. ]], 0.203552, 0.776640, 2, 879, 4906, 230, -1, 0, 6},
        {408, "Магистр Календрис", [[ Когда Принц Тортелдрин повелел убить большинство своих поданных, выполнять этот приказ пришлось его самым преданным лейтенантам. Магистр Календрис убил немало ничего не подозревающих Шен'дралар, но один из обреченных эльфов нанес ему смертельную рану. Даже после смерти дух Календриса скитается по Забытому городу, защищая власть Тортелдрина. ]], 0.338798, 0.450820, 0, 879, 4836, 230, -1, 0, 7},
        {409, "Бессмер\'тер", [[ В отчаянной попытке вернуть себе власть и бессмертие, утраченные при разрушении Источника Вечности, Шен'дралар призвали и захватили с помощью силового поля демона в западном крыле Забытого Города. Они использовали энергию ужасня бездны для усиления своих заклинаний. Бессмер'тер провёл без движения почти 10 000 лет. Все это время он ждал того часа, когда обретет свободу и разорвет на куски тех, кто его пленил. ]], 0.349727, 0.575820, 0, 879, 4822, 230, -1, 0, 8},
        {410, "Принц Тортелдрин", [[ После разрушения Источника Вечности принц Тортелдрин сохранил контроль над выжившими Шен'дралар, заточив в руинах Эльдре'Таласа демона и позволив подданным питаться его мощью. Демоническая сила затмила разум Тортелдрина и, когда существо ослабло, принц приказал убить многих своих вассалов, чтобы только он и самые фанатичные его последователи могли продолжать пользоваться энергией скверны. ]], 0.622951, 0.231557, 0, 879, 4752, 230, -1, 0, 9},
        {411, "Стражник Мол\'дар", [[ Огр Мол'дар – один из стражников клана Гордок. Он убежден, что король подарил ему пару зачарованных рукавиц, которые позволили ему шесть лет подряд становится чемпионом по армрестлингу. На самом деле, король Гордок просто выкинул эти рукавицы, а Мол'дар стал первым, кто их нашел. ]], 0.695355, 0.760246, 1, 879, 4740, 230, -1, 0, 10},
        {412, "Топотун Криг", [[ Подосланные убийцы не раз встречали свою смерть, случайно задев пивную кружку Крига. На службе он нередко напивается и спит, но ничто не приводит огра в неистовство быстрее, чем звук его драгоценного пива, проливающегося на каменный пол. ]], 0.612022, 0.692623, 1, 879, 4734, 230, -1, 0, 11},
        {413, "Стражник Фенгус", [[ С тех пор, как Чо'Раш Наблюдатель сказал ему, что он встретит свою будущую жену на посту, Фенгус почти беспрерывно патрулирует земли короля Гордока. ]], 0.494536, 0.780738, 1, 879, 4725, 230, -1, 0, 12},
        {414, "Стражник Слип\'кик", [[ Некоторые считают, что Слип'кик просто проявляет осторожность, но на самом деле, помимо этого, он ещё и ленив. Вместо того чтобы открыто бросить вызов королю Гордоку, Слип'кик мастерит ловушки и возится со старыми сломанными магическими приспособлениями в надежде, что однажды ему удастся свергнуть короля без каких-либо усилий. ]], 0.266393, 0.571721, 1, 879, 4716, 230, -1, 0, 13},
        {415, "Капитан Давигром", [[ Капитан Давигром считается очень вспыльчивым даже по меркам огров. Чтобы вывести его из себя, достаточно малейшего намека на оскорбление капитана или короля Гордока. Он скор на расправу, но еще меньше терпения у него по отношению к тем, кто распространяет слухи о его давней интрижке с гноллом. ]], 0.318306, 0.506148, 1, 879, 4705, 230, -1, 0, 14},
        {416, "Чо\'Раш Наблюдатель", [[ Чо'Раш обычно старался не принимать ничью сторону, но когда к власти пришел Улрок, уже было ясно, что справиться с Чо'Рашем не сможет никто. Король быстро назначил его своим главным советником, посчитав, что две головы – лучше, чем одна. ]], 0.319542, 0.303693, 1, 879, 4673, 230, -1, 0, 15},
        {417, "Король Гордок", [[ Чтобы править ограми Гордока, нужно просто объявить себя их королем... А потом уничтожить всех, кто с этим не согласен. Король Гордок, который тогда был просто Улроком, захватил власть, убедив двенадцать сильнейших воинов напасть на короля. Большинство тех, кто участвовал в этой бойне, погибли или были ранены, и Улрок с легкостью убил обессилившего короля. О 'Дне Кровищи' огры Гордока до сих пор стараются говорить шепотом. ]], 0.319544, 0.229482, 1, 879, 4666, 230, -1, 0, 16},
    },
    [231] = {
        {418, "Толпогон 9-60", [[ Во времена расцвета Гномрегана гномы соревновались друг с другом, устраивая бои между своими изобретениями. Анжинер Осборн Пропеллерз создал непобедимого робота, заслужив репутацию одного из лучших механиков. Сикко Термоштепсель выкрал его чертежи и создал робота в гигантском масштабе. Робота выпустили на волю, и он причинил столько разрушений, что власти наказали ни в чем не повинного Пропеллерза. А Толпогон 9-60 до сих пор остается одним из любимых (и краденых) изобретений Термоштепселя. ]], 0.431694, 0.883197, 0, 691, 4670, 231, -1, 0, 4},
        {419, "Грязнюк", [[ По замыслу Термоштепселя радиоактивный газ должен был убить гномов и разозлить троггов. План сработал, но на одного трогга газ подействовал неожиданным образом. Грязнюк начал расти. Это было побочным действием, которого Сикко никак не ожидал, но терять ценный (и опасный) материал он не привык. И вот гигантский трогг обходит туннели Гномрегана в сопровождении верного питомца – василиска Чавккера. Нюх василиска помогает находить утечки газа, грибы и непрошеных гостей. ]], 0.778688, 0.670082, 1, 875, 4690, 231, -1, 0, 1},
        {420, "Липкая муть", [[ От некогда стройной и сложной системы водоснабжения Гномрегана сегодня остались только зараженные радиацией мутные потоки. Водный элементаль, живший в гномском водохранилище, подвергся заражению и утратил свою природную форму. Он бродит по залам Гномрегана, охваченный ненавистью, словно живое воплощение гнусного предательства Термоштепселя. ]], 0.759563, 0.465164, 2, 875, 4691, 231, -1, 0, 2},
        {421, "\'Электрошокер-6000\'", [[ Анжинер Термоштепсель не отличается терпением. Вместо того, чтобы проводить скурпулезные проверки новоизобретенного оборудования на эффективность и безопасность, он сразу пускает изобретения в дело и переходит к новым проектам. 'Электрошокер-6000', этот перезаряженный электричеством механотанк, был первой попыткой анжинера использовать ток как оружие. Лейтенант Том 'Шиззопряг' Крункель, единственный выживший из всех, кто пытался управлять 'Электрошокером', почитается среди лепрогномов как герой. ]], 0.243169, 0.684426, 2, 875, 4692, 231, -1, 0, 3},
        {422, "Анжинер Термоштепсель", [[ Убийца, предатель и самозванный король гномов – вот кто такой анжинер Термоштепсель, безраздельно правящий в зараженных радиацией залах Гномрегана. Его подданные многочисленные и злобные лепрогномы, умалишенные как раз настолько, чтобы защищать своего короля от любых вторжений из внешнего мира. Особенно опасным Термоштепселя делает его безумие. Он одержим страстью к уничтожению всего вокруг себя, его не останавливает даже страх за собственную жизнь. Не даром Термоштепселя боятся даже дикие звери. ]], 0.311475, 0.303279, 0, 875, 4702, 231, -1, 0, 5},
    },
    [232] = {
        {423, "Ноксион", [[ Ноксион – живое воплощение скверны. Терадрас приказала своему союзнику лорду Злоязыкому создать этого отвратного элементаля, чтобы тот стал ей надежным слугой и скрашивал ее одиночество. Ноксион распространяет свои ядовитые выделения по тем областям Мародона, которые еще не попали под тлетворное влияние принцессы. ]], 0.362022, 0.098361, 1, 884, 4709, 232, -1, 0, 1},
        {424, "Бритвохлест", [[ Бритвохлеста создали, чтобы он сопровождал Ноксиона в Мародоне. Со временем это создание стало одним из самых любимых слуг принцессы. Бритвохлест неустанно бродит по пещерам вместе с Ноксионом, используя свои шипастые усики, чтобы уничтожать любую растительность, не тронутую порчей. ]], 0.166667, 0.344262, 1, 884, 4713, 232, -1, 0, 2},
        {425, "Ремонтник Гизлок", [[ Ремонтник Гизлок и пятеро других охотников за драгоценностями отправились в Мародон, чтобы добывать тамошние кристаллы, за которые торговцы предлагали бешеные деньги. Однако их планам не было суждено осуществиться – сатиры убили всех, кроме Гизлока. Гоблин, оказавшийся в ловушке в пещерах Мародона и потерявший рассудок, теперь считает себя новым правителем подземного мира. ]], 0.484000, 0.685000, 2, 884, 4721, 232, -1, 0, 3},
        {427, "Лорд Злоязыкий", [[ Лорд сатиров Злоязыкий отправился в глубины Мародона, услышав о поразившей их скверне. Сначала принцесса Терадрас отнеслась к коварному демону с подозрением, но он доказал свою верность, создав для нее множество слуг, таких как Ноксион и Бритвохлест. ]], 0.378415, 0.704918, 1, 884, 4730, 232, -1, 0, 4},
        {428, "Келебрас Проклятый", [[ Узнав о трагической судьбе своего дяди, благородный Келебрас поклялся освободить дух Зейтара. Но хранитель рощи не был готов к ужасам, которые ждали его в кишащих тенями коридорах Мародона. Темная энергия, пропитавшая это место, быстро одержала верх над Келебрасом, наполнив его сердце неконтролируемой яростью. ]], 0.245902, 0.143443, 2, 884, 4745, 232, -1, 0, 5},
        {429, "Обвал", [[ Годами древний горный великан по имени Обвал выращивал в Мародоне прекрасные кристаллы, но затем Терадрас поработила его. Некогда великий гигант теперь влачит рабское существование, подчиняясь своей новой повелительнице. ]], 0.408470, 0.487705, 2, 884, 4749, 232, -1, 0, 6},
        {430, "Гнилопасть", [[ Ходят слухи, что Гнилопасть обитает в подземных водах Мародона уже много тысяч лет. Прославленный дворф-охотник Хеминг Эрнестуэй когда-то заявил, что эту тварь невозможно найти, и десятки следопытов устремились на поиски этого легендарного существа. Ни один из них не вернулся. ]], 0.413934, 0.817623, 2, 884, 4757, 232, -1, 0, 7},
        {431, "Принцесса Терадрас", [[ Элементаль земли Терадрас, единственная дочь Теразан, матери-скалы, живет во внутреннем святилище Мародона. Принцесса, попавшая под влияние Древних богов, превратила свой дом в обитель скверны и страданий. Некоторые полагают, что ее сила неразрывно связана с духом ее мертвого возлюбленного – Зейтара. Если это правда, то освобождение мертвого хранителя рощи – вероятно, единственный шанс очистить Мародон. ]], 0.258197, 0.788934, 2, 884, 4759, 232, -1, 0, 8},
    },
    [233] = {
        {1141, "Амненнар Хладовей", [[ Лич Амненнар был одним из самых грозных представителей Плети. Он принимал участие в штурме горы Хиджал в ходе Третьей войны. Позже Король-Лич приказал своему слуге остаться в Калимдоре и заняться расширением влияния Плети. Героям Орды и Альянса предстоит остановить коварного лича, и принести хотя бы относительное спокойствие в Курганы Иглошкурых. ]], 0.455090, 0.582335, 0, 887, 9484, 233, -1, 0, 5},
        {1142, "Тутен\'каш", [[ Арахноманты племени Мертвой Головы очень гордятся тем, что после множества бесплодных попыток наконец-то создали для Амненнара надежного стража. Его имя Тутен'каш. Воскрешенный нерубианец вступит в бой с любым, кто призовет его, трижды ударив в гонг. ]], 0.589820, 0.342815, 0, 887, 9491, 233, -1, 0, 1},
        {1143, "Обжора", [[ Обжора, одно из новых творений Амненнара, это попытка возродить Тартека Яростного, который считался лучшим поганищем, когда-либо созданным. Тартек убил множество иглошкурых, но в конечном итоге пал. Сочащийся желчью, гноем и прочими отвратительными жидкостями Обжора сторожит Курганы Иглошкурых, и голод его неутолим. ]], 0.345310, 0.664671, 0, 887, 9496, 233, -1, 0, 3},
        {1146, "Круглорыл", [[ Единственный из своего племени, избежавший объятий нежизни, Круглорыл прячется в Курганах Иглошкурых, и порой его невозможно отыскать. Адепт темной магии, Круглорыл без раздумия нападет на любого врага, и битва эта не будет легкой. ]], 0.430140, 0.627246, 0, 760, 9527, 233, -1, 0, 4},
        {433, "Мордреш Огненный Глаз", [[ Прибегнув к некромантии, Амненнар сумел вновь разжечь пламя в душе Мордреша Огненный Глаз и возродить его из мертвых. Мордреш, в прошлой жизни бывший шаманом, при помощи нечестивой магии управляет стихиями. Он испепеляет всех, кто может помешать планам Хладовея. ]], 0.860656, 0.467213, 0, 887, 4767, 233, -1, 0, 2},
    },
    [234] = {
        {11638, "Ругуг", [[ Свинобразы считают чтение камней и кристаллов высшей формой шаманизма. Ругуг долгие годы служил народу свинобразов, неспешно постигая магические искусства. Теперь он выполняет роль главного геоманта свинобразов. ]], 0.648000, 0.421000, 0, 888, 20876, 234, -1, 0, 0},
        {11639, "Агателос Свирепый", [[ Агателос — бронированный кабан, примерно в два раза больше, чем обычная громовая ящерица, а в ярости он становится еще больше. Его держали в тоннеле, охраняемом несколькими свиновепрями, которые поддерживали магическое поле, чтобы запереть чудовищное существо. Учитывая, что бог и прародитель свиновепря — Агамагган, титанический кабан, такое животное, как Агателос, имеет большое духовное значение. ]], 0.079000, 0.685000, 0, 888, 20879, 234, -1, 0, 4},
        {895, "Вестник смерти Джаргба", [[ Вестники смерти племени Мертвой Головы выполняют две функции: ведут пропаганду и применяют меры воздействия к тем, кто отказывается подчиняться Чарлге Остробок и ее таинственным новым союзникам. Джаргба ценится вестниками смерти за способность контролировать разум отступников и заставлять их принять волю лидеров. ]], 0.872328, 0.410829, 0, 888, 20013, 234, -1, 0, 2},
        {896, "Аггем Терновое Проклятие", [[ Шаманство – неотъемлемая часть общества свинобразов, а лучший шаман племени носит титул пророка Агамаггана. Взывая к силе своего предка-полубога, пророки могут призвать духи вепрей для помощи в бою так же, как обычные шаманы призывают духи волков. ]], 0.807336, 0.517180, 0, 888, 8646, 234, -1, 0, 1},
        {899, "Властитель Таранный Клык", [[ Командующий войсками племени Мертвой головы, Властитель Таранный Клык, крепкий, несмотря на возраст, свинобраз, на толстой шкуре которого можно увидеть шрамы, полученные в боях с кентаврами, гарпиями, орками и даже тауренами. Умудренный опытом Таранный Клык уверенно командует свой армией, не позволяя возрасту одержать над собой верх. Победа над ним наверняка станет серьезным ударом для племени Мертвой Головы. ]], 0.574939, 0.305955, 0, 888, 8660, 234, -1, 0, 3},
        {900, "Слепой Охотник", [[ Из глубин темных пещер явилось чудовищное создание, долгие годы жившее вдали от остального мира. Эта гигантская летучая мышь неустанно пожирает плоть кабана по имени Агателос Свирепый, который когда-то черпал темную энергию из помета летучих мышей. ]], 0.089397, 0.548399, 0, 888, 20015, 234, -1, 0, 4},
        {901, "Чарлга Остробок", [[ Предводительница племен Мертвой головы и Иглошкурых Чарлга Остробок по прозвищу 'ведьма' быстро и решительно пришла к власти. Ее цель – возродить полубога Агамаггана, но темные и жестокие ритуалы, которые Чаргла проводит вместе со своими приспешниками, идут вразрез с благородством и заветами Древнего. ]], 0.219597, 0.311669, 0, 888, 20017, 234, -1, 0, 5},
    },
    [236] = {
        {443, "Певчий Форрестен", [[ Во время Очищения Стратхольма были убиты тысячи людей, которые были виноваты лишь в том, что они оказались в обреченном городе. Одной из таких жертв стал странствующий певчий и флейтист Форрестен. Он продолжает скитаться по городу, не в силах смириться со своей трагичной судьбой. ]], 0.605191, 0.313524, 1, 892, 4794, 236, -1, 0, 1},
        {445, "Тимми Беспощадный", [[ Тиммисон был печально известен своей кровожадностью на поле боя. Некоторые предполагали, что причины этого садизма надо искать в детстве Тиммисона, когда над ним постоянно издевались. После того, как он переродился в форме монстра Плети, эти воспоминания постоянно мучают его, вынуждая откликаться на имя, которое он когда-то ненавидел: Тимми. ]], 0.499999, 0.178279, 1, 892, 4799, 236, -1, 0, 2},
        {446, "Мастер-канонир Вилли", [[ Балназзару очень нравилось поощрять разрушительные способности канонира Вилли, он называл своего слугу Разбивающим Надежды. Повелитель ужаса видит иронию в том, что Вилли и другие крестоносцы Алого ордена, которые так ненавидели нежить, после смерти сами стали такими же. ]], 0.047814, 0.506148, 1, 892, 4807, 236, -1, 0, 4},
        {448, "Инструктор Галфорд", [[ В свое время Галфорд гордился тем, что заботится о самых ценных документах ордена. Но умирая, он в ужасе смотрел на то, как его драгоценные тома обращаются в пепел. Балназзар использовал эти страшные воспоминания, чтобы наделить своего слугу яростью, которая никогда не была присуща Галфорду при его жизни. ]], 0.277323, 0.754099, 1, 892, 4808, 236, -1, 0, 5},
        {449, "Балназзар", [[ Балназзар никогда не знал, что такое смерть, но ему был хорошо известен горький вкус поражения. После того, как Катаклизм сотряс мир, он убил крестоносцев Алого ордена в Стратхольме и обратил их в нежить, которую они так ненавидели. Теперь повелитель ужаса вынашивает планы отомстить Азероту. ]], 0.204918, 0.821721, 1, 892, 4828, 236, -1, 0, 6},
        {450, "Непрощенный", [[ Лилия была образчиком праведности среди своего народа. После того, как Артас приказал своим войскам очистить город, она потеряла рассудок, видя, как множество невинных погибают от ее руки. Она упала на собственный меч, чтобы избежать безумия. Теперь она обречена существовать в форме призрака; за то, что она сделала, ей навсегда отказано в прощении. ]], 0.734973, 0.204918, 1, 892, 4833, 236, -1, 0, 7},
        {451, "Баронесса Анастари", [[ При жизни Анастари добивалась желаемого любыми способами. Смерть этого не изменила. Когда её душа вырвалась из тела, и она превратилась в банши, стремление к мирским благам уступило место более зловещим желаниям. ]], 0.745902, 0.469262, 2, 892, 4841, 236, -1, 0, 8},
        {452, "Неруб\'энкан", [[ Неруб'энкан была искусной воительницей времен войны Пауков. В конечном итоге она погибла от ран и была обращена в нежить, став покорной слугой Плети. Теперь она охраняет зиккурат в Стратхольме не менее ревностно, чем защищала свой родной дом при жизни. ]], 0.572404, 0.461065, 2, 892, 4845, 236, -1, 0, 9},
        {453, "Малекай Бледный", [[ Малекай одним из первых вступил в культ Проклятых, продемонстрировав невероятные способности в использовании могильного холода. Подгоняемый бесконечной жаждой власти, маг продолжает оттачивать свои навыки темной магии, чтобы подготовиться к моменту, когда он переродится в форме лича. ]], 0.674864, 0.227459, 2, 892, 4851, 236, -1, 0, 10},
        {454, "Мировой судья Бартилас", [[ Бартилас был в числе тех невинных, которых Артас и его войска убили во время Очищения Стратхольма. Впоследствии Король-лич поднял бывшего мирового судью из могилы и приказал жуткой нежити охранять его разрушенный дом. ]], 0.640000, 0.790000, 2, 892, 4855, 236, -1, 0, 11},
        {455, "Рамштайн Ненасытный", [[ Рамштайн – одно из самых известных порождений плети, кошмарное существо, созданное из бесчисленного количества мертвых тел и ведомое неутолимым голодом. Когда войска Плети захватили Стратхольм, этот монстр чинил там невообразимые зверства, уничтожая тысячи невинных душ. ]], 0.456284, 0.198771, 2, 892, 4859, 236, -1, 0, 12},
        {456, "Барон Ривендер", [[ Инструмент Плети, безжалостный Барон Ривендер, всадник Наксрамаса, предал людей еще при жизни, обменяв свою преданность на темную силу Плети. Именно Ривендер ответственен за разрушение Стратхольма и орды нежити, что царствуют там ныне. ]], 0.386612, 0.200820, 2, 892, 4862, 236, -1, 0, 13},
        {749, "Командир Малор", [[ Малор вместе с горсткой других отважных воинов рискнул всем, чтобы защитить бастион Алого ордена от полчищ нежити. Увы, они потерпели поражение. Бальназар превратил бесстрашного командира в одного из своих слуг, и Малор стал страшной пародией на самого себя. ]], 0.299320, 0.411874, 1, 892, 6452, 236, -1, 0, 3},
    },
    [237] = {
        {11643, "Атал\'аларион", [[ Атал'аларион верный хранитель идола, расположенного на нижнем уровне храма. Чтобы призвать его, необходимо активировать статуи в нужной последовательности. ]], 0.243169, 0.459016, 1, 687, 20907, 237, -1, 0, 0},
        {11644, "Лоро", [[ Лоро — тролль—нежить, обитающий в Храме Атал'Хаккара. Он слуга Джаммал'ана Пророка и без сомнений отдаст свою жизнь чтобы защитить тайны своего господина. ]], 0.243169, 0.459016, 1, 687, 20909, 237, -1, 0, 3},
        {11645, "Хукку", [[ Хукку — тролль—нежить, обитающий в Храме Атал'Хаккара. Хуку сопровождают его демонические стражи. Он, как и его братья, служит Джаммал'ану. ]], 0.243169, 0.459016, 1, 687, 20911, 237, -1, 0, 3},
        {11646, "Миджан", [[ Миджан — тролль—нежить, обитающий в Храме Атал'Хаккара. Бывший целитель клана Атал'аи, который поклялся верой и правдой служить своему господину. ]], 0.243169, 0.459016, 1, 687, 20913, 237, -1, 0, 3},
        {11647, "Зул\'Лор", [[ Зул'Лор — тролль—нежить, обитающий в Храме Атал'Хаккара. Некогда один из сильнейших воинов своего клана, а сейчас верный служитель Пророка. Он сделает все ради достижения его целей. ]], 0.243169, 0.459016, 1, 687, 20917, 237, -1, 0, 3},
        {11648, "Золо", [[ Золо — тролль—нежить, обитающий в Храме Атал'Хаккара. Некогда один из сильнейших воинов своего клана, а сейчас верный служитель Пророка. Он сделает все ради достижения его целей. ]], 0.243169, 0.459016, 1, 687, 20919, 237, -1, 0, 3},
        {11649, "Ранокол", [[ Ранокол — тролль—нежить, обитающий в Храме Атал'Хаккара. Искусный боец клана Атал'аи, который при жизни был самым быстрым воином, а когда стал нежитью обрел еще и невероятную выносливость. ]], 0.243169, 0.459016, 1, 687, 20921, 237, -1, 0, 3},
        {457, "Аватара Хаккара", [[ Хаккар был известен тем, что требовал кровавых жертв от своих почитателей. В давние времена он повелел племени Атал'ай поклоняться своей аватаре, питая ее кровью жертв. В настоящее время жрецы Атал'ай пытаются возродить аватару Хаккара при помощи обновленного ритуала, предполагающего принесение в жертву зеленых драконов. Если Атал'ай повезет, час возрождения аватары Хаккара станет последним часом Азерота. ]], 0.243169, 0.459016, 0, 687, 4903, 237, -1, 0, 1},
        {458, "Джаммал\'ан Пророк", [[ Джаммал'ан Пророк – предводитель племени Атал'ай, объединяющего фанатичных жрецов Хаккара. Джаммал'ану было видение, в котором ему открылось, как воскресить Хаккара при помощи крови его врагов, зеленых драконов. Джаммал'ан и его телохранитель-нежить, Огом Презренный, готовы дать отпор любому, кто хочет помешать возвращению в этот мир Хаккара, хотя это возвращение и может погрузить Азерот в настоящий кошмар... Изумрудный кошмар. ]], 0.760929, 0.459016, 0, 687, 4934, 237, -1, 0, 2},
        {459, "Хранители Сна", [[ Четыре молодых, подающих надежды дракона отправились вместе с Эраникусом в Храм Атал'Хаккара, готовые доказать свою преданность могущественному змею. Один за другим они попали в ловушки и оказались в Изумрудном Кошмаре. Теперь они бродят по залам Храма, набрасываясь на любого, кто потревожит их сомнамбулическую прогулку. ]], 0.499151, 0.870309, 0, 687, 6114, 237, -1, 0, 3},
        {463, "Тень Эраникуса", [[ Эраникус, бывший супруг Изеры, был отправлен на руины Храма Атал'Хаккара, чтобы предотвратить возвращение Хаккара. Но едва Эраникус и его свита оказались в храме, как стали жертвами темных сил, там обитавших. В реальном мире от Эраникуса осталась лишь тень, а сам он застрял на пути к Изумрудному Сну. Несмотря на постигшее Эраникуса несчастье, он все еще может дать отпор врагам, залив их разъедающим ядом или погрузив в глубокий сон. ]], 0.670765, 0.877049, 0, 687, 4950, 237, -1, 0, 7},
    },
    [238] = {
        {464, "Декстрен Вард", [[ Редко в тюрьме, наполненной отбросами и настоящими чудовищами, можно увидеть человека, подобного Декстрену Варду. Первой мыслью незнакомого с историей этого заключенного будет: 'И за какие прегрешения этот человек попал сюда?' Но не зря заключенные отмалчиваются на подобные вопросы — ведь этот человек настоящее чудовище, которое заслуживает смерти! ]], 0.218579, 0.262295, 0, 874, 4811, 238, -1, 0, 1},
        {465, "Хрупконог", [[ Один из самых мрачных заключенных Тюрьмы, полубезумный огр, вооруженный мясницким тесаком - вот кем является Хрупконог. Теперь, когда в Тюрьме царит хаос, он возобновил свою кровавую работу. ]], 0.784153, 0.452869, 0, 874, 4814, 238, -1, 0, 2},
        {466, "Таргорр Ужасный", [[ Выходец из клана орков, обитающего в Черной Горе, Таргорр получил прозвище 'Ужасный' за абсолютную беспощадность и умение разить двумя мечами одновременно. Орк в человеческой тюрьме - явление редкое, поэтому ничего удивительного в том, что все заключенные боятся Таргорра. Впрочем, теперь у него есть отличная возможность найти применение своему коварному мастерству. ]], 0.497268, 0.221312, 0, 874, 4817, 238, -1, 0, 3},
    },
    [239] = {
        {467, "Ревелош", [[ Некоторые светила науки в престижной лиге Исследователей, находящейся в Стальгорне, считают, что между их народом и троггами есть кровная связь. По их мнению, доказательством этого является то, что страсть троггов к артефактам титанов мало чем отличается от интереса дворфов к этим чудесным устройствам. Если их теория верна, то трогга Ревелоша можно считать археологом, хотя любые искатели приключений, которым довелось с ним столкнуться, скорее назовут его вором. ]], 0.534153, 0.725410, 1, 876, 4820, 239, -1, 0, 1},
        {468, "Пропавшие дворфы", [[ В поисках славы и, что важнее, богатства, три брата – Эрик, Олаф и Бейлог заключили контракт с лигой Исследователей и отправились в залы Ульдамана, чтобы очистить путь для исследователей, которые придут за ними. Увы, для этих трех гномов 'очистить путь' означало 'безнадежно заблудиться в древнем лабиринте.' Но гордые дворфы до самого конца пытались защитить секреты лиги Исследователей и Ульдамана от Орды. ]], 0.584699, 0.920082, 1, 876, 4869, 239, -1, 8, 2},
        {469, "Иронайа", [[ Для возведения огромных залов Ульдамана титаны воспользовались слугами. Пантеон поручил дозорной Иронайе руководство строительством и обеспечением Ульдамана, но шли годы, и некогда прекрасное место теперь лежит в руинах. Иронайа провела тысячелетие в состоянии стазиса, анализируя генеральный план, начертанный Каз'горотом, в поисках способа восстановить комплекс Ульдаман. ]], 0.372951, 0.739754, 1, 876, 4876, 239, -1, 0, 3},
        {470, "Древний каменный хранитель", [[ Древний каменный хранитель – один из многих големов, работавших в великом хранилище титанов. Он был посредником между дозорными, управлявшими всеми работами, и их слугами. После осквернения Обсидианового часового Древний каменный хранитель остался последним големом, созданным титанами, и теперь он будет оберегать их секреты, пока не прекратит свое существование. ]], 0.475410, 0.440574, 1, 876, 4879, 239, -1, 0, 5},
        {471, "Галганн Огнемолот", [[ Когда дворфы из клана Бронзобородов обнаружили Ульдаман, клан Черного Железа вторгся в хранилище, чтобы помешать своим кровным врагам получить доступ к могущественным артефактам, хранящимся там. Галганн Огнемолот – сенатор из Тенегорья – отправился лично наблюдать за тем, как идут раскопки Ульдамана, чтобы император мог использовать разрушительную силу артефактов против врагов клана Черного Железа. ]], 0.267760, 0.327869, 1, 876, 4880, 239, -1, 0, 6},
        {472, "Гримлок", [[ Среди троггов самый крупный, сильный и свирепый становится вождем, доказав свою силу. Но особая заслуга Гримлока в том, что он смог контролировать троггов, держа их в страхе с помощью психологических атак. Подчинив себе василиска, он угрожал превращением в камень каждому, кто посмеет ему перечить. ]], 0.219945, 0.256148, 1, 876, 4886, 239, -1, 0, 7},
        {473, "Аркедас", [[ Где-то в глубинах Ульдамана есть зала, в которой хранится одно из драгоценнейших сокровищ титанов, созданное самим Норганноном. Но до сих пор никому не удавалось добраться до реликвии, так как ее охраняет могучий страж Аркедас со своими прислужниками. Аркедас выточен из древнего, крепкого камня, добытого в копях Ульдамана, и он настолько же грозен, насколько и стар. ]], 0.553279, 0.504098, 2, 876, 4894, 239, -1, 0, 8},
        {748, "Обсидиановый часовой", [[ Обсидиановый часовой неусыпно охранял секреты Ульдамана, пока его не поразила скверна неизвестного происхождения. Часовой, созданный из того же камня, что и залы Ульдамана, почти полностью состоит из темного стекла, отражающего заклинания. Вероятно, источник скверны, поразившей обсидианового часового, был невероятно мощным – не так-то просто изменить зачарованный камень, созданный титанами. ]], 0.289425, 0.597403, 1, 876, 6448, 239, -1, 0, 4},
    },
    [240] = {
        {474, "Леди Анакондра", [[ Алый Лист стала первой, кто вызвался пойти с Наралексом, когда он собрался в степи. После того, как кошмар ее наставника повредил ее рассудок, юная послушница отказалась от своего имени и стала предсказывать Азероту ужасное будущее. ]], 0.281000, 0.318000, 0, 749, 4954, 240, -1, 0, 1},
        {475, "Лорд Кобран", [[ Умение Джарлакслы принимать форму зверей принесло ему уважение друидов Круга Кенария. К сожалению, скверна пещеры Стенаний извратила его способность, и он в совершенстве овладел лишь умением превращаться в змея. Из-за этой новой зловещей формы он выбрал себе имя Кобран. ]], 0.166667, 0.567623, 0, 749, 4958, 240, -1, 0, 3},
        {476, "Лорд Питонас", [[ Другу детства Наралекса, воину Арину, очень хорошо давалось искусство друидов. Но, несмотря на это, послушник не смог сопротивляться скверне, которая лишила его рассудка. Арин взял имя лорд Питонас, и использует свои боевые навыки и заклинания друидов, чтобы уничтожать незваных гостей. ]], 0.856000, 0.293000, 0, 749, 4965, 240, -1, 0, 2},
        {477, "Криг", [[ По пещерам Стенаний бродит один из древнейших её обитателей – гигантская черепаха. Кошмарам Наралекса не удалось повлиять на ее миролюбивый нрав, и все же не стоит излишне доверять ее дружелюбию. Криг не единожды давал отпор путешественникам, покусившимся на его огромный панцирь. ]], 0.385246, 0.360656, 0, 749, 20008, 240, -1, 0, 4},
        {478, "Шкам", [[ Шкам отправился в пещеры Стенаний, чтобы отдохнуть от враждебности степей, в которых он жил. Но, как и многие обитатели пещер, он быстро поддался влиянию скверны. Теперь в его венах течет темная энергия, превратившая его в сильного и безжалостного зверя, которому неведомо раскаяние. ]], 0.932000, 0.795000, 0, 749, 4970, 240, -1, 0, 5},
        {479, "Лорд Серпентис", [[ Лидер друидов-змей некогда был одним из самых блестящих учеников Наралекса. Но он обратился к злу, и это помешало ему осуществить заветную мечту и стать шан'до, 'почитаемым учителем', подобно самому Наралексу. Безумие проникало все глубже в его душу, и Серпентис привлек на свою сторону сородичей и создал орден 'Друидов-змей'. ]], 0.616120, 0.538935, 0, 749, 4971, 240, -1, 0, 6},
        {480, "Вердан Вечноживущий", [[ Мало что известно о судьбе этого существа до того, как в пещерах Стенаний появился Наралекс. Несмотря на то, что Вердан Вечноживущий изначально был защитником пещер, он также подвергся влиянию скверны, поразившей его дом. Вердан объединился с безумными друидами, и готов уничтожить каждого, кто вторгнется в их владения. ]], 0.554645, 0.465164, 0, 749, 4974, 240, -1, 0, 7},
        {481, "Мутанус Пожиратель", [[ В самых темных уголках воспаленного сознания Наралекса скверна, захватившая Изумрудный Сон, обрела форму самого страшного врага друида – мурлока. Чудовищное создание, называемое Мутанусом, появилось в этом мире, чтобы уничтожить каждого, кто захочет освободить Наралекса из лап поглотившего его Кошмара. ]], 0.345628, 0.137295, 0, 749, 4975, 240, -1, 0, 8},
    },
    [241] = {
        {483, "Газ\'рилла", [[ Согласно легенде, Газ'рилла был любимцем Древних богов, а может, даже сам являлся полубогом. Как бы то ни было, в течение целого тысячелетия тролли клана Песчаной Бури поклонялись этому созданию. Хорошо зная характер этой твари, тролли не рискуют показываться ненасытному Газ'рилле на глаза без обильных жертвоприношений. ]], 0.280942, 0.382783, 0, 871, 4981, 241, -1, 0, 2},
        {484, "Анту\'сул", [[ Анту'сул хочет, чтобы его сул'литуз-василиски были сильными и беспощадными. Он относится к ним, как к членам семьи, и никому, даже другим троллям, не дозволено причинять вред его драгоценным детенышам. Вместо того чтобы хоронить своих противников, Анту'сул позволяет василискам питаться теми, кто посмел ему перечить. ]], 0.646175, 0.276639, 0, 871, 4986, 241, -1, 0, 3},
        {485, "Тека Мученик", [[ Давным-давно мученик Тека был убит в кровопролитной войне между жителями Ан'Киража и троллями. Зул'Фаррак уцелел только благодаря его жертве. Даже после смерти Тека оберегает свой любимый город. Говорят, что его убийцы – дюжина воинов роя – превратились в бездумных скарабеев, обреченных вечно находится рядом с Текой. ]], 0.531421, 0.262295, 0, 871, 5005, 241, -1, 0, 4},
        {486, "Знахарь Зум\'рах", [[ Могучий Лоа Бвонсамди присматривает за душами троллей Черного Копья, но многие тролли из племени Песчаной Бури после смерти лишены этой защиты. Их измученные души подчиняются Зум'раху – жестокому знахарю, который использует темную магию, чтобы пленить души умерших. ]], 0.442623, 0.176230, 0, 871, 5011, 241, -1, 0, 5},
        {487, "Некрум и Шезз\'зиз", [[ Таинственным образом Некрум Кишкожуй продолжает жить после смерти, и его разлагающееся тело все ещё в состоянии помогать Шезз'зизу. Вдвоем эти тролли собрались принести жертвы мифическому зверю Газ'рилле, который спит в сердце города. Многие тролли с нетерпением ждут пробуждения этой твари и сделают всё, что угодно, лишь бы ритуал состоялся. ]], 0.296448, 0.174180, 0, 871, 5019, 241, -1, 0, 6},
        {489, "Вождь Укорз Песчаный Череп", [[ Вождь Укорз Песчаный Череп одержим мыслью о том, чтобы вернуть своему племени былую славу. Он был воспитан на историях о тех временах, когда тролли правили этими землями, и им не мешали гоблины, гномы, пираты, огры и прочие чужеземцы. Песчаный Череп попросил своего верного соратника Руузлу помочь ему начать новую главу в истории клана Песчаной Бури единственным известным ему способом – при помощи насилия. ]], 0.422131, 0.329918, 0, 871, 5025, 241, -1, 0, 8},
    },
    [247] = {
        {523, "Ширрак Страж Мертвых", [[ Созданный самим экзархом Маладааром Ширрак должен был защищать духов мертвых дренеев, обитавших в Аукенайских гробницах. Внешне он представляет собой жуткую массу глаз, зубов и щупалец. Это творение экзарха с остервенением поглощает энергию тайной магии и ни за что не потерпит вторжения смертных в свое обиталище.  ]], 0.463115, 0.680327, 2, 722, 5038, 247, -1, 0, 1},
        {524, "Экзарх Маладаар", [[ Маладаар – последний выживший представитель великого народа, гордые сыны которого некогда обитали в аукенайских залах. Внезапная потеря всех и всего, что когда-либо было ему дорого, окончательно свела его с ума. Его безумное желание сохранить в веках память сородичей вынудило его заняться темной магией. ]], 0.739071, 0.508196, 2, 722, 5042, 247, -1, 0, 2},
    },
    [248] = {
        {527, "Начальник стражи Гарголмар", [[ Снискавший дурную славу в Запределье Гарголмар поедает сердца тех, кто попадается ему вблизи Цитадели Адского Пламени независимо от того, пытались они попасть внутрь или нет. Каргат Острорук поручил ему защищать крепостные стены, и начальник стражи Гарголмар беспрекословно исполняет свои обязанности. ]], 0.733000, 0.310000, 1, 848, 5049, 248, -1, 0, 0},
        {528, "Омор Неодолимый", [[ Омор Неодолимый был учеником псаря Хаккара, поэтому после поражения наставника во время Войны древних он взял под свою опеку гончих Скверны, легендарного воина. С того времени еще никому не удавалось победить Омора в схватке. Теперь этот почтенный демон – посланник Иллидана у орков Скверны в Цитадели Адского Пламени. ]], 0.390710, 0.204918, 1, 848, 5057, 248, -1, 0, 1},
        {529, "Вазруден Глашатай", [[ Вазруден охраняет линии снабжения между Цитаделью Адского Пламени и Черным храмом, по которым движутся подкрепления, припасы и донесения. Вазруден ездит верхом на великолепном драконе Пустоты Назане: вдвоем они воплощают собой неудержимую силу, способную уничтожить врага огнем и когтями, с пронзительным криком паря в небесах.  ]], 0.354000, 0.826000, 1, 848, 5064, 248, -1, 0, 2},
    },
    [250] = {
        {534, "Пандемоний", [[ Отвратительный лорд Бездны Пандемоний также известен как Герцог хаоса, Пожиратель народов и Гибель миров. Он был одним из командиров под предводительством Пространствуса, когда родной мир эфириалов К'ареш был разрушен. Позже он был порабощен принцем Шаффаром и продолжил утолять свой бесконечный голод на службе у эфириалов. ]], 0.479508, 0.297131, 1, 842, 5188, 250, -1, 0, 1},
        {535, "Таварок", [[ По велению Кель'таса Солнечного Скитальца Паталеон Вычислитель призвал мощного колосса, который должен был собрать энергию тайной магии, текущую из-под Гробниц Маны. Таварок был внезапно преображен под воздействием необычного всплеска энергии – таким образом он избавился от порочного воздействия Паталеона и утратил красный окрас. Белый колосс обрел собственную волю и теперь готов поглотить любого, кто осмелится встать у него на пути. ]], 0.609289, 0.741804, 1, 842, 5191, 250, -1, 0, 2},
        {536, "Йор", [[ Гончая Бездны Йор, несравненный в своей ярости и мощи зверь, была подарком Иллидана Ярости Бури принцу Шаффару. Советники пытались предостеречь принца, полагая, что демоническое создание, вероятно, должно было предать Шаффара в случае, если тот больше не представлял пользу для Иллидана. Принц скормил своих советников Йору... но с тех пор он хранил чудище в палате стазиса – просто на всякий случай. ]], 0.356557, 0.608607, 1, 732, 5194, 250, 2, 0, 3},
        {537, "Принц Шаффар", [[ Будучи убежденным, что в глубинах Гробниц Маны таились огромные богатства, принц Шаффар тратил огромные суммы из своего значительного состояния, чтобы привести армию в сумрачные залы этих руин и не дать конкурирующим эфириалам проникнуть внутрь. Жадность принца не знала границ, и он поклялся, что раскроет тайны Гробниц Маны либо погибнет. ]], 0.323770, 0.491803, 1, 842, 5196, 250, -1, 0, 4},
    },
    [252] = {
        {541, "Темнопряд Сит", [[ Темнопряд Сит получил приказ от короля воронов Айкисса защищать Сетеккские залы, в то время как мятежные араккоа пытаются найти своего загадочного бога. Этот умудренный годами хитрец – мастер темной магии, и ему подвластны сами стихии. ]], 0.487705, 0.680328, 1, 833, 5230, 252, -1, 0, 1},
        {542, "Анзу", [[ Анзу, таинственное божество-птица, которому поклоняются самые дикие араккоа, ни по своему происхождению, ни по возможностям не походит на других богов из пантеона Запределья. Наару ничего не говорят об этом злобном существе, так как даже им неизвестно об истинных целях Анзу. ]], 0.326503, 0.545082, 2, 723, 5248, 252, 2, 0, 2},
        {543, "Король воронов Айкисс", [[ Король воронов Айкисс был харизматичным духовным лидером группы храбрых араккоа, которые покинули свой дом в лесу Тероккар в поисках обещанного им бога. Во сне ему являлись видения этого бога, и он знал, что найти его можно в глубине разрушенных залов Аукиндона. Айкисс сошел с ума от видений, и теперь утверждает, что является воскресшим Терокком, божественным героем из мифов араккоа. ]], 0.326503, 0.276639, 2, 833, 5256, 252, -1, 0, 3},
    },
    [253] = {
        {544, "Посол Гиблочрев", [[ Могучий слуга демонов и служитель боли посол Гиблочрев посвятил себя искусству смерти. Ничто не доставляет ему большего наслаждения, чем вкус крови смертного с богатым букетом ужаса и отчаяния. Орки Скверны из Темного лабиринта пленили Гиблочрева и теперь скармливают ему заключенных, чтобы демон мог набраться сил и лучше служить своим темным хозяевам. ]], 0.218579, 0.395492, 1, 834, 5261, 253, -1, 0, 1},
        {545, "Черносерд Проповедник", [[ Когда Орда орков впервые вторглась в Азерот через Темный портал, два члена Совета Теней обратили свой взор на древнее захоронение дренеев, Аукиндон. Беспокойные духи тех земель оказались отличными подопытными для чернокнижника Черносерда и позволили ему развить свои навыки управления сознанием. ]], 0.267760, 0.704918, 1, 834, 5263, 253, -1, 0, 2},
        {546, "Великий мастер Ворпил", [[ Во времена зарождения Орды великий мастер Ворпил убедил чернокнижника орков Гул'Дана позволить ему исследовать тайны Аукиндона. Он втайне желал обуздать энергию пугающе могущественных космических сущностей, которыми была насыщена эта область. ]], 0.531421, 0.540983, 1, 834, 5266, 253, -1, 0, 3},
        {547, "Бормотун", [[ Давным-давно... В далеком-далеком мире... Нет, так нельзя описать происхождение этого элементаля. Он воплощает разрушение в чистейшей форме. По малейшей прихоти он может расколоть миры на множество фрагментов. Только настоящие безумцы осмелятся призвать это существо. Возможно, еще осталось время изгнать Бормотуна, пока он не полностью проник в Запределье. ]], 0.808743, 0.391393, 1, 834, 5272, 253, -1, 0, 4},
    },
    [254] = {
        {548, "Зерекет Бездонный", [[ Большинство существ из Круговерти Пустоты требуют постоянного внимания своих хозяев, но некоторые призраки Бездны не нуждаются в приказах. Зерекет стоит на страже у входа в Аркатрац и готов убить любого, кто осмелится бросить ему вызов. ]], 0.592896, 0.243853, 1, 841, 5279, 254, -1, 0, 1},
        {549, "Даллия Глашатай Судьбы", [[ Прежде, чем ее пленили наару, Даллия была одним из самых жестоких и кровожадных воинов в Пылающем Легионе. Пребывание в одной камере с провидцем Гнева Соккоратом тоже явно не улучшило ее характер. ]], 0.363388, 0.782787, 2, 841, 5283, 254, -1, 0, 2},
        {550, "Провидец Гнева Соккорат", [[ Много тысяч лет назад Соккорат пользовался большим уважением среди стражей гнева и считался одним из лучших командиров Пылающего Легиона. Заключение не пошло на пользу его самомнению. То же можно сказать и о его сокамернице. ]], 0.199454, 0.786885, 2, 841, 5291, 254, -1, 0, 3},
        {551, "Предвестник Скайрисс", [[ Наару считали, что голос Предвестника Скайрисса, способный заставить его жертв поверить во что угодно, стихнет навсегда, когда они поймали его и погрузили в глубокий сон без сновидений. Несчастный смотритель Аркатраца на своем опыте узнал, что наару были неправы. У Скайрисса было достаточно энергии, чтобы поговорить с начальником тюрьмы Мелличаром своим вкрадчивым, мягким голосом, и со временем он достиг своей цели. ]], 0.616120, 0.307377, 3, 841, 5298, 254, -1, 0, 4},
    },
    [256] = {
        {555, "Мастер", [[ Все существа, пользующиеся магией Скверны – по своей воле или нет, – постепенно принимают внешний вид демонов. Мастер ускоряет их заражение и проводит жестокие эксперименты над любым, кто попытается сопротивляться. ]], 0.386612, 0.418033, 1, 835, 5356, 256, -1, 0, 1},
        {556, "Броггок", [[ У некоторых порой возникают сомнения, надо ли им оставаться преданными своим новым ужасным хозяевам. Броггок следит за тем, чтобы любое вольнодумство среди орков Скверны было полностью искоренено. ]], 0.433060, 0.219262, 1, 835, 5367, 256, -1, 0, 2},
        {557, "Кели\'дан Разрушитель", [[ Когда Иллидан сверг властителя преисподней Магтеридона и установил свою власть в Запределье, он заточил предводителя демонов в тюрьме Цитадели Адского Пламени. Только самый сильный боец из армии Иллидана мог удержать его там, и выбор пал на безжалостного орка по имени Кели'дан. ]], 0.583333, 0.411885, 1, 835, 5382, 256, -1, 0, 3},
    },
    [257] = {
        {558, "Командир Сараннис", [[ Когда попавший под влияние демонов предводитель эльфов крови Кель'тас захватил Крепость Бурь, он немедленно приказал командиру Сараннис подготовиться отразить нападение воинов, которых наару могли послать отвоевывать крепость. ]], 0.442623, 0.233607, 1, 839, 5401, 257, -1, 0, 1},
        {559, "Верховный ботаник Фрейвин", [[ Буквально через несколько минут после того, как Фрейвин попал в Ботанику, он взялся за опасные эксперименты, с помощью которых надеялся овладеть силой, сокрытой в растениях Запределья. ]], 0.241803, 0.227459, 1, 839, 5418, 257, -1, 0, 2},
        {560, "Скалезуб Скорбный", [[ Для экспериментов требуются материалы. Скалезуб Скорбный должен обеспечить ботаников Кель'таса достаточным количеством эссенции и энергии, чтобы раскрыть тайны наару, даже если это приведет к тому, что множество живых существ погибнут в результате опытов. ]], 0.073770, 0.481557, 1, 839, 5460, 257, -1, 0, 3},
        {561, "Ладж", [[ Наару собрали необычных диких существ со всего Запределья. Их загоны были уничтожены во время захвата Ботаники, в результате чего некоторые из самых опасных видов вырвались на свободу. ]], 0.340164, 0.862706, 1, 839, 5463, 257, -1, 0, 4},
        {562, "Узлодревень", [[ Ночные эльфы Дарнаса попросили о помощи в восстановлении древа тайной магии, которое оказалось заключено в Крепости Бурь. Узлодревень, напуганный недавним нападением прислужников Кель'таса Солнечного Скитальца, не способен отличить друзей от врагов и нападет на любого, кто его потревожит. ]], 0.342896, 0.368853, 1, 839, 5476, 257, -1, 0, 5},
    },
    [258] = {
        {563, "Механолорд Конденсарон", [[ Чтобы использовать аккумуляторы маны наару, требуется большая ловкость и точность, и оба этих качества будут очень полезны в случае защиты от вторжения. ]], 0.513661, 0.315574, 1, 840, 5479, 258, -1, 0, 1},
        {564, "Пустомант Сепетрея", [[ Благодаря своей способности быстро призывать существ в бою с противниками, Сепетрея была выбрана в качестве ученицы эльфа крови по имени Паталеон Вычислитель, властвующего в Механаре. ]], 0.478142, 0.202869, 2, 840, 5484, 258, -1, 0, 2},
        {565, "Паталеон Вычислитель", [[ После осквернения Солнечного Колодца, тщеславный чародей Паталеон увидел возможность снискать славу и помочь Кель'тасу в поисках лекарства от пристрастия его расы к магии. Поэтому он решил присоединиться к принцу эльфов крови в Запределье, чтобы пронаблюдать за ходом ужасных экспериментов принца. С недавних пор Паталеон стал изучать загадочные технологии в Крепости Бурь, надеясь заполучить власть и славу. ]], 0.271858, 0.610656, 2, 840, 5489, 258, -1, 0, 3},
    },
    [259] = {
        {566, "Главный чернокнижник Пустоклят", [[ Пустоклят некогда был шаманом клана Призрачной Луны, который отказался от власти над силами стихий и решил овладеть магией Скверны. Демоническая энергия, оказавшаяся в его распоряжении, оставила от него только пустую оболочку, и теперь бывшему шаману нравится лишь пытать молодых орков Скверны, чтобы определить предел их духовных и телесных возможностей. ]], 0.333333, 0.620902, 1, 843, 5497, 259, -1, 0, 1},
        {568, "О\'мрогг Завоеватель", [[ Безжалостный и хитрый огр О'мрогг считается одним из самых смертоносных членов Орды Скверны. Но у этого опасного увальня есть определенная проблема: две головы огра всегда спорили даже по самым простым вопросам. Два года назад О'мрогг задумался о том, чтобы записаться в программу реабилитации, чтобы примирить обе половины своей личности, однако его головы до сих пор не решили, стоит ли этим заниматься. ]], 0.542350, 0.342213, 1, 843, 5893, 259, -1, 0, 3},
        {569, "Вождь Каргат Острорук", [[ Вождь клана Изувеченной Длани и вождь Орды Скверны, Каргат является одним из величайших героев орков в обозримом прошлом. Когда-то он отрубил себе обе руки и заменил их оружием, согласно кровавому ритуалу, практикуемому лишь в его клане. Орки слагают легенды о той радости, которую он испытывает, причиняя боль окружающим и самому себе. Будучи абсолютным правителем Орды Скверны, он направил всю свою злобу и свирепость на то, чтобы создать непобедимую армию в железных стенах Цитадели Адского Пламени. ]], 0.673497, 0.545082, 1, 843, 5898, 259, -1, 0, 4},
        {728, "Кровавый страж Порунг", [[ Во время кровавой осады Шаттрата Порунг сражался с горсткой дренеев-паладинов, забаррикадировавшихся в дальнем конце города. Он в одиночку убил всех сопротивлявшихся, но из-за ран, полученных в сражении, не смог присоединиться к Орде в походе на Азерот. Раны Порунга уже давно зажили, и теперь он служит вождю Каргату Остроруку в Цитадели Адского Пламени, надеясь в боях получить славу, упущенную из-за ранения. Он считает, что его имя в истории орков должно быть записано кровью его противников. ]], 0.296846, 0.146568, 1, 843, 6216, 259, 2, 0, 2},
    },
    [260] = {
        {570, "Менну Предатель", [[ Менну – один из Сломленных. Так называют дренеев, чей облик исказила демоническая энергия, которую выпустили на свободу орки. Когда наги вторглись в Зангартопь, многие из этих несчастных существ отчаянно пытались бежать. Тем не менее, Менну выбрал другой путь к свободе. В обмен на свою собственную жизнь он предал товарищей змеям-захватчикам и согласился править своими сородичами на правах рабовладельца. ]], 0.490437, 0.270492, 1, 838, 5902, 260, -1, 0, 1},
        {571, "Рокмар Трескун", [[ После уничтожения Дренора Рокмар бежал в отдаленные пределы Зангартопи. Энергия, разорвавшая мир на куски, окутала этого гиганта и увеличила его силу и размер, но платой за мощь стали вечные муки. Когда в этой области впервые появились наги, они были потрясены свирепостью Рокмара. Они не стали убивать зверя, а вместо этого поработили его и с его помощью подчинили большую часть коренных обитателей Зангартопи. ]], 0.580601, 0.405738, 1, 838, 5907, 260, -1, 0, 2},
        {572, "Зыбун", [[ Когда-то Зыбун был предводителем грибных великанов Зангартопи. Однажды, когда он исследовал разветвленные пещеры этих земель, наги захватили его в плен и подвергли ужасным пыткам. Теперь это сломленное существо ревностно служит своим владыкам, усмиряя всех непокорных воле леди Вайш. ]], 0.821038, 0.768442, 1, 838, 5977, 260, -1, 0, 3},
    },
    [261] = {
        {573, "Гидромант Теспия", [[ Высокорожденная Теспия, жившая во время расцвета эльфийской империи, была ценительницей музыки и живописи. Но во время Великого Раскола она утратила интерес к прекрасному, когда вместе со многими другими эльфами была затянута в пучину, и превратилась в нагу, полную злобы. Последующие тысячи лет она служила поверенной леди Вайш, с которой дружила еще в детстве. Она без колебаний последовала за ней в Зангартопь и поклялась проследить за тем, чтобы план наг по осушению топей в этих землях был выполнен. ]], 0.542350, 0.137295, 1, 837, 5982, 261, -1, 0, 1},
        {574, "Анжинер Паропуск", [[ В результате заражения Гномрегана многие горожане превратились в лепрогномов. В числе несчастных оказался и талантливый анжинер Паропуск. Хотя ему удалось покинуть Гномреган и сохранить рассудок, его былая доброта и моральные принципы оказались навсегда утрачены. Он странствовал по Азероту и продавал свои технические наработки сомнительным клиентам вроде пиратов Кровавого Паруса. С недавних пор анжинер Паропуск работает на наг и управляет изощренными машинами Парового подземелья в Зангартопи. ]], 0.341530, 0.819672, 1, 837, 5996, 261, -1, 0, 2},
        {575, "Полководец Калитреш", [[ В глубинах Парового подземелья наги проводят эксперименты с загадочным веществом, стремясь сделать своих воинов сильнее и избавить их от страха. Калитреш был одним из первых слуг леди Вайш, который вызвался испытать на себе действие темного зелья. В награду за рвение ему поручили охранять обширное подземелье и следить за тем, чтобы все чародейские механизмы в нем работали исправно. ]], 0.759563, 0.436475, 1, 837, 6001, 261, -1, 0, 3},
    },
    [262] = {
        {576, "Топеглад", [[ В отличие от своего сородича Зыбуна, огромный грибной великан по имени Топеглад пока не порабощен нагами. Тем не менее, он враждебно относится ко всем чужакам, которые забредают в самые глубокие пещеры Зангартопи. Ему безразличны козни наг в остальных уголках топей: он целыми днями ухаживает за подспорником – древним растением, которое считается самым ценным, что у него есть. ]], 0.693989, 0.899590, 1, 836, 6006, 262, -1, 0, 1},
        {577, "Газ\'ан", [[ Историки уже давно спорят о том, есть ли у громадных гидр Азерота и Запределья общий предок. Так или иначе, эти безжалостные существа, несомненно, существуют в обоих мирах с древнейших времен. Газ'ан – одна из самых ужасающих гидр во всем Запределье. По воле леди Вайш это ненасытное чудовище опустошает нижнюю часть Зангартопи, наводя ужас на здешних обитателей. ]], 0.786885, 0.288935, 1, 836, 6009, 262, -1, 0, 2},
        {578, "Владыка болота Мусел\'ек", [[ Быть Сломленным – значит быть изгнанником. Владыка болота Мусел'ек познал всю правдивость и тяжесть этой истины. Он принадлежит к племени Темной Крови, но предпочитает бродить по пещерам Зангартопи в одиночку. Он прекрасно умеет приручать зверей: во время одной из таких прогулок он захватил призывателя ветров Когтя – друида, который осматривал окрестности в облике медведя. Мусел'ек заставил его подчиняться себе и сделал из него верного спутника, которого не оттолкнет порча, что коснулась владыки болота. ]], 0.415300, 0.241803, 1, 836, 6013, 262, -1, 0, 3},
        {579, "Черная Охотница", [[ Болотоброды Запределья – высокие крупные создания, которые охотятся в глуши топей на более мелких существ. Спорлинги Зангартопи рассказывают истории об одном из таких хищников, исключительно безжалостной Черной Охотнице. Она – прародительница всех болотобродов, и считается, что она выходит из своего логова в глубинах Нижетопи лишь для того, чтобы поохотиться на излюбленную добычу: спорлингов. ]], 0.247268, 0.456967, 1, 836, 6036, 262, -1, 0, 4},
    },
    [271] = {
        {580, "Старейшина Надокс", [[ Надокс когда-то был почитаемым предводителем нерубов, который обучал молодежь заветам предков. Когда в Азжол-Нерубе началась Война пауков, полчища нежити победили его. Король-лич вернул к жизни его тело и лишил Надокса прежней мудрости и благородства, заставив убить своих учеников, друзей и прочих нерубов, посмевших восстать против мощи Плети. ]], 0.696721, 0.270492, 1, 522, 6041, 271, -1, 0, 1},
        {581, "Принц Талдарам", [[ После неудавшегося нападения Кель'таса Король-лич убил некоторых из самых известных его сподвижников и превратил их в нежить в качестве воинов Плети. Принц Талдарам – один из коварных и вечно алчущих крови вампиров, который всегда стремится угодить Королю-личу. В поисках реликвий нерубов, призванных умножить войско Плети, он спустился в глубины Ан'кахета, разрушенного во время войны. ]], 0.631147, 0.495901, 1, 522, 6050, 271, -1, 0, 2},
        {582, "Джедога Искательница Теней", [[ Джедога грезит о конце света. Считается, что она одна из самых фанатичных последовательниц культа Сумеречного Молота. Безжалостный огр-маг по имени Чо'галл научил ее обращать силу шаманов на пользу древним богам. Не так давно Джедога отправилась в самое сердце Ан'кахета, чтобы подготовиться к торжественному дню, когда Йогг-Сарон освободится и его мрак поглотит весь Азерот. ]], 0.482240, 0.725410, 1, 522, 6055, 271, -1, 0, 3},
        {583, "Аманитар", [[ Многие годы грибы и прочие мелкие формы жизни вольготно себя чувствовали в сырых пещерах Ан'кахета, куда не проникают лучи солнца. Лишь недавно в этой изолированной экосистеме распространилось темное влияние Йогг-Сарона. Древний бог своей чудовищной силой исказил сущность одного из исконных обитателей этих мест и создал кошмарную тварь, имя которой Аманитар: безрассудный воплощенный ужас, существование которого подпитывается темной энергией его владыки. ]], 0.672131, 0.786885, 1, 522, 6060, 271, 2, 0, 4},
        {584, "Глашатай Волаж", [[ Во время вторжения сил Плети в Азжол-Неруб многие обитатели королевства устремились вниз, прорывая проходы, чтобы спастись от прислужников Короля-лича. Увы, некоторые из них закопались слишком глубоко и коснулись щупалец Йогг-Сарона. Они пробудили его, и чудовищный монстр послал одного из своих воинов, сражавшихся на его стороне с древнейших времен, глашатая Волажа, чтобы тот уничтожил попавших в ловушку нерубов и убил любого, кто осмелится угрожать древнему богу. ]], 0.236339, 0.504098, 1, 522, 6067, 271, -1, 0, 5},
    },
    [272] = {
        {585, "Крик\'тир Хранитель Врат", [[ На протяжении столетий врата Азжол-Неруба считались неприступными, пока не явился Король-лич. В насмешку над Крик'тиком, который не сумел остановить его войска и защитить свой дом, Артас воскресил его в качестве нежити и приказал ему защищать те самые ворота, которые ему при жизни отстоять не удалось. ]], 0.501366, 0.450820, 3, 533, 6073, 272, -1, 0, 1},
        {586, "Хадронокс", [[ Когда Азжол-Неруб пал, визири нерубов создали паука, который со временем должен был вырасти и вступить в бой с несокрушимым войском Короля-лича. Создатели вложили в Хадронокса ненависть, а также страстное желание отомстить за павших сородичей и отбить свой дом у любого, кто посягнет на него. ]], 0.431694, 0.594262, 2, 533, 6351, 272, -1, 0, 2},
        {587, "Ануб\'арак", [[ Судьбы Азжол-Неруба и Ануб'арака долгое время были связаны. При жизни он был королем этих земель, а после смерти – завоевателем. Король-лич приказал ему стоять на страже королевства, которое когда-то было подвластно ему самому, и король-предатель зорко следит за всеми, кто может представлять угрозу для этих земель. ]], 0.621585, 0.487705, 1, 533, 6355, 272, -1, 0, 3},
    },
    [273] = {
        {588, "Кровотролль", [[ Драккари – одни из самых кровожадных троллей, а Кровотролль – самый яркий и необузданный представитель этого племени. Чудовищный монстр столкнулся в бою с Королем-личом и ощутил, что его ярость – ничто в сравнении с неистовством Артаса. Теперь он служит предупреждением для тех, кто осмелится перечить власти Короля-лича. ]], 0.565574, 0.182377, 1, 534, 6370, 273, -1, 0, 1},
        {589, "Новос Призыватель", [[ Новос всегда стремился любыми способами возвыситься над посредственностями, окружавшими его. Этот служитель культа вырвал собственное сердце и отдал его своему повелителю, пока оно еще билось, за несколько секунд до смерти. Такое рвение впечатлило повелителя, и в награду он сделал Новоса личом. ]], 0.702186, 0.479508, 1, 534, 6375, 273, -1, 0, 2},
        {590, "Король Дред", [[ Король Дред – легенда среди Драккари. В легендах рассказывается о троллях-охотниках, обнаруживших могучего зверя, обитающего в землях, пораженных скверной Плети. Тролли приручили дьявозавра, решив, что он поможет им обрести лекарство от ужасной болезни, опустошающей их земли. ]], 0.612022, 0.862705, 1, 534, 6390, 273, -1, 0, 3},
        {591, "Пророк Тарон\'джа", [[ Даже краденая сила лоа не смогла остановить длань смерти, коснувшуюся троллей, когда Плеть обрушилась на крепость Драк'Тарон. Пророчества Тарон'джа теперь полны лишь видений триумфа его нового господина, и множество троллей погибает перед ликом Короля-лича. ]], 0.476776, 0.133197, 2, 534, 6396, 273, -1, 0, 4},
    },
    [274] = {
        {592, "Слад\'ран", [[ Слад'ран не испытывал энтузиазма, когда ему пришлось уничтожить лоа, которому он служил всю свою жизнь. Когда он был наделен мощью бога, верховный пророк поклялся, что Плеть понесет ответ за все зверства, которые троллям Драккари пришлось совершить. ]], 0.539617, 0.485656, 1, 530, 6411, 274, -1, 0, 1},
        {593, "Колосс Драккари", [[ Тролли уже давно использовали моджо в ритуалах вуду, но пробуждение к жизни голема – совершенно новый этап в развитии их магии. Успех этого начинания привел к тому, что тролли создали множество стражей с помощью колосса, своего первого творения. ]], 0.465847, 0.655737, 1, 530, 6418, 274, -1, 0, 2},
        {594, "Мураби", [[ Драккари хотели принести в жертву Мам'тота, чтобы получить его силу, но лоа уничтожил себя сам. Несмотря на это, Мураби, несомненно, обладает силой богов; верховный пророк выпил крови лоа, и теперь он готов пойти на все, чтобы Зул'Драк оставался в руках троллей. ]], 0.393442, 0.489754, 1, 530, 6980, 274, -1, 0, 3},
        {595, "Эк Свирепый", [[ Прекратив эксперименты над горлоками после бесчисленных попыток сделать из них живое оружие, Драккари заперли их. Пока ледяные тролли сражались с войсками Плети, пытаясь отстоять родную землю, Эк и его слуги ждали шанса вырваться на свободу. ]], 0.251366, 0.704918, 1, 530, 6664, 274, 2, 0, 4},
        {596, "Гал\'дара", [[ Драккари обратились к лоа, когда силы Плети напали на Зул'Драк. Ледяные тролли пришли к ним не с мольбами, а с мечами. Когда кровь убитого бога, Акали, обагрила землю, верховный пророк Гал'дара и его сподвижники-предатели впитали силу лоа. ]], 0.465847, 0.270492, 1, 530, 6989, 274, -1, 0, 5},
    },
    [275] = {
        {597, "Генерал Бьярнгрим", [[ Железным дворфам Локена нет числа, а их генерал, Бьярнгрим, превосходит всех прочих. Он первым встречает врагов, рискнувших явиться в Чертоги Молний: железный командующий безжалостно карает всякого, кто появился там без спросу. ]], 0.435792, 0.372951, 1, 525, 7724, 275, -1, 0, 1},
        {598, "Волхан", [[ Могучие воины Локена – плоды трудов его кузнеца Волхана. Не останавливаясь ни на секунду, он без устали создает солдат, чтобы те сражались за падшего хранителя. Лишь когда под ногами у его творений окажутся тела поверженных врагов, его труд будет завершен. ]], 0.377049, 0.209017, 2, 525, 7042, 275, -1, 0, 2},
        {599, "Ионар", [[ Самого Локена защищают не железные солдаты: он предпочитает выбирать для этого более сильных воителей. Падшего хранителя защищает сама молния: Ионар и слуги этого создания получили пристанище в Чертогах молний в обмен на обещание преданно служить, беспрекословно повиноваться и убивать любого, кто осмелится противостоять их новому господину. ]], 0.614754, 0.774590, 2, 525, 7252, 275, -1, 0, 3},
        {600, "Локен", [[ Локен, назначенный Главным куратором Азерота, должен был следить, чтобы Йогг-Сарон оставался в заточении. Никто и подумать не мог, что хранитель, призванный защитить мир от коварства древнего бога, сам поможет ему обрести свободу. ]], 0.189891, 0.522541, 2, 525, 7258, 275, -1, 0, 4},
    },
    [276] = {
        {601, "Фалрик", [[ Этот могучий воитель Плети был одним из первых рыцарей смерти, созданных Артасом после того, как он нашел Ледяную Скорбь. Фалрик последовал за принцем в Нордскол, но военная кампания была обречена на провал, а самого Фалрика предал господин, которому он верно служил всю свою жизнь. ]], 0.352459, 0.750000, 1, 603, 7265, 276, -1, 0, 1},
        {602, "Марвин", [[ Марвин знал Артаса всю жизнь и относился к нему не только как к принцу, но и как к настоящему другу. Рыцарь без колебаний последовал за Артасом, когда тот отправился в Нордскол. И хотя этот друг воткнул проклятый клинок в сердце Марвина, оно и так уже было разбито из-за того, кем стал принц. ]], 0.434426, 0.627049, 1, 603, 7269, 276, -1, 0, 2},
        {603, "Побег от Артаса", [[ Два владыки хотели победить Короля-лича в бою, навсегда положив конец его бесчинствам, но быстро осознали, что им не устоять против истинного короля. Стремясь избежать печальной участи, они попытались спастись бегством из его владений. Артас наслаждался каждой секундой, видя тщетность их усилий: нельзя спастись от неизбежности. ]], 0.105191, 0.274590, 1, 603, 7273, 276, -1, 0, 3},
    },
    [277] = {
        {604, "Кристаллус", [[ Для победы в войне одной только силы недостаточно, нужны еще и армии. Эта непреложная истина вдохновила Локена на создание верных каменных слуг, которые бы пополнили ряды его солдат. Задача Кристаллуса – наблюдать за ходом работ и следить, чтобы ничто им не мешало. ]], 0.401639, 0.604508, 1, 526, 7285, 277, -1, 0, 1},
        {605, "Дева Скорби", [[ Локен повелевает войсками Ульдуара, но не все охотно повинуются ему. Дева Скорби должна уничтожать всех, кто пытается отвоевать Чертоги Камня. Она горюет, поскольку ей нужно сражаться с бывшими союзниками, но свирепо и упорно исполняет приказ. Даже ее скорбь стала оружием. ]], 0.502732, 0.862705, 1, 526, 7290, 277, -1, 0, 2},
        {606, "Трибунал Веков", [[ Абеднеум, Каддрак и Марнак составляют Трибунал Веков. Они – хранители знаний, собранных на диске титанов, где содержится вся древняя история Азерота. Неподвижные изваяния не готовы так просто расстаться с секретами титанов, но искатели приключений вроде отважного Бранна Бронзоборода считают, что ради такой добычи стоит пойти на риск. ]], 0.845629, 0.760246, 1, 526, 7294, 277, -1, 0, 3},
        {607, "Сьоннир Литейщик", [[ Некоторые противостояли Локену, но Сьоннир Литейщик был только рад запятнать тьмой Кузню Воли. Он считает, что его новые создания намного превосходят всех прочих обитателей мира, и обрушит свои войска на любого, кто осмелится перечить воле Локена. ]], 0.497268, 0.137295, 1, 526, 7313, 277, -1, 0, 4},
    },
    [278] = {
        {608, "Начальник кузни Гархлад", [[ Гархлад создавал самое смертоносное оружие из всех, что воины Плети когда-либо обращали против живых. Он может быстро выковать из саронита кошмарные орудия пыток, приносящие мучительную смерть, а может и просто бросать куски руды во врагов. ]], 0.680328, 0.553278, 0, 602, 7327, 278, -1, 0, 1},
        {609, "Ик и Крик", [[ Низкорослый некромант Крик надзирает за рабочими в Яме Сарона. Он сидит на спине ужасного Ика и бросает сосуды с ядом, взрывчатку и запускает стрелы темной энергии во врагов, оставаясь вне их досягаемости. Сидя на спине Ика, он может заметить многое: ему удалось узнать некоторые секреты, с помощью которых можно низвергнуть Короля-лича. ]], 0.475410, 0.397541, 0, 602, 7334, 278, -1, 0, 2},
        {610, "Повелитель Плети Тираний", [[ Рыцарь смерти Тираний стал повелителем Плети после того, как убил гиганта Гархлада. Он силен, безжалостен, не знает колебаний, а еще в его распоряжении есть ледяной дракон Иней. Все это делает его идеальным хранителем Ямы Сарона и входа в Залы Отражений. ]], 0.441257, 0.266394, 0, 602, 7340, 278, -1, 0, 3},
    },
    [280] = {
        {615, "Броньям", [[ Броньям служил Культу Проклятых с момента его основания. Кел'Тузад самолично обучал Броньяма тому, как надо обращаться с душами, чтобы подпитывать смертоносные орудия Плети. Броньям может осквернять и разрывать на части души своих противников, что делает его идеальным стражем Кузни Душ Короля-лича. ]], 0.435793, 0.495902, 1, 601, 7380, 280, -1, 0, 1},
        {616, "Пожиратель Душ", [[ В результате темных деяний Броньяма в Кузне Душ появляются измученные и расколотые души. Но Королю-личу были нужны даже фрагменты проклятых душ, и чтобы не дать им сбежать, он создал Пожирателя Душ. Это чудовище охотится на отбившиеся души и медленно переваривает их в своей отвратительной утробе. Поглощенные души сходят с ума от чудовищных мучений, но голод Пожирателя Душ утолить невозможно. ]], 0.434426, 0.120902, 1, 601, 7387, 280, -1, 0, 2},
    },
    [281] = {
        {833, "Командир Колург", [[ Командир Колург занимался поисками опасных артефактов, которые могли бы очутиться в сокровищнице Орды. Неудача, постигшая его в Залах Покоя, разозлила его, и, освободившись от оков льда, он вряд ли сильно обрадуется, увидев, как герои Альянса крадут то, ради чего он сюда пришел. ]], 0.187159, 0.506146, 1, 520, 7428, 281, 2, 6, 1},
        {617, "Командир Пивобород", [[ Командир Пивобород со своими подчиненными не раз сражался с самыми опасными врагами Альянса. И хотя Залы Покоя несколько охладили его пыл, ничто не ободрит его лучше, чем приближающиеся к нему искатели приключений из Орды. ]], 0.187159, 0.506146, 1, 520, 6665, 281, 2, 10, 1},
        {618, "Великая ведунья Телестра", [[ Ходят слухи, что Великая ведунья Телестра была наставницей Кель'таса. И хотя она считала, что союз принца с нагами был глупостью, она не могла поддержать даларанских волшебников, которые держали ее собратьев в неволе. Малигосу не пришлось долго ее упрашивать, чтобы она стала наставницей его охотников на магов: ему достаточно было лишь упомянуть об этом предательстве. ]], 0.275956, 0.399590, 1, 520, 7392, 281, -1, 0, 2},
        {619, "Аномалус", [[ Из-за того, что Малигос пытался контролировать потоки тайной магии Азерота с помощью Нексуса, в ткани реальности произошел разрыв. Силы Малигоса пытаются сдержать натиск существ, ринувшихся в Азерот, однако хаотичная тайная энергия приняла форму существа, известного как Аномалус. Если это существо не остановить, оно будет уничтожать все, до чего дотронется. ]], 0.620218, 0.221312, 1, 520, 7405, 281, -1, 0, 3},
        {620, "Орморок Воспитатель Дерев", [[ Тайная энергия Нексуса сильно изменила Поющие Сады и их стражей. Эта участь постигла и Орморока: его незамысловатый разум помутился под воздействием энергии, которая изменила его. Вряд ли он будет многословен, увидев тех, кто прервал его раздумья, но одно можно сказать наверняка: этих смельчаков ждет множество неприятностей. ]], 0.562842, 0.727459, 1, 520, 7416, 281, -1, 0, 4},
        {621, "Керистраза", [[ Никто точно не может сказать, зачем Керистразу подвергли таким мучениям: то ли это была месть за смерть Сарагосы, то ли изощренная попытка сделать ее союзником… Ответ известен только Малигосу. Какими бы ни были его истинные намерения, союзники Керистразы слышали крики боли и шепот ее угасающего рассудка. ]], 0.362022, 0.674180, 1, 520, 7422, 281, -1, 0, 5},
    },
    [282] = {
        {622, "Дракос Дознаватель", [[ Те, кто нарушил законы Малигоса, попадают прямо в лапы Дракоса. Когда ему уже не было нужды охранять Керистразу в Нексусе, Дракос вернулся в Окулус, чтобы стать надзирателем пленных драконов, которые осмелились перечить Малигосу. Дракосу незнакомо слово 'искупление', да и в метафорах он не силен. Его пленники должны быть наказаны, и они не смогут спастись. ]], 0.491803, 0.762295, 1, 528, 7437, 282, -1, 0, 1},
        {623, "Варос Заоблачный Странник", [[ Варос Заоблачный Странник лично возглавлял жестокие нападения на Драконий союз с самого начала войны Нексуса. Его отозвали с передовой и поручили охранять Окулус; Дракос уже отдал нужные приказы своим офицерам и драконам. Кроме того, Варос получил доступ к силе, пронизывающей весь Окулус, и теперь он стал еще опаснее, чем раньше. ]], 0.461749, 0.192623, 2, 528, 7440, 282, -1, 0, 2},
        {624, "Маг-лорд Уром", [[ Уром отрекся от Кирин-Тора и присягнул на верность Малигосу, который был просто в восторге от того, что ему удалось заполучить столь могущественного союзника. Маг-перебежчик представляет огромную ценность для синих драконов, ведь ему известны все сильные и слабые стороны Кирин-Тора, и он может думать как они. Уром наверняка воспользуется этими знаниями, чтобы уничтожить магов Кирин-Тора. ]], 0.707650, 0.274590, 0, 528, 7445, 282, -1, 0, 3},
        {625, "Хранитель энергии Эрегос", [[ Даже бесстрашные герои трепещут перед Эрегосом, защитником Окулуса, стражем потоков тайной магии и убийцей чужаков. Он убежден, что следует пророчеству, и прекрасно справляется со своими обязанностями. Он пойдет на все, чтобы защитить абсолютную власть Хранителя магии. ]], 0.469945, 0.209016, 0, 528, 7448, 282, -1, 0, 4},
    },
    [283] = {
        {626, "Эрекем", [[ В Аметистовой Крепости содержатся самые опасные преступники Запределья, и Эрекем – не исключение. Кирин-Тору удалось сорвать планы Эрекема, когда он собирался уничтожить Совет Шестерых, но теперь синие драконы наняли этого хитрого араккоа, чтобы осуществить гораздо более грандиозный план: они собираются уничтожить всех магов в Даларане. ]], 0.275956, 0.622951, 1, 536, 7457, 283, -1, 0, 1},
        {627, "Морагг", [[ Синигоса обратилась к Мораггу, чтобы тот помог ей уничтожить мятежных магов Даларана. В свое время этот ужасный демон служил Пылающему Легиону, уничтожая врагов Саргераса лишь одним внушающим трепет взглядом своих семи глаз. И теперь он покажет героям Азерота, что в Аметистовую Крепость просто так не проникнешь... ]], 0.678962, 0.528688, 1, 536, 7470, 283, -1, 0, 2},
        {628, "Гнойрон", [[ Недальновидный ученик призвал это чудовище из Обители стихий, но когда он понял, что из недовольных воителей, служивших древним богам, выходят не очень покладистые питомцы, было уже слишком поздно. Гнойрон убила того, кто ее призвал, и теперь гниет в темнице Аметистовой Крепости, надеясь когда-нибудь отомстить своим тюремщикам. ]], 0.556011, 0.403688, 1, 536, 7475, 283, -1, 0, 3},
        {629, "Ксевозз", [[ Ксевозз занимался торговлей оружием, усиленным тайной магией… до тех пор, пока волшебники Кирин-Тора не узнали, что он продает оружие Пылающему Легиону. И теперь этот весьма прагматичный эфириал разработал план из трех частей: уничтожить своих противников, сбежать из тюрьмы и заново наладить поставки оружия своему самому крупному покупателю. ]], 0.330601, 0.452869, 1, 536, 7482, 283, -1, 0, 4},
        {630, "Лавантор", [[ В свое время расчетливая Синигоса выпустила на свободу одну из самых страшных гончих Недр. В попытке умерить жажду крови этого двуглавого чудовища маги заключили Лавантора в тюрьму, и годы, проведенные в заточении, не способствовали улучшению его характера. ]], 0.618852, 0.750000, 1, 536, 7488, 283, -1, 0, 5},
        {631, "Зурамат Уничтожитель", [[ Для усмирения Зурамата потребовалась сотня лучших даларанских магов, а чтобы избавиться от последствий кровавой резни, которую он устроил, потребовалось еще две сотни волшебников. Кровожадность Уничтожителя отвращает даже безумного Малигоса, и он считает, что жажда магии лорда Бездны омерзительна. Тем не менее, кровавая бойня подчас сближает полные противоположности. ]], 0.271858, 0.336066, 1, 536, 7492, 283, -1, 0, 6},
        {632, "Синигоса", [[ В качестве исполнителя своих планов Малигос избрал именно Синигосу, поскольку ее верность прошла испытание временем. Синигоса не отреклась от Малигоса, когда тот выжил из ума; она не перечила ему, когда он захватил потоки тайной магии Азерота… и она уничтожит любого, кто посмеет противостоять ему. ]], 0.450820, 0.551229, 1, 536, 7497, 283, -1, 0, 7},
    },
    [285] = {
        {638, "Принц Келесет", [[ Король-лич отправил Келесета в крепость Утгард в надежде воспользоваться разрушительной мощью врайкулов. Прибыв туда, посланник обнаружил, что многие в этой крепости с радостью готовы помочь Плети. Крепость оказалась прекрасным опорным пунктом, позволяющим держать в страхе весь Ревущий фьорд, и принц Келесет не собирается отдавать ее без боя дерзким чужакам. ]], 0.289618, 0.627049, 1, 523, 7601, 285, -1, 0, 1},
        {639, "Скарвальд и Далронн", [[ Заставлять тех, кто испытывает друг к другу неприязнь, работать вместе – одна из традиций врайкулов. Некоторые считают, что благодаря этому способности антагонистов дополняют друг друга, другие думают, что это просто прихоть короля Имирона. Но какими бы ни были на то причины, Скарвальд и Далорнн – прекрасный пример этой традиции. Грубая сила врайкула и искусство некромантии человека образуют грозный дуэт, задача которого – уничтожать любого, кто сует свой нос в дела Плети. ]], 0.587431, 0.620901, 2, 523, 7609, 285, -1, 0, 2},
        {640, "Ингвар Расхититель", [[ Невероятная сила Ингвара считается легендарной даже среди врайкулов. Ходят слухи, что однажды он победил в драке самого короля Имирона. Правда это или нет – неизвестно, однако те, кто рассказывает эту историю, обычно долго не живут. Ингвар пообещал Королю-личу, что он будет прибегать к самым жестоким мерам, чтобы удержать крепость, и он не посмеет нарушить это обещание. ]], 0.724043, 0.381148, 0, 523, 7619, 285, -1, 0, 3},
    },
    [286] = {
        {641, "Свала Вечноскорбящая", [[ Свала когда-то была командиром на службе у Ингвара Расхитителя, и на ее счету – множество разведывательных операций в лагерях Орды и Альянса. Именно Свала узнала о том, что враги собираются проникнуть в Крепость Утгард, и благодаря этому у Короля-лича появилось время на подготовку к обороне. В награду за преданную службу Король-лич превратил ее в валь'киру, почитаемую воительницу Плети. ]], 0.363388, 0.706967, 1, 524, 7660, 286, -1, 0, 1},
        {642, "Горток Бледное Копыто", [[ Врайкулы держат в крепости Утгард множество охотничьих трофеев, и Горток – один из самых впечатляющих. Жестокое выражение лица замороженного магнатавра служит для короля Имирона напоминанием о том, что даже самые дикие звери являются не более чем украшениями в крепости врайкулов. Если освободить это чудовище из ледяного плена, оно обрушит свой гнев на всех, кто попадется ему на пути. ]], 0.606558, 0.688525, 2, 524, 7669, 286, -1, 0, 2},
        {643, "Скади Безжалостный", [[ Прозвища врайкулов свидетельствуют о былых достижениях. За убийство семейства Драккари или обезглавливание таунка можно получить прозвище 'Ревностный', но чтобы заслужить имя 'Безжалостный', нужно сделать что-то намного более жестокое. Скади заслужил свое прозвище давным-давно, когда он, не зная покоя, выслеживал и убивал врайкулов, которые укрывали больных младенцев: король Имирон выносил смертный приговор любому, кто посмеет проявить подобное сострадание. ]], 0.684426, 0.362705, 2, 524, 7691, 286, -1, 0, 3},
        {644, "Король Имирон", [[ Гордый король Имирон правил северными пустошами, но затем врайкул погрузился в долгий сон, и о нем позабыли. Очнувшись, он обнаружил, что его жену убили, а родной край осажден врагами. Обретя бессмертие, он страстно жаждет возмездия, а тех, кто встанет на пути очнувшегося гиганта, ждет неминуемая кара. ]], 0.415301, 0.534836, 2, 524, 7708, 286, -1, 0, 4},
    },
    [741] = {
        {1519, "Люцифрон", [[ Люцифрон является одним из четырех Поджигателей и капитанов Рагнароса и первый босс в Огненных Недрах. Поджигатели огня - раса безжалостных змееподобных существ, которые служат Рагнаросу Повелителю огня. Свирепые и устрашающие, пробуждающие огонь являются одними из самых страшных стражей элементалей в Огненных Недрах. ]], 0.658633, 0.374995, 0, 877, 20173, 741, -1, 0, 0},
        {1520, "Магмадар", [[ Магмадар состоит из вулканической породы и бурлящей магмы. Магмадар служит источником гончих, которые бродят по земляным залам Огненных Недр. Для Рагнароса Магмадар считается домашним животным, которое защищено Поджигателем Люцифроном и окружено порочными пачками хищных гончих. Говорят, что пока Рагнарос был заточен на Плане Элементалей, Повелитель Огня скармливал останки своих захваченных врагов нетерпеливо ожидающим пасти Магмадара близнецам. В результате собака стала сильной и верной, и даже сейчас, дикая свирепость Магмадара остается неоспоримой. Магмадар — альфа-самец всех гончих недр. ]], 0.694339, 0.236793, 0, 877, 20177, 741, -1, 0, 1},
        {1521, "Гееннас", [[ Гееннас и его соплеменники-поджигатели выбрались из стихий в Огненных недрах. В отличие от элементалей огня, которые являются существами чистого пламени, возбудители огня - элементали, состоящие из плоти и крови. Гееннас находится в самом низу элементальной иерархии Повелителя огня и жаждет власти и положения своих начальников. Ему не доверяют все, кто служит с ним, за исключением двух его верных стражников, которые считают, что они могут выиграть от восхождения своего надзирателя. Гееннас использует теневую магию и охраняет Руну Мона вместе с двумя Поджигателями. ]], 0.330876, 0.485334, 0, 877, 20181, 741, -1, 0, 2},
        {1522, "Гарр", [[ Гарр — существо из лавы и земли, которое охраняет Руну Пламени в Огненных недрах, расположенной между Геенасом и Бароном Геддоном. Он является боссом ближнего боя, и его всегда сопровождают 8 стражников. ]], 0.315094, 0.689623, 0, 877, 20184, 741, -1, 0, 3},
        {1523, "Шаззрах", [[ Из всех поджигателей, которые последовали за Рагнаросом в мир Азерота, Шаззрах является самым талантливым в царстве тайной магии. Он знает, что его коллега, Барон Геддон, подозревает элементалей Гарра в предательстве. Конфликт между Бароном Геддоном и Гарром хорошо подходит Шаззраху, поскольку на самом деле именно Шаззрах стремится завладеть обеими половинами Талисмана Связывания Элементалей, чтобы найти способ перекачивать его энергию для собственного использования. Скорее всего, Рагнарос знал о склонности своего подчиненного к двуличности, когда разделил талисман пополам и доверил части барону Геддону и Гарру. Шаззрах охраняет Руну Мазжа. ]], 0.558406, 0.852617, 0, 877, 20190, 741, -1, 0, 4},
        {1524, "Барон Геддон", [[ Барон Геддон является боссом-огненным элементалем и находится в Огненных Недрах. Он патрулирует возле зоны возрождения Шаззраха, охраняя Руну Зета. ]], 0.523926, 0.776320, 0, 877, 20195, 741, -1, 0, 5},
        {1525, "Предвестник Сульфурон", [[ Предвестник Сульфурон является вестником Рагнароса. Он подчиняется только Экзекутусу и охраняет руну Коро, одну из нескольких рун, усиливающих слуг Повелителя Огня. Предвестник Сульфурон внимательно следит за Шаззрахом, полагая, что Шаззрах стремится предать Рагнароса. В сопровождении четырех самых пылких жрецов Повелителя Огня Предвестник готовится к тому дню, когда повелитель огня захватит мир Азерота. ]], 0.828302, 0.825472, 0, 877, 20199, 741, -1, 0, 6},
        {1526, "Големагг Испепелитель", [[ Солдаты стихий Рагнароса, которых больше всего боятся, — расплавленные гиганты. Среди них Големагг Испепелитель; он не имеет равных благодаря своей жестокости и дикой эффективности. Сила расплавленного чудовища настолько безгранична, что он запугал двух своих основных ярых врагов — отпрысков Магмадара, которых он теперь использует в качестве домашних животных и для охраны руны Тери. За это оскорбление он заслужил вечный и непоколебимый гнев Магмадара, хотя грозное существо еще не отреагировало на его дикие порывы. ]], 0.688680, 0.576416, 0, 877, 20208, 741, -1, 0, 7},
        {1527, "Мажордом Экзекутус", [[ В верхней части элементарной иерархии, как раз под самим Рагнаросом, проживает Мажордом Экзекутус. Этот поджигатель получил свой возвышенный статус, доказав, что он почти неуязвим в битвах, которые бушевали на уровне элементалей. Ходят слухи, что Экзекутус вытеснил барона Геддона, и с тех пор они стали соперниками. Хотя этот слух еще не подтвержден, нет никаких сомнений в том, что Рагнарос не терпит неудач. Таким образом, меньшие поджигатели огня (и, конечно же, барон Геддон) с нетерпением ждут оплошности Экзекутуса, ожидая своего шанса посоревноваться за вожделенное внимание Повелителя Огня. Экзекутусу в схватке будут помогать четыре Поджигателя-гвардейца и четыре Поджигателя-целителя. ]], 0.841510, 0.652831, 0, 877, 20215, 741, -1, 0, 8},
        {1528, "Рагнарос", [[ Рагнарос, Повелитель огня, был невероятно мощным предводителем огненных элементалей. После того как его вызвал в Азерот Император Тауриссан, тот взял под свой контроль Черную гору и правил там более двухсот лет, используя приспешников дворфа из глубокого ядра, расположенного внутри самой горы. ]], 0.562265, 0.533963, 0, 877, 20226, 741, -1, 0, 9},
    },
    [742] = {
        {1536, "Нефариан", [[ Нефариан экспериментировал с кровью всех стай драконов, чтобы создать хроматическую стаю неудержимых воинов. В этой задаче он стал настоящим преемником своего отца, с помощью своей сестры он планирует использовать их и тем самым сплотить черных драконов под своим командованием.
В Черной Горе он ведет постоянную битву с Рагнаросом и его силами за контроль над горой и, в конечном итоге, над всем регионом. Нефариан получает удовольствие от захвата прислужников Рагнароса и использования их в своих коварных целях. Он заключил союз с Рендом Черноруком, но использует его и Темную Орду только для достижения своих целей. Безумное стремление Нефариана к господству даже привлекло гнев красного дракона Ваэластраза, который всегда был самым большим врагом стаи Нефариана. Хотя намерения Нефариана известны, методы, которые он использует для их достижения, остаются загадкой.
Теперь, когда черные драконы снова под твердым руководством и при поддержке этих новых хроматических драконов, он планирует нанести ответный удар другим драконам, а также на смертные нации мира. ]], 0.703746, 0.724620, 4, 885, 20068, 742, -1, 0, 7},
        {1529, "Бритвосмерт Неукротимый", [[ Лорд Логова Крыла Тьмы, Нефариан, поручил Бритвосмерту Неукротимому охранять многочисленные и драгоценные яйца черного дракона, расположенные в первой комнате подземелья. С этой целью Бритвосмерту было поручено командовать когортой орков и других сил, и он не остановится ни перед чем, чтобы защитить своих подопечных. ]], 0.419285, 0.602438, 1, 885, 20021, 742, -1, 0, 0},
        {1530, "Валестраз Порочный", [[ Валестраз Порочный - второй босс Логова Крыла Тьмы. Он был порабощен Нефарианом и теперь неохотно служит ему. ]], 0.332819, 0.275371, 1, 885, 20028, 742, -1, 0, 1},
        {1531, "Предводитель драконов Разящий Бич", [[ Предводитель драконов Разящий Бич охраняет Залы Раздора, преграждая путь во внутреннее святилище Нефариана. ]], 0.505751, 0.617476, 3, 885, 20033, 742, -1, 0, 2},
        {1532, "Огнечрев", [[ Огнечрев — четвертый босс в Логове Крыла Тьмы, патрулирующий Багровые лаборатории от Предводителя драконов до Черноскала. ]], 0.464398, 0.429507, 3, 885, 20037, 742, -1, 0, 3},
        {1533, "Черноскал", [[ Черноскал - пятый босс в Логове Крыла Тьмы, патрулирующий верхнюю комнату Багровых лабораторий после Огнечрева и перед Пламенегором. Он один из трех могущественных черных драконов, охраняющих путь к своему хозяину, Нефариану. ]], 0.349110, 0.209583, 3, 885, 20041, 742, -1, 0, 4},
        {1534, "Пламегор", [[ Пламегор является третьим из трех драконов в Логова Крыла Тьмы после Черноскала и перед Хромаггусом. ]], 0.355376, 0.371237, 4, 885, 20045, 742, -1, 0, 5},
        {1535, "Хромаггус", [[ Хромаггус является двуглавым драконом-прислужником Нефариана, который обитает в Логове Крыла Тьмы и охраняет покои своего повелителя. ]], 0.394223, 0.726500, 4, 885, 20049, 742, -1, 0, 6},
    },
    [743] = {
        {1537, "Куриннакс", [[ Куриннакс — это паукообразное существо, которое является песчаным разорителем. О Куриннаксах мало что известно, но они встречаются в зараженных силитидами районах Калимдора. Песчаных разорителей можно встретить только в Ан'Кираже. ]], 0.563507, 0.357434, 0, 881, 20076, 743, -1, 0, 0},
        {1538, "Генерал Раджакс", [[ "Генерал Раджакс — главный командир киражей. Во время Войны Зыбучих Песков Раджакс командовал киражами и силитидами в битве, размахивая когтистыми конечностями и выкрикивая команды своим солдатам. Во время войны он столкнулся с лидерами сил ночных эльфов, а позже лично казнил Вальстанна, разорвав его пополам своими когтями. ]], 0.584020, 0.491280, 0, 881, 20080, 743, -1, 0, 1},
        {1539, "Моам", [[ Готовясь к возрождению киражей в мире, темный повелитель Ан'Киража приказал Императору Век'лору создать новую обсидиановую статую, превосходящую всех остальных Разрушителей. Век'лор обратился за помощью к своему брату-близнецу в этой задаче, и в то время как Век'нилаш использовал свою физическую мощь, чтобы создать грандиозное тело из вулканической породы, Век'лор укрепил оболочку с помощью мощной магии. Император Век'лор назвал законченную конструкцию Моам и наблюдал, как темный мастер наполнял ее жизнью. Он был рад и удивлен, обнаружив, что улучшенный Обсидиановый Разрушитель был намного более универсальным, чем его более ранние аналоги. ]], 0.328635, 0.360511, 0, 881, 20083, 743, -1, 0, 2},
        {1540, "Буру Ненасытный", [[ Мнение, что в глубинах Ан'Киража обитает много силитидских колоссов, подтвердилось, когда подземелье было открыто. Буру Ненасытный — силитидский колосс с огромной силой и ужасным внешним видом. Его четыре ноги, две похожие на косу руки, выдолбленные рога и большое двойное тело поставят в ужас даже самого отважного воина. ]], 0.697866, 0.620511, 0, 881, 20088, 743, -1, 0, 3},
        {1541, "Аямисса Охотница", [[ Аямисса Охотница — предводительница летающих ос — силитидов. Она бесстрашный боец, готовый охотно пожертвовать собой, чтобы победить врага. ]], 0.616841, 0.905126, 0, 881, 20093, 743, -1, 0, 4},
        {1542, "Оссириан Неуязвимый", [[ Оссириан Неуязвимый — единственный известный хорусат. Первоначально он был анубисатом, которому после победы над бронзовым драконом Граккарондом была дарована эта новая форма. ]], 0.429149, 0.695895, 0, 881, 20099, 743, -1, 0, 5},
    },
    [744] = {
        {1543, "Пророк Скерам", [[ Пророк Скерам — религиозный лидер в Ан'Кираже, и автор Пророчества К'Туна. Он — первый босс в Храме Ан'Киража, и только победив его, можно пройти вглубь подземного святилища. ]], 0.457866, 0.522049, 2, 893, 20105, 744, -1, 0, 0},
        {1544, "Боевой страж Сартура", [[ Боевой страж Сартура — лидер киражской боевой стражи, и второй босс в Храме Ан'Киража. Его сопровождает гвардия из трех самых сильных воительниц. Хотя по ним и не скажешь, они не только очень быстрые и маневренные, но и имеют довольно прочную броню ]], 0.445559, 0.335896, 1, 893, 20124, 744, -1, 0, 2},
        {1545, "Фанкрисс Непреклонный", [[ Фанкрисс Непреклонный — песчаный разоритель, старший брат Куриннакса. Он — третий босс в Храме Ан'Кираж. О нем мало что известно, но чтобы добраться до него, придется преодолеть туннель, который заполонили сотни, а может, даже и тысячи жуков. ]], 0.622995, 0.218973, 1, 893, 20130, 744, -1, 0, 3},
        {1546, "Принцесса Хухуран", [[ Принцесса Хухуран — большая оса—силитид, и четвертый босс Храма Ан'Киража. Чтобы победить ее, требуется высокое сопротивление сил природы. Осы — силитиды — это летающие атакующие войны. Они очень агрессивны и часто передвигаются стаями. ]], 0.435303, 0.503588, 1, 893, 20138, 744, -1, 0, 5},
        {1547, "Царственность силитида", [[ Царственность Силитида, также известные как Троица или триумвират, являются необязательным боссом в Храме Ан'Кираж. Триумвират состоит из трех могущественных существ: Лорда Кри, Принцессы Яуй и Вэм. Троицей их называют не просто так, потому что они неразлучны и нападают одновременно. ]], 0.284533, 0.497434, 1, 893, 20110, 744, -1, 0, 1},
        {1548, "Нечистотон", [[ Нечистотон — гигантский слизень, доступ к которому можно получить после смерти Фанкрисса Непоколебимого. Химик Барабос предполагает, что эта слизь может быть тесно связана с Древними Богами, и что сам Нечистотон может быть Древним Богом. Тем не менее, в настоящее время это самая мощная слизь из когда-либо известных. ]], 0.721456, 0.178973, 1, 893, 20135, 744, -1, 0, 4},
        {1549, "Императоры-близнецы", [[ Умные братья Век'лор и Век'нилаш, известны как императоры—близнецы. Они управляют киражами из святилища их храма. Эти братья—близнецы отлично дополняют друг друга: в то время как Век'лор владеет мощной магией, Век'нилаш обладает большой физической мощью. ]], 0.606584, 0.697434, 1, 893, 20143, 744, -1, 0, 6},
        {1550, "Оуро", [[ Древний песчаный червь, Оуро - это существо с легендарной силой. Ходят слухи, что он был создан самим Древним Богом К'Туном как издевательство над жизнью. Он проживает в Храме Ан'Киража. Его кожа неестественно толстая, почти неприступная. Она гибкая и позволяет ему двигаться со скоростью и грацией гораздо меньшего существа. ]], 0.301969, 0.818972, 1, 893, 20154, 744, -1, 0, 7},
        {1551, "К\'Тун", [[ К'Тун  - Древний Бог безумия и хаоса, одно из четырех древних и могущественных существ, правивших миром. К'Тун создал киражей и живет в городе Ан'Кираж в Силитусе. Это непостижимо злое существо, чья всепроникающая сила наполняла Азерот с незапамятных времен. В последние годы К'Тун освободился. Защитники Альянса и Орды решили не ждать, пока Древний Бог наберет силу. Они вторглись в город-королевство Ан'Кираж, сражаясь с бесчисленными киражами и силитидами, прежде чем, наконец, сразиться со злобным богом и победить его. Тем не менее, неизвестно, действительно ли Азерот видел последнего К'Туна. ]], 0.570687, 0.625126, 3, 893, 20160, 744, -1, 0, 8},
    },
    [745] = {
        {11008, "Терестиан Больное Копыто", [[ Сатиры - мерзкие создания. Падшие ночные эльфы, прельстившиеся мощью демонов, искаженные, изломанные, дабы их облик соответствовал их внутреннему состоянию.
Терестиан Больное Копыто проник в Каражан, надеясь открыть там портал в Круговерть Пустоты, дабы его демонический хозяин пришел в этот мир и, разумеется, вознаградил его. Но его планам не суждено сбыться, ведь герои Азерота помешают этому ритуалу.
 Ведь так?.. ]], 0.525638, 0.696924, 28, 867, 12265, 745, 4, 0, 5},
        {11009, "Гнев Пустоты", [[ Дракон Пустоты, неведомым образом пробравшийся в Каражан и поселившийся в обсерватории Медива. Подобное создание чувствует себя в Каражане как дома, и похоже, что его могущество только возросло от долгой близости с этим проклятым замком. Открывая порталы в неведомые дали, Гнев Пустоты черпает из них силу и, безусловно, будет с яростью атаковать любого, кто посягнет на его логово. ]], 0.359484, 0.418462, 30, 867, 12240, 745, 4, 0, 7},
        {11010, "Ночная Погибель", [[ Сила Медива была велика настолько, что одним лишь усилием воли он заставил синего дракона, Арканагоса, который прилетел к башне чародея, в буквальном смысле сгореть изнутри. Ныне этот несчастный известен, как Ночная Погибель, драконий скелет, вечно объятый пламенем и прикованный к месту своей жуткой гибели, обречённый возвращаться снова и снова.
Пришла пора прекратить его муки. ]], 0.472000, 0.925000, 23, 867, 12292, 745, 4, 0, 10},
        {11011, "Принц Малчезар", [[ Неизвестно, каким образом Принц Малчезар, один из высших эредарских иерархов, попал в Каражан, но очевидно, чем он занимался в этом мрачном замке. Верхний этаж башни Каражана, где можно встретить Малчезара, окутан мраком - сама реальность начала изменяться, сливаясь со странным местом - Пустомарью. Возможно, Малчезар хотел превратить Каражан в свой форпост для дальнейшего вторжения его легиона в Азерот, возможно - его интересовали лишь мрачные тайны замка и природа его проклятия. В любом случае, демон должен быть уничтожен. ]], 0.514356, 0.309231, 34, 867, 12320, 745, 4, 0, 9},
        {1552, "Комнаты слуг", [[ По всему Каражану обитает множество опасных существ, с которыми можно повстречаться в комнатах слуг. Для призыва босса в комнатах слуг необходимо убить существ, присутствующих в них. ]], 0.597000, 0.292000, 1, 867, 21153, 745, 1, 0, 11},
        {1553, "Ловчий Аттумен", [[ Ловчий Аттумен был известным на весь Альянс коневодом. Лошади слушались его так, как будто он говорил с ними на одном языке, а его скакуны за огромные деньги скупались знатью всех королевств. Какая нелегкая занесла ловчего с его конем под своды Каражана — мы не узнаем никогда, ибо проклятая башня рьяно хранит свои тайны, но что не подлежит сомнению, так это то, что Аттумен стал гораздо более кровожадным, чем был при жизни. ]], 0.452819, 0.826154, 1, 867, 12041, 745, 1, 0, 0},
        {1554, "Мороуз", [[ Мороуз был стариком, который жил в Каражане, служа кастеляном Медива. Он знал о видениях, показываемых магией замка, но стремился избегать их. Мороуз погиб от руки своего обезумевшего хозяина и попал под действие проклятья Каражана, которое будет вечно возрождать его в облике нежити. Он всё ещё пытается поддерживать порядок в замке и защищать его от непрошенных гостей. ]], 0.271280, 0.635385, 3, 867, 12060, 745, 1, 0, 1},
        {1555, "Благочестивая дева", [[ Создание титанов, воплощающее в себе чистоту и силу воли, Благочестивая дева прибыла в Каражан, будучи возмущенной пороками и злодеяниями тамошних обитателей. Однако проклятье этого таинственного замка поглотило и её. Теперь Благочестивая дева - такой же раб Каражана, вынужденная безнадежно искоренять пороки лишь затем, чтобы они явились вновь. ]], 0.834384, 0.500042, 4, 867, 12109, 745, 1, 0, 2},
        {1556, "Оперный зал", [[ Каражан - огромный замок, и что за замок без оперного зала? Барнс, конферансье Оперы, подобно другим жителям Каражана, застрял во времени, бесконечно повторяя свои представления. Но пока идет представление, через оперный зал не пройти. Быть может, стоит поучаствовать в постановке Барнса, чтобы пройти далее, в глубины Каражана?.. ]], 0.181023, 0.350770, 4, 867, 12123, 745, 1, 0, 3},
        {1557, "Смотритель", [[ Каражан огромен и полон ценностей, на которые наверняка с удовольствием наложили бы руку воры и авантюристы всех сортов. Чародейские стражи, могучие големы, переполненные магией, охраняют коридоры Каражана, и самый могучий из них - Смотритель - охраняет галерею, препятствуя дальнейшему исследованию этого проклятого замка. ]], 0.494869, 0.366155, 9, 867, 12177, 745, 1, 0, 4},
        {1559, "Тень Арана", [[ Эхо отца Медива, бледная тень некогда великого мага, бесцельно перемещается по библиотеке Каражана. Тень, утратившая последние капли рассудка в этой вечной пытке проклятого замка, но не утратившая ни капли могущества, легко примет любого незваного гостя Каражана за причину своих вечных страданий. ]], 0.716407, 0.260001, 10, 867, 12212, 745, 1, 0, 6},
        {1560, "Терестиан Больное Копыто", [[ Сатиры - мерзкие создания. Падшие ночные эльфы, прельстившиеся мощью демонов, искаженные, изломанные, дабы их облик соответствовал их внутреннему состоянию.
Терестиан Больное Копыто проник в Каражан, надеясь открыть там портал в Круговерть Пустоты, дабы его демонический хозяин пришел в этот мир и, разумеется, вознаградил его. Но его планам не суждено сбыться, ведь герои Азерота помешают этому ритуалу.
 Ведь так?.. ]], 0.525638, 0.696924, 11, 867, 12265, 745, 1, 0, 5},
        {1561, "Гнев Пустоты", [[ Дракон Пустоты, неведомым образом пробравшийся в Каражан и поселившийся в обсерватории Медива. Подобное создание чувствует себя в Каражане как дома, и похоже, что его могущество только возросло от долгой близости с этим проклятым замком. Открывая порталы в неведомые дали, Гнев Пустоты черпает из них силу и, безусловно, будет с яростью атаковать любого, кто посягнет на его логово. ]], 0.359484, 0.418462, 13, 867, 12240, 745, 1, 0, 7},
        {1562, "Ночная Погибель", [[ Сила Медива была велика настолько, что одним лишь усилием воли он заставил синего дракона, Арканагоса, который прилетел к башне чародея, в буквальном смысле сгореть изнутри. Ныне этот несчастный известен, как Ночная Погибель, драконий скелет, вечно объятый пламенем и прикованный к месту своей жуткой гибели, обречённый возвращаться снова и снова.
Пришла пора прекратить его муки. ]], 0.471000, 0.923000, 6, 867, 12292, 745, 1, 0, 10},
        {1563, "Принц Малчезар", [[ Неизвестно, каким образом Принц Малчезар, один из высших эредарских иерархов, попал в Каражан, но очевидно, чем он занимался в этом мрачном замке. Верхний этаж башни Каражана, где можно встретить Малчезара, окутан мраком - сама реальность начала изменяться, сливаясь со странным местом - Пустомарью. Возможно, Малчезар хотел превратить Каражан в свой форпост для дальнейшего вторжения его легиона в Азерот, возможно - его интересовали лишь мрачные тайны замка и природа его проклятия. В любом случае, демон должен быть уничтожен. ]], 0.514356, 0.309231, 17, 867, 12320, 745, 1, 0, 9},
        {11656, "Шахматы", [[ Чтобы запустить событие, нужно поговорить с Тенью Медива. По ходу партии игроки могут управлять разными шахматными фигурами, представляющими участников Первой войны в Азероте. Медив иногда играет не по правилам. Если рейд выигрывает партию, он может забрать добычу  после того, как Медив признает свое поражение. ]], 0.358000, 0.622000, 14, 867, 21159, 745, 1, 0, 8},
        {11002, "Ловчий Аттумен", [[ Ловчий Аттумен был известным на весь Альянс коневодом. Лошади слушались его так, как будто он говорил с ними на одном языке, а его скакуны за огромные деньги скупались знатью всех королевств. Какая нелегкая занесла ловчего с его конем под своды Каражана — мы не узнаем никогда, ибо проклятая башня рьяно хранит свои тайны, но что не подлежит сомнению, так это то, что Аттумен стал гораздо более кровожадным, чем был при жизни. ]], 0.452819, 0.826154, 18, 867, 12041, 745, 4, 0, 0},
        {11003, "Мороуз", [[ Мороуз был стариком, который жил в Каражане, служа кастеляном Медива. Он знал о видениях, показываемых магией замка, но стремился избегать их. Мороуз погиб от руки своего обезумевшего хозяина и попал под действие проклятья Каражана, которое будет вечно возрождать его в облике нежити. Он всё ещё пытается поддерживать порядок в замке и защищать его от непрошенных гостей. ]], 0.271280, 0.635385, 20, 867, 12060, 745, 4, 0, 1},
        {11004, "Благочестивая дева", [[ Создание титанов, воплощающее в себе чистоту и силу воли, Благочестивая дева прибыла в Каражан, будучи возмущенной пороками и злодеяниями тамошних обитателей. Однако проклятье этого таинственного замка поглотило и её. Теперь Благочестивая дева - такой же раб Каражана, вынужденная безнадежно искоренять пороки лишь затем, чтобы они явились вновь. ]], 0.834384, 0.500042, 21, 867, 12109, 745, 4, 0, 2},
        {11005, "Оперный зал", [[ Каражан - огромный замок, и что за замок без оперного зала? Барнс, конферансье Оперы, подобно другим жителям Каражана, застрял во времени, бесконечно повторяя свои представления. Но пока идет представление, через оперный зал не пройти. Быть может, стоит поучаствовать в постановке Барнса, чтобы пройти далее, в глубины Каражана?.. ]], 0.181023, 0.350770, 21, 867, 12123, 745, 4, 0, 3},
        {11006, "Смотритель", [[ Каражан огромен и полон ценностей, на которые наверняка с удовольствием наложили бы руку воры и авантюристы всех сортов. Чародейские стражи, могучие големы, переполненные магией, охраняют коридоры Каражана, и самые могучие из них - Смотрители - охраняет галерею, препятствуя дальнейшему исследованию этого проклятого замка. ]], 0.494869, 0.366155, 26, 867, 12177, 745, 4, 0, 4},
        {11007, "Тень Арана", [[ Эхо отца Медива, бледная тень некогда великого мага, бесцельно перемещается по библиотеке Каражана. Тень, утратившая последние капли рассудка в этой вечной пытке проклятого замка, но не утратившая ни капли могущества, легко примет любого незваного гостя Каражана за причину своих вечных страданий. ]], 0.716407, 0.260001, 27, 867, 12212, 745, 4, 0, 6},
    },
    [746] = {
        {11012, "Король Молгар", [[ Король Молгар и его чемпионы - самые могучие огры Запределья, являются гвардией Груула, охраняя Логово. Каждый из этих чемпионов обладает своими уникальными способностями, а их комбинированной силе можно противопоставить лишь стальную хватку Груула. ]], 0.550255, 0.570769, 2, 864, 11981, 746, 8, 0, 0},
        {11013, "Груул Драконобой", [[ Огромный гронн, прославившийся как Драконобой во время боя против Черной стаи Смертокрыла, который хотел спрятать яйца своей стаи в Острогорье. Обитая в огромной пещере Логова Груула, он сам - жуткая угроза любому не-огру в Острогорье. ]], 0.249486, 0.283077, 2, 864, 11960, 746, 8, 0, 1},
        {1564, "Король Молгар", [[ Король Молгар и его чемпионы - самые могучие огры Запределья, являются гвардией Груула, охраняя Логово. Каждый из этих чемпионов обладает своими уникальными способностями, а их комбинированной силе можно противопоставить лишь стальную хватку Груула. ]], 0.550255, 0.570769, 1, 864, 11981, 746, 2, 0, 0},
        {1565, "Груул Драконобой", [[ Огромный гронн, прославившийся как Драконобой во время боя против Черной стаи Смертокрыла, который хотел спрятать яйца своей стаи в Острогорье. Обитая в огромной пещере Логова Груула, он сам - жуткая угроза любому не-огру в Острогорье. ]], 0.199486, 0.283077, 1, 864, 11960, 746, 2, 0, 1},
    },
    [747] = {
        {11014, "Магтеридон", [[ Иллидан помог Акаме победить демонов и орков Магтеридона, и совместными усилиями они штурмовали Цитадель Адского Пламени. В итоге Магтеридон пал от руки Иллидана. По крайней мере, так считалось… Когда Иллидан сокрушил Магтеридона, последний был на пороге жизни и смерти, но, поняв это, Иллидан решил оставить Магтеридона в живых. Он приказал слугам спрятать тело Магтеридона в пещере, чтобы использовать его пылающую кровь для поддержания демонической силы орков. Слуги Иллидана ежедневно забирают большую часть крови демона, поэтому он находится в коме. Если Магтеридон когда-нибудь восстанет, то наверняка попытается вернуть себе Запределье… ]], 0.691795, 0.743077, 1, 865, 11919, 747, 8, 0, 0},
        {1566, "Магтеридон", [[ Иллидан помог Акаме победить демонов и орков Магтеридона, и совместными усилиями они штурмовали Цитадель Адского Пламени. В итоге Магтеридон пал от руки Иллидана. По крайней мере, так считалось… Когда Иллидан сокрушил Магтеридона, последний был на пороге жизни и смерти, но, поняв это, Иллидан решил оставить Магтеридона в живых. Он приказал слугам спрятать тело Магтеридона в пещере, чтобы использовать его пылающую кровь для поддержания демонической силы орков. Слуги Иллидана ежедневно забирают большую часть крови демона, поэтому он находится в коме. Если Магтеридон когда-нибудь восстанет, то наверняка попытается вернуть себе Запределье… ]], 0.691795, 0.743077, 1, 865, 11919, 747, 2, 0, 0},
    },
    [748] = {
        {1567, "Гидросс Нестабильный", [[ Огромный элементаль воды обитает в Змеином Святилище, очищаясь от скверны, которая поразила его, как и значительную часть элементалей Запределья, и помогая очиститься младшим элементалям. Но несмотря на все ухищрения наг, состояние Гидросса остается нестабильным, и стоит ему выйти из радиуса действия машин, построенных нагами, как яд вновь переполняет его. ]], 0.363590, 0.847692, 1, 862, 700, 748, 2, 0, 0},
        {1568, "Скрытень из глубин", [[ Удивительные существа населяют Запределье, и далеко не все из них обитают на поверхности. В самых глубинах Змеиного Святилища обитает причудливое создание, сродни кракенам, обитающим в северных морях Азерота - Скрытень из глубин. Того, кто потревожит странный водоем, место, где Скрытня подкармливают наги, ждет весьма.. необычная находка. ]], 0.402564, 0.581538, 1, 862, 711, 748, 2, 0, 1},
        {1569, "Леотерас Слепец", [[ Леотерас был одним из пяти эльфов крови, которых Иллидан взял к себе в ученики, дабы сделать из них охотников на демонов. Но путь охотника на демонов - не для слабых телом, и трое из пяти потеряли свои жизни. Слабого же духом Леотераса ждала гораздо более мрачная судьба. Пройдя через ритуал и обретя внутреннего демона, Леотерас не смог установить над ним контроль и обезумел. Чароплеты Змеиного Святилища удерживают его в заточении, пытаясь вернуть ему разум, но тщетно, ведь в голове Леотераса теперь всегда звучат два голоса - его и демона. ]], 0.417949, 0.255385, 1, 862, 722, 748, 2, 0, 2},
        {1570, "Повелитель глубин Каратресс", [[ Каратресс возглавляет личную стражу Леди Вайш. Опытный воин и жестокий командир, Каратресс избрал трех стражей, обладающих уникальными способностями. Вместе они являются последней линией обороны Змеиного Святилища и остаются непобежденными - ведь у Каратресса есть секрет, узнать который удается лишь перед смертью. ]], 0.504103, 0.176924, 1, 862, 738, 748, 2, 0, 3},
        {1571, "Морогрим Волноступ", [[ Морские гиганты, могучие, зловредные и, как правило, недалекие гуманоиды встречаются на забытых островах Азерота, и как правило, враждебны ко всему и вся. Морогрим Волноступ является исключением из этого правила. Неизвестно, как именно наги убедили его поселиться в Змеином Святилище, но этот гигант теперь обитает здесь, как и орда повинующихся ему мурлоков. ]], 0.596410, 0.260001, 1, 862, 769, 748, 2, 0, 4},
        {1572, "Леди Вайш", [[ Главная служанка Азшары, ставшая нагой, как и её госпожа, была отправлена, чтобы помочь Иллидану в его путешествии с целью уничтожить Ледяной Трон. И хотя её новый повелитель и не преуспел, Леди Вайш проследовала за ним в Запределье, где Иллидан и подвластные ему отряды начали спешно укреплять свои позиции в ожидании гнева Легиона. Могущественная морская ведьма управляет Змеиным святилищем и является страшным противником даже для самых опытных воинов. ]], 0.722563, 0.589231, 1, 862, 777, 748, 2, 0, 5},
        {11650, "Гидросс Нестабильный", [[ Огромный элементаль воды обитает в Змеином Святилище, очищаясь от скверны, которая поразила его, как и значительную часть элементалей Запределья, и помогая очиститься младшим элементалям. Но несмотря на все ухищрения наг, состояние Гидросса остается нестабильным, и стоит ему выйти из радиуса действия машин, построенных нагами, как яд вновь переполняет его. ]], 0.359000, 0.799000, 2, 862, 20930, 748, 8, 0, 0},
        {11651, "Горе\'лац", [[ Глубоко на дне водоема, в таинственных ответвлениях подземных пещер, слившись с камнем, обитает чудовищных размеров создание из шипов, яда и хитина, известное как Горе'лац. Древнейшее существо Зангартопи, чей разум далеко ушел от уровня примитивных созданий, населяющих водохранилище. Лишь изредка, поддавшись на лакомую добычу, гигантский краб покидает свое логово и всплывает на поверхность, чтобы утащить пищу в глубинные воды. Его появление пробуждает иные хищные создания подводного мира - но несколько доверенных надзирателей Леди Вайш следят за тем, чтобы Горе'лац не покидал глубины надолго.
Найдется ли умелый рыбак с удочкой достаточно крепкой, чтобы вытащить древнего краба из глубин? ]], 0.403000, 0.589000, 2, 862, 20998, 748, 8, 0, 1},
        {11652, "Леотерас Слепец", [[ Леотерас был одним из пяти эльфов крови, которых Иллидан взял к себе в ученики, дабы сделать из них охотников на демонов. Но путь охотника на демонов - не для слабых телом, и трое из пяти потеряли свои жизни. Слабого же духом Леотераса ждала гораздо более мрачная судьба. Пройдя через ритуал и обретя внутреннего демона, Леотерас не смог установить над ним контроль и обезумел. Чароплеты Змеиного Святилища удерживают его в заточении, пытаясь вернуть ему разум, но тщетно, ведь в голове Леотераса теперь всегда звучат два голоса - его и демона. ]], 0.417949, 0.255385, 2, 862, 20952, 748, 8, 0, 2},
        {11653, "Повелитель глубин Каратресс", [[ Каратресс возглавляет личную стражу Леди Вайш. Опытный воин и жестокий командир, Каратресс избрал трех стражей, обладающих уникальными способностями. Вместе они являются последней линией обороны Змеиного Святилища и остаются непобежденными - ведь у Каратресса есть секрет, узнать который удается лишь перед смертью. ]], 0.504103, 0.176924, 2, 862, 21019, 748, 8, 0, 3},
        {11654, "Морогрим Волноступ", [[ Морские гиганты, могучие, зловредные и, как правило, недалекие гуманоиды встречаются на забытых островах Азерота, и как правило, враждебны ко всему и вся. Морогрим Волноступ является исключением из этого правила. Неизвестно, как именно наги убедили его поселиться в Змеином Святилище, но этот гигант теперь обитает здесь, как и орда повинующихся ему мурлоков. ]], 0.596410, 0.260001, 2, 862, 21080, 748, 8, 0, 4},
        {11655, "Леди Вайш", [[ Главная служанка Азшары, ставшая нагой, как и её госпожа, была отправлена, чтобы помочь Иллидану в его путешествии с целью уничтожить Ледяной Трон. И хотя её новый повелитель и не преуспел, Леди Вайш проследовала за ним в Запределье, где Иллидан и подвластные ему отряды начали спешно укреплять свои позиции в ожидании гнева Легиона. Могущественная морская ведьма управляет Змеиным святилищем и является страшным противником даже для самых опытных воинов. ]], 0.722563, 0.589231, 2, 862, 21113, 748, 8, 0, 5},
    },
    [749] = {
        {1573, "Ал\'ар", [[ Феникс, путешествовавший вместе с Кель'тасом, его верный фамильяр, Ал'ар возрос в могуществе многократно с того дня, как они с Кель'тасом впервые увидели друг друга. Ныне он и его потомки служат своему повелителю, обитая в Крепости Бурь. ]], 0.501026, 0.587692, 1, 782, 806, 749, 2, 0, 0},
        {1574, "Страж Бездны", [[ Сквернобот, построенный подчиненными Кель'тасу демонами Пылающего Легиона и усовершенствованный механиками кровавых эльфов, использует огромную физическую силу и мощь тайной магии, чтобы охранять левое крыло Крепости Бурь. ]], 0.264075, 0.490686, 1, 782, 819, 749, 2, 0, 1},
        {1575, "Верховный звездочет Солариан", [[ Верховный звездочет обязан обладать острым умом, познаниями тайной магии, и умением смотреть в бездну, не теряя рассудка. Солариан идеально исполняет свою работу под руководством Кель'таса, и со временем к её способностям прибавились знания, полученные из Бездны. Стоит ли говорить о том, что эти знания будут задействованы в бою в случае необходимости? ]], 0.740000, 0.489230, 1, 782, 823, 749, 2, 0, 2},
        {1576, "Кель\'тас Солнечный Скиталец", [[ Правитель эльфов крови, последний принц этого народа, Кель'тас Солнечный Скиталец захватил Крепость Бурь и превратил её в свою твердыню с одной целью - заполучить контроль над хаотическими энергиями Пустоверти, обратив их в силу, которая сокрушит любого врага и поможет его народу утолить свою жажду магии. ]], 0.500999, 0.138461, 1, 782, 836, 749, 2, 0, 3},
        {11573, "Ал\'ар", [[ Феникс, путешествовавший вместе с Кель'тасом, его верный фамильяр, Ал'ар возрос в могуществе многократно с того дня, как они с Кель'тасом впервые увидели друг друга. Ныне он и его потомки служат своему повелителю, обитая в Крепости Бурь. ]], 0.501026, 0.587692, 1, 782, 1500, 749, 8, 0, 0},
        {11574, "Страж Бездны", [[ Сквернобот, построенный подчиненными Кель'тасу демонами Пылающего Легиона и усовершенствованный механиками кровавых эльфов, использует огромную физическую силу и мощь тайной магии, чтобы охранять левое крыло Крепости Бурь. ]], 0.264075, 0.490686, 1, 782, 1539, 749, 8, 0, 1},
        {11575, "Верховный звездочет Солариан", [[ Верховный звездочет обязан обладать острым умом, познаниями тайной магии и умением смотреть в бездну, не теряя рассудка. Солариан идеально исполняет свою работу под руководством Кель'таса, и со временем к её способностям прибавились знания, полученные из Бездны. Стоит ли говорить о том, что эти знания будут задействованы в бою в случае необходимости? ]], 0.740000, 0.489230, 1, 782, 1559, 749, 8, 0, 2},
        {11576, "Кель\'тас Солнечный Скиталец", [[ Правитель эльфов крови, последний принц этого народа, Кель'тас Солнечный Скиталец захватил Крепость Бурь и превратил её в свою твердыню с одной целью - заполучить контроль над хаотическими энергиями Пустоверти, обратив их в силу, которая сокрушит любого врага и поможет его народу утолить свою жажду магии. ]], 0.500999, 0.138461, 1, 782, 1604, 749, 8, 0, 3},
    },
    [753] = {
        {1597, "Аркавон Страж Камня", [[ Слабейший из стражей в Склепе, Аркавон Страж камня - огромный каменный гигант, управляющий силами земли. ]], 0.493350, 0.168738, 1, 532, 11475, 753, 3, 0, 0},
        {1598, "Эмалон Страж Бури", [[ Эмалон Страж Бури - великан, наделенный силами шторма. Он и его загробники охраняют Склеп Аркавона. ]], 0.627193, 0.553059, 1, 532, 11489, 753, 3, 0, 1},
        {1599, "Коралон Страж Огня", [[ Коралон Страж Огня - один из стражей Склепа Аркавона, могущественный каменный гигант, наделенный силами огня. ]], 0.363289, 0.551625, 1, 532, 11479, 753, 3, 0, 2},
        {1600, "Торавон Страж Льда", [[ Торавон Страж Льда - самый могущественный из стражей Склепа Аркавона, каменный гигант, наделенный силами льда. ]], 0.627151, 0.363767, 1, 532, 11484, 753, 3, 0, 3},
    },
    [754] = {
        {1601, "Ануб\'Рекан", [[ Ануб'Рекан - один из нерубианских лордов, служащий стражем Паучьего Квартала в Наксрамасе. ]], 0.306925, 0.469885, 2, 535, 11497, 754, -1, 0, 0},
        {1602, "Великая вдова Фарлина", [[ Некогда талантливый алхимик, ныне Фарлина - одна из высокопоставленых членов Культа Проклятых. Обитая в Паучьем квартале Наксрамаса, она обучает своих адептов темному мастерству. ]], 0.441725, 0.360899, 2, 535, 11504, 754, -1, 0, 1},
        {1603, "Мексна", [[ Гигантская паучиха, соткавшая свою паутину в одной из комнат Паучьего квартала Наксрамаса. Будучи объектом поклонения Фарлины и её культа, Мексна изо дня в день увеличивает число своего потомства, сохраняя свой яд таким же смертоносным, как и прежде. ]], 0.686466, 0.152964, 2, 535, 11511, 754, -1, 0, 2},
        {1604, "Нот Чумной", [[ Как Артас услышал зов Короля-лича, так и Нот в свое время присоединился к Плети в погоне за властью и могуществом. Во время Третьей войны, однако, Нот начал сомневаться в том, что он сделал, и Король-Лич, не долго думая, заморозил сердце в его груди. С тех пор Нот не знает ни сомнений, ни пощады, и только смерть может остановить его. ]], 0.346122, 0.564531, 4, 535, 11518, 754, -1, 0, 3},
        {1605, "Хейган Нечестивый", [[ Хейган Нечестивый, один из числа некромантов, плотно занявшихся изучением и манипуляциями непосредственно с гибельной чумой, обитает в Наксрамасе, улучшая и развивая этот новый вид боевого колдовства. В его арсенале гибельные заклинания, ослабляющие проклятия, и наверняка есть еще пара тузов в рукаве. ]], 0.498172, 0.456978, 4, 535, 11525, 754, -1, 0, 4},
        {1606, "Лотхиб", [[ Споровые шаркуны - крайне интересный вид существ, порожденный болотами. Но Лотхиб - уникум даже среди них. Странные мутации привели к тому, что само его присутствие распространяет некротическую ауру, препятствующую любому исцелению. 
Не прошло много времени, прежде чем им заинтересовался Культ Проклятых, и теперь Лотхиб обитает в Квартале чумы, что в Наксрамасе. ]], 0.760165, 0.283523, 4, 535, 11530, 754, -1, 0, 5},
        {1607, "Инструктор Разувий", [[ Один из старших рыцарей смерти, оставшийся верным Королю-Личу даже после восстания рыцарей Черного Клинка. Теперь он обучает новое поколение рыцарей смерти в Военном квартале Наксрамаса. ]], 0.427469, 0.459909, 3, 535, 11537, 754, -1, 0, 6},
        {1608, "Готик Жнец", [[ Готик Жнец - эксперт в некромантии и темной магии, один из немногих некромантов, кто может поднять из мертвых не только тело, но и душу, превращая покойников в призрачных воителей. После восстания рыцарей Черного Клинка он находится в Военном квартале Наксрамаса, обучая неофитов искусству магии тьмы. ]], 0.675078, 0.596142, 3, 535, 11545, 754, -1, 0, 7},
        {1609, "Четыре Всадника", [[ Самые могущественные рыцари смерти в Наксрамасе - это четыре всадника. Они представляют собой вершину гвардии Кел'Тузада. Первый, Тан Корт'азз, обладает силой пламени. Следующая, леди Бломе, вызывает силу теней, вытягивая души живых в ненасытные объятия. Сэр Зелик, верный в жизни паладин, настолько сильный в своей вере, что даже в немощной силе света все еще прислушивается к его призыву, поражая своих врагов в битве. Последний рыцарь смерти, лорд Могрейн, был лучшим воином, которого когда-либо видели рыцари смерти. Однако после событий Азерота он бесследно исчез. Кел'Тузад назначил на его место Барона Ривендера. ]], 0.301273, 0.768225, 3, 535, 11606, 754, -1, 0, 8},
        {1610, "Лоскутик", [[ Лоскутик хочет поиграть!
Одно из самых монструозных поганищ, когда-либо созданных Плетью. Переживший мятеж рыцарей Черного Клинка Лоскутик гордо именуется 'Воплощением войны'. Сейчас он сторожит коридоры Квартала мерзости, что в Наксрамасе. ]], 0.541192, 0.416887, 1, 535, 11622, 754, -1, 0, 9},
        {1611, "Гроббулус", [[ Один из несостоявшейся армии гигантов из плоти, Гроббулус обитает в Квартале мерзости, что в Наксрамасе. Жуткий монстр, созданный армией Плети. Плод извращенного ума гениальных инженеров и хирургов Плети. Огромный ходячий мутаген, который пропитан ядом, смертью, страхом и слизью... мерзкой слизью. ]], 0.615762, 0.531547, 1, 535, 11626, 754, -1, 0, 10},
        {1612, "Глут", [[ Огромный пес-нежить, поглощающий излишних зомби, обитает в Наксрамасе. Бесчисленные трупы, пожранные этим чудовищем, наделили его сверхъестественным нечестивым могуществом. Теперь он обитает в закрытой части Квартала мерзости, что в Наксрамасе, и единственный способ попасть туда - сточные трубы. ]], 0.462924, 0.438272, 1, 535, 11633, 754, -1, 0, 11},
        {1613, "Таддиус", [[ Чудовищный гигант из плоти, в котором запечатаны страдающие, агонизирующие души, зовущие на помощь даже сейчас, обитает в Квартале мерзости, что в Наксрамасе. Некромантия и эксперименты с электричеством обратили это чудовище к нежизни, и горе тому, кто схлестнется с монстром, способным испепелить врага вспышкой молнии. ]], 0.265857, 0.145792, 1, 535, 11639, 754, -1, 0, 12},
        {1614, "Сапфирон", [[ Некогда могущественный слуга Малигоса, хранитель артефактов, и не знающий поражений дракон из синей стаи, Сапфирон вступил в битву с Артасом во время его путешествия к Ледяному Трону, и проиграл. Артас пожертвовал значительной частью своих тогдашних сил, чтобы воскресить Сапфирона в виде могучего ледяного змея, и прорвался к Азжол-Нерубу с его помощью. Теперь этот дракон охраняет палаты Кел'Тузада, находясь в логове ледяного змея, что в Верхнем некрополе Наксрамаса. ]], 0.565133, 0.675014, 6, 535, 11652, 754, -1, 0, 13},
        {1615, "Кел\'Тузад", [[ Кел'Тузад – один из главных служителей Короля-Лича, ответственный за распространение чумы Плети по Лордерону. После того, как был убит Артасом в эпоху Третьей Войны, переродился в образе лича. С помощью Артаса он призвал Архимонда Осквернителя, предводителя Пылающего Легиона. Тем не менее, Кел'Тузад был воистину предан Королю-Личу, а никак не Пылающему Легиону. Когда Артас отправился в Нордскол в период событий, связанных с Ледяным Троном, он оставил Кел'Тузада в качестве своего наместника для командования Плетью в Лордероне. Ранее он правил Чумными Землями из некрополя Наксрамас, парящим над Стратхольмом, но теперь Наксрамас и, соответственно, Кел'Тузад располагаются в восточной части Драконьего Погоста, где он вновь служит Королю-Личу. ]], 0.365324, 0.223293, 6, 535, 11660, 754, -1, 0, 14},
    },
    [755] = {
        {1616, "Сартарион", [[ Хранитель Обсидианового Святилища, чья задача - охранять кладку нового поколения стаи Смертокрыла. ]], 0.505736, 0.477055, 0, 531, 11419, 755, 3, 0, 0},
    },
    [756] = {
        {1617, "Малигос", [[ Малигос, Хранитель магии, обезумевший от горя и боли, начал войну против всех, кто использует магию, видя в чародеях лишь источник хаоса и бедствий. В Оке Вечности, что в Нексусе, он собирает энергию силовых линий Азерота, желая раз и навсегда покончить с угрозой чрезмерного использования магии. Ваша цель - остановить его. ]], 0.384321, 0.498566, 1, 527, 11449, 756, 3, 0, 0},
    },
    [757] = {
        {1618, "Чудовища Нордскола", [[ Если вы отважитесь пойти в колизей Серебряного Авангарда, будьте готовы к тому, что вам предстоит сразиться с самыми могучими и сильными чудовищами Нордскола: Гормок Пронзающий Бивень, Кислотная Утроба и Жуткая Чешуя. Ледяной Рев не прощает ошибок и не дает поблажек. ]], 0.511514, 0.527373, 1, 543, 2450, 757, -1, 0, 0},
        {1619, "Лорд Джараксус", [[ Лорд Джараксус — демон—повелитель эредаров, из Пылающего Легиона. До того, как стать манари, Джараксус был известен как Великий визирь Джарасум, один из трех величайших учеников Архимонда. Его не очень любили, но, тем не менее, всегда уважали. ]], 0.463713, 0.405480, 1, 543, 11000, 757, -1, 0, 1},
        {1620, "Чемпионы Альянса", [[ Альянс требует справедливости, и бросает вызов вам, чемпионам Орды. Вашими противниками будут одни из самых лучших воинов Альянса, выступавших на этом турнире, но те, кто бросил вызов Орде, падут. Лок'тар огар! ]], 0.428340, 0.527373, 1, 543, 11059, 757, -1, 8, 2},
        {1621, "Чемпионы Орды", [[ Орда посмела обвинить Альянс в кознях, связанных с призывом эредарского лорда, и теперь требует справедливости, бросив вызов вам, чемпионам Альянса. Вашими противниками будут самые свирепые и умелые воины Орды, но они не чета вам, и должны быть уничтожены. Слава Альянсу! ]], 0.428340, 0.527373, 1, 543, 11201, 757, -1, 4, 2},
        {1622, "Валь\'киры-близнецы", [[ Фьола и Эйдис — две очень могущественные валь'киры, которые были отправлены Королем—личом вместе с его армией мстительных валь'киры, чтобы уничтожить ристалище Серебряного турнира. Но во время нападения исповедница Пейлтресс победила валь'кир-близнецов и взяла в плен Фьолу и Эйдис. Теперь сразиться с ними можно будет в колизее Серебряного Авангарда! ]], 0.463713, 0.649266, 1, 543, 11016, 757, -1, 0, 3},
        {1623, "Ануб\'арак", [[ Ануб'арак является царем нерубианского королевства, Азжол—Неруб. После поражения в Азжол—Нерубе, Ануб'арак был воскрешен Королем—личем и получил намного больше силы льда и чумы. ]], 0.532546, 0.355289, 2, 543, 11038, 757, -1, 0, 4},
        {11679, "Заход почести (1-24)", [[  ]], 0.520000, 0.228000, 0, 0, 0, 757, 12, 0, 5},
        {11680, "Заход почести (25-44)", [[  ]], 0.520000, 0.228000, 0, 0, 0, 757, 12, 0, 6},
        {11681, "Заход почести (45-49)", [[  ]], 0.520000, 0.228000, 0, 0, 0, 757, 12, 0, 7},
        {11682, "Заход почести (50)", [[  ]], 0.520000, 0.228000, 0, 0, 0, 757, 12, 0, 8},
    },
    [758] = {
        {1624, "Лорд Ребрад", [[ Король-лич создал Ребрада из костей тысяч пропавших искателей приключений, и теперь он охраняет Ледяной Трон у подножья Шпиля, наполненный силой самого трона. ]], 0.391055, 0.593338, 1, 604, 11677, 758, -1, 0, 0},
        {1625, "Леди Смертный Шепот", [[ Леди Смертный Шепот окончательно заменила Кел'Тузада после падения Наксрамаса, став полноправным лидером Культа Проклятых. Находясь в Цитадели Ледяной Короны, она обучает самых одаренных и амбициозных из культистов, готовя из них новую магическую гвардию Плети. ]], 0.391055, 0.869980, 1, 604, 11683, 758, -1, 0, 1},
        {1626, "Битва на кораблях в Ледяной Короне", [[ Продолжая восхождение, герои Альянса и Орды оказываются за пределами цитадели, где их ненависть друг к другу обостряется в битву за господство над Черепным Валом. Приближается битва между верховным правителем Саурфангом на боевом корабле «Молот Оргрима», или Мурадином Бронзобородом на «Усмирителе Небес». Каждая фракция будет защищать свой корабль в битве, чтобы определить, кто действительно достоин встретиться с Королем—личом. ]], 0.219927, 0.550191, 2, 604, 0, 758, -1, 4, 2},
        {1627, "Битва на кораблях в Ледяной Короне", [[ Продолжая восхождение, герои Альянса и Орды оказываются за пределами цитадели, где их ненависть друг к другу обостряется в битву за господство над Черепным Валом. Приближается битва между верховным правителем Саурфангом на боевом корабле «Молот Оргрима», или Мурадином Бронзобородом на «Усмирителе Небес». Каждая фракция будет защищать свой корабль в битве, чтобы определить, кто действительно достоин встретиться с Королем—личом. ]], 0.690500, 0.550191, 2, 604, 0, 758, -1, 8, 2},
        {1628, "Саурфанг Смертоносный", [[ Храбрый и сильный орк, павший от руки Короля-Лича у Врат Гнева, был обращен в рыцаря смерти и теперь сторожит вход в внутреннее святилище Цитадели Ледяной Короны. Король-Лич наделил его особым могуществом - сила крови Саурфанга обладает невероятным исцеляющим эффектом, позволяя ему в одиночку сдерживать хоть армию, сражаясь до победы. ]], 0.515422, 0.216060, 3, 604, 11713, 758, -1, 0, 3},
        {1629, "Тухлопуз", [[ Одно из двух гигантских поганищ, созданных Мерзоцидом. Наделенный значительной физической силой и манипулирующий газом мерзкой гнили, Тухлопуз - опасное орудие Плети. ]], 0.198978, 0.654874, 5, 604, 11726, 758, -1, 0, 4},
        {1630, "Гниломорд", [[ Любимчик Мерзоцида. Поганище, источающее едкую, временами оживающую слизь, и обладающее значительной физической силой, Гниломорд - опасное орудие Плети. ]], 0.198978, 0.418259, 5, 604, 11733, 758, -1, 0, 5},
        {1631, "Профессор Мерзоцид", [[ Говорят, гениальность порой граничит с безумием. Профессор Мерзоцид - яркий пример этого случая. Безумный гений, создавший множество видов чумы, творец поганищ, лучший алхимик из когда-либо существоваших, Мерзоцид обитает в Чумодельне, что в Цитадели Ледяной Короны, и его изобретательности нет конца. ]], 0.131101, 0.532982, 5, 604, 11747, 758, -1, 0, 6},
        {1632, "Совет Кровавых принцев", [[ Валанар, Келесет и Талдарам - Сан'лейн, три принца крови, потерпевшие поражение от рук героев Азерота, бывшие кровавые эльфы, что заменили силу Солнечного колодца силой крови. Их тела были бережно сохранены и доставлены в Багровый зал Цитадели Ледяной Короны, где им суждено воскреснуть и продолжить свое вечное служение. ]], 0.520160, 0.141491, 5, 604, 11779, 758, -1, 0, 7},
        {1633, "Кровавая королева Лана\'тель", [[ Во время сражений на ледяных пустошах Нордскола Артас одержал победу над Иллиданом и Кель'тасом, а немногочисленные выжившие пытались скрыться от Плети. Но Король-Лич был намерен найти всех эльфов, осмелившихся бросить ему вызов. Тогда Лана'тель оказалась загнанной в угол и в отчаянии напала на Артаса, но не смогла противостоять Ледяной Скорби.

Король-Лич воскресил Лана'тель и сделал лидером Сан'лейн - эльфов крови, которые следили за успехом операцией Плети по всему северному материку. Сейчас Лана'тель находится в Багровом зале Цитадели Ледяной Короны, и её сила питает печать к телепорту на вершину Ледяного Трона. ]], 0.511599, 0.435467, 6, 604, 11792, 758, -1, 0, 8},
        {1634, "Валитрия Сноходица", [[ Одна из дочерей Изеры, могучая драконица, попавшая в плен к Плети. Находясь в плену в глубинах Залов Ледокрылых, что в Цитадели Ледяной Короны, Валитрия подвергается пыткам и явно не будет оставлена в живых, если возникнет риск её освобождения. Помогите ей, пока не стало слишком поздно! ]], 0.766814, 0.736678, 5, 604, 11808, 758, -1, 0, 9},
        {1635, "Синдрагоса", [[ Ощущая близящуюся смерть, ослепленная Синдрагоса отчаянно желала одного - добраться до Драконьего Погоста и встретить там свою смерть, как делали это до нее многие драконы. Однако сил дракона хватило не надолго. Обессиленная, она упала на землю ледника Ледяной Короны. Из последних сил, криком, полным отчаяния, Синдрагоса позвала своего супруга Малигоса. Холодные арктические ветра были единственными ее слушателями. Но она не сдалась и позвала еще раз. Расстояние было слишком велико. Осознав, что ее душа так и не обретет покой в Драконьем Погосте, она смирилась со своей участью. Жизнь постепенно уходила из нее, а разум затуманивался.

В бреду ее последние мысли были исполнены разочарования и ненависти: ненависти к Легиону, ненависти к Нелтариону, даже ненависти к Малигосу. Но больше всех она возненавидела мир смертных...

И перед смертью Синдрагоса поклялась отомстить.

Место, где встретил свою смерть могущественный дракон, стали называть Каньоном Гибели Синдрагосы.

Таким был жизненный путь Синего Дракона. Однако, как мы все знаем, на этом история не заканчивается. Спустя тысячи лет могущественный Король-Лич отыскал Синдрагосу и даровал ей возможность воплотить в жизнь свою смертельную клятву. Он сделал ее королевой Ледяных Драконов и поселил в Залах Ледокрылых. Сейчас Синдрагоса выполняет поручения Артаса. В Яме Сарона вы могли воочию убедиться в ее нынешнем могуществе. ]], 0.366325, 0.231898, 4, 604, 11829, 758, -1, 0, 10},
        {1636, "Король-лич", [[ После пробуждения Король-лич первым делом извлёк своё сердце, считая, что всё, что роднит со смертными, делает его слабее. Он отправился в Каньон Гибели Синдрагосы и воскресил древнего дракона Синдрагосу, которая была первой супругой Малигоса, в виде ледяного змея. После этого он наблюдал за своей гигантской армией нежити, готовой к войне. Во время сна своего правителя рыцарей смерти тренировали на территории Ледяной Короны. Пробудившись, он приказал им отправиться к Часовне Последней Надежды, где были похоронены тысячи героев Альянса, каждого из которых он желал воскресить на своей стороне, а затем захватить эти земли для Плети. Сейчас он восседает на Ледяном Троне, что в Цитадели Ледяной Короны, и только его смерть может остановить военную машину Плети от уничтожения всего живого. ]], 0.499296, 0.528743, 7, 604, 11855, 758, -1, 0, 11},
        {1637, "Леди Джайна Праудмур", [[ На вершине Цитадели Ледяной Короны, за мгновение до того, как Король-лич получил смертельный удар, история этого мира изменилась. Леди Джайна Праудмур отринула голос рассудка и встала на защиту того, кого некогда так любила. Судьба Артаса теперь зависит от того, смогут ли герои Азерота сразить не воплощение зла, но оступившегося товарища. ]], 0.499296, 0.568743, 7, 604, 900, 758, 8, 0, 12},
    },
    [760] = {
        {1651, "Ониксия", [[ На краю Пыльных топей стоит пещера, ставшая последним пристанищем для проклятого рода Черных Драконов. Логово Ониксии - имя этому пристанищу, и число черных драконов медленно, но верно растет с каждым днем. Этой угрозой нельзя пренебречь. ]], 0.672370, 0.309886, 0, 718, 11400, 760, 3, 0, 0},
    },
    [761] = {
        {1652, "Халион", [[ Зловещий Халион, вместе со своими помощниками Савианой Огненная Пропасть, Балтаром Рожденным в Битве и генералом Заритрианом, напали на Рубиновое святилище под Храмом Драконьего Покоя, чтобы сломить Драконий союз и раздавить тех, кто станет на пути к возрождению владыки чёрных драконов и их господина в мир Азерота. ]], 0.491354, 0.535788, 0, 609, 1000, 761, -1, 0, 0},
    },
    [762] = {
        {11585, "Огглфлинт", [[ Огглфлинт и трогги некогда правили в глубинах Огненной пропасти, пока туда не проникли культисты Пламенеющего Клинка. Будучи слишком слабыми, чтобы прогнать клан Пламенеющего Клинка, Огглфлинт и трогги отступили на верхние уровни Огненной Пропасти, где теперь терпеливо ждут, когда их незваные гости уйдут. ]], 0.566000, 0.385000, 0, 680, 20001, 762, -1, 0, 0},
        {11586, "Тарагаман Ненасытный", [[ Считается, что Тарагаман Ненасытный является лидером Пламенеющего Клинка. Он прячется в глубинах Огненной Пропасти, используя свое демоническое влияние, чтобы развратить жителей Оргриммара. На самом деле лидеры Пламенеющего Клинка — Баззалан и Жергош, а этот страж Скверны — расходная приманка, чтобы заманить молодых авантюристов Орды на смерть. ]], 0.410000, 0.574000, 0, 680, 20002, 762, -1, 0, 1},
        {11587, "Баззалан", [[ Баззалан возглавляет культистов Пламенеющего Клинка вместе с Джергошем Призывателем. Его мотивы не ясны, но, как и все сатиры, он быстрый и хитрый противник.  ]], 0.420000, 0.861000, 0, 680, 20004, 762, -1, 0, 2},
        {11588, "Жергош Призыватель Духов", [[ Жергош Призыватель отверг идеалы орков и практикует темные и демонические искусства чернокнижников. Лидер культистов Пламенеющего Клинка, Жергош, обитает в Огненной Пропасти. Он охраняет заполненную кровью сферу, которая необходима для вызова опаснейших демонов. ]], 0.343000, 0.817000, 0, 680, 20006, 762, -1, 0, 3},
    },
    [763] = {
        {11015, "Азшир Неспящий", [[ Есть миф что Азшир мог испытать какое-нибудь проклятие или исполнить обет, заставлявший его оставаться беспечным даже после смерти. Это проклятие могло быть следствием его пиратских преступлений или соглашения с темными силами, чтобы получить больше власти и богатства при жизни, не думая о после смертном покое. ]], 0.000000, 0.000000, 0, 889, 1017, 763, -1, 0, 3},
        {11589, "Дознаватель Вишас", [[ Джеймс Вишас, член Алого ордена, и один из главных дознавателей ордена. Он любит пытать нежить и гордится своей работой. Вишас известен своим неумолимым садизмом, жестоким нравом и высоким голосом. Например, Вишас неделями мучил Воррела Сенгутца, а обручальное кольцо Сенгутца подарил своей жене Нэнси Вишас. Эта жуткая история многое говорит о том, кто на самом деле Джеймс Вишас. ]], 0.719000, 0.594000, 0, 889, 20272, 763, -1, 0, 0},
        {11590, "Железноспин", [[ Железноспин — скелет, который обитает на кладбище Монастыря Алого ордена. Долговязый и кажущийся хрупким, этот скелет обладает сверхчеловеческой силой и высокой устойчивостью к большинству физических атак. ]], 0.000000, 0.000000, 0, 889, 20274, 763, -1, 0, 1},
        {11591, "Павший воитель", [[ Когда-то святой паладин Монастыря Алого ордена, Павший воитель, был чемпионом Алого ордена. Позже он был убит и затем поднят в качестве слуги Короля Мертвых. Он бродит по кладбищу, все еще владея доспехами и оружием, готовый напасть на любого, кто попадется ему на пути. ]], 0.000000, 0.000000, 0, 889, 20276, 763, -1, 0, 2},
        {11592, "Волшебник крови Талнос", [[ Волшебник крови Талнос заработал дурную славу, когда еще был членом Алого ордена. Он зверски измывался над новобранцами под предлогом 'очищения'. В конце концов, садист-маг подхватил чуму и обратился в нежить. Теперь чудовищный скелет мстительного Талноса неприкаянно бродит по монастырскому кладбищу, насылая теней и зомби на каждого, кто вторгается в его жуткие владения. ]], 0.243000, 0.560000, 0, 889, 20278, 763, -1, 0, 4},
    },
    [764] = {
        {11593, "Верховный инквизитор Фэйрбанкс", [[ Фэйрбанкс был убит рыцарями Алого ордена за богохульство, а также из-за симптомов чумы, которые начали проявляться после посещения Стратхольма во время нападения армии Плати. Его тело сокрыто в потайной комнате Собора Алого ордена. ]], 0.553000, 0.256000, 0, 940, 20282, 764, -1, 0, 0},
        {11594, "Командир Алого ордена Моргрейн", [[ Командир Алого ордена Могрейн — молодой командир вооруженных сил в Монастыре Алого ордена. Он бесприкословно подчиняется верховному инквизитору Вайтмен и сделает все, о чем она его попросит. ]], 0.492000, 0.271000, 0, 940, 20288, 764, -1, 0, 1},
        {11595, "Верховный инквизитор Вайтмейн", [[ Салли Вайтмейн — жрица света и верховный инквизитор Алого ордена. В юном возрасте Салли стала свидетелем того, как ее семья погибла от ужасающей чумы во время вторжения армии Плети. С того дня страшная жрица нашла удовлетворение и удовольствие только в одном: в очищении и уничтожении нежити. ]], 0.490000, 0.168000, 0, 940, 20292, 764, -1, 0, 2},
    },
    [765] = {
        {11596, "Псарь Локси", [[ Гончар Локси — один из четырех лидеров Монастыря Алого ордена и капитан, отвечающий за обучение гончих, которых Алый орден использует для выслеживания своих врагов. Локси командует устрашающими собаками, способными разорвать свою жертву на части за считанные минуты. ]], 0.293000, 0.837000, 0, 938, 20298, 765, -1, 0, 0},
        {11597, "Чародей Доан", [[ Чародей Доан, хранитель библиотеки монастыря Алого ордена. Он является доверенным лицом Алого ордена, хранящим ключ, имеющий жизненно важное значение, открывающий доступ к планам ордена в Чумных землях. Чародей Доан считает, что тайная магия — единственный способ избавить Лордерон от Плети. ]], 0.833000, 0.742000, 0, 938, 20300, 765, -1, 0, 1},
    },
    [766] = {
        {11598, "Ирод", [[ Ирод — чемпион Алого ордена и наставник всех послушников ордена, которых тщательно обучает правильно обращаться с клинками и молотами, стрелами и щитами. Всю жизнь Ирод посвятил искусству сражения этими разрушительными орудиями и охотно готов продемонстрировать нечестивым врагам свое мастерство. ]], 0.786000, 0.104000, 0, 939, 20305, 766, -1, 0, 0},
    },
    [767] = {
        {11599, "Киртонос Глашатай", [[ Киртонос давно стал мастером Некроситета. Он — нежить, которая может превращаться в горгулью благодаря тому, что долгое время питалась кровью невинных жертв. С каждым днем ему нужно все больше и больше крови, и его жажда неумолима! ]], 0.497000, 0.101000, 2, 890, 20309, 767, -1, 0, 0},
        {11600, "Джандис Барова", [[ Долгие годы дух Баровой скиталась по коридорам Некроситета. В последнее время она начала активнее участвовать в подготовке новых волшебников. За исчерпывающие знания об искусстве иллюзии ее уважают коллеги преподаватели и боятся враги. Так что лучше ее не гневить. ]], 0.541000, 0.144000, 3, 890, 20317, 767, -1, 0, 1},
        {11601, "Громоклин", [[ Все думали, что Громоклин был сражен в Андорале, но у Гандлинга были другие планы. Он немедленно подготовил это грохочущее чудище к оживлению, а, вдохнув в него жизнь, поставил его на страже Некроситета. Тёмному магистру требовалось сделать чудовище еще более лютым, поэтому он наделил его неутолимой жаждой — жаждой выдирать куски плоти из тел поверженных врагов. ]], 0.321000, 0.650000, 3, 890, 20319, 767, -1, 0, 2},
        {11602, "Рас Ледяной Шепот", [[ Рас Ледяной Шепот — это лич Плети, который следит за всем, что происходит в Некроситете. Когда-то он был человеком-магом из Стромгарда, который так и не получил формального обучения в Даларане. Но это не помешало ему стать учителем. ]], 0.405000, 0.815000, 4, 890, 20322, 767, -1, 0, 5},
        {11603, "Доктор Теолен Крастинов", [[ Известный как «Мясник», Крастинов является слугой Киртоноса Глашатая и главным мучителем, а также поставщиком тел и их частей для экспериментов некромантии в Некроситете. Его первыми жертвами стали семьи Каэр Дарроу. ]], 0.888000, 0.462000, 3, 890, 20328, 767, -1, 0, 7},
        {11604, "Мардук Блэкпул", [[ Мардук Блэкпул, также известный как Мардук Черный, является печально известным рыцарем смерти Плети. Он стал наиболее известен своим участием в битве при Дарроушире во время Третьей войны, где способствовал поражению людей, развращая дух Джозефа Редпата. Спустя некоторое время после этого Мардук удалился в Некроситет. ]], 0.442000, 0.644000, 2, 890, 20331, 767, -1, 0, 3},
        {11605, "Вектус", [[ Вектус — скелет-маг, который является одним из главных учителей некромантии в Некроситете. Он развил измученную стаю драконов, обитающую в этом мрачном месте, заплатив Тинки Стимбоил в Пылающих степях за яйца, добытые на пике Черной горы. ]], 0.486000, 0.658000, 2, 890, 20335, 767, -1, 0, 4},
        {11606, "Хранитель знаний Полкелт", [[ Как мы можем судить по имени, Полкелта когда-то был хранителем знаний, которые, к сожалению, были утеряны, поскольку теперь он является неуклюжим, неразумным монстром. Полкелт является одним из шести обитателей Некроситета, которых необходимо победить, чтобы вызвать Темного магистра Гандлинга. ]], 0.723000, 0.220000, 3, 890, 20339, 767, -1, 0, 8},
        {11607, "Инструктор Коварнесса", [[ Инструктор Коварнесса — высший эльф, который является инструктором, обладающим глубокими знаниями и опытом в области темной магии и некромантии. Она обучает культистов в Некроситете. Коварнесса известна своим строгим подходом к обучению и умением передавать сложные концепции, используя как древние тексты, так и практические занятия. ]], 0.726000, 0.700000, 3, 890, 20343, 767, -1, 0, 6},
        {11608, "Леди Иллюсия Барова", [[ Леди Иллюсия Барова является призраком школы некромантии Некроситет. Она была женой лорда Алексея Барова и является одним из шести обитателей Некроситета, которых необходимо победить, чтобы вызвать Темного магистра Гандлинга. ]], 0.675000, 0.141000, 4, 890, 20348, 767, -1, 0, 11},
        {11609, "Лорд Алексей Баров", [[ ЛЛорд Алексей Баров был лордом Каэр Дарроу, Бриллы и Мельницы Таррен, а также Южнобережья. Он был отцом Алекси, Уэлдона и Джандис Баровой, и мужем Леди Иллюсии Баровой. Подобно Джендис и Иллусии, он теперь является агентом Плети из Некроситета. Алексей Баров — один из шести обитателей Некроситета, которых необходимо победить, чтобы призвать мастера тьмы Гандлинга. ]], 0.791000, 0.300000, 4, 890, 20353, 767, -1, 0, 10},
        {11610, "Равениан", [[ Равениан — это очень необычный вид нежити. Неизвестно, как произошло его преобразование. Ходит слух, что Равениан поглощает учеников Некроситета, которые не проявляют прилежности в учебе. Кроме того, Равениан является одним из шести обитателей Некроситета, которых необходимо победить, чтобы вызвать Темного магистра Гандлинга. ]], 0.673000, 0.477000, 4, 890, 20356, 767, -1, 0, 9},
        {11611, "Темный магистр Гендлинг", [[ Мастер Тьмы Гэндлинг — директор Школы некромантии в Каэр Дарроу, назначенный на эту должность лично Кел'Tузадом. Его учителем некромантии был могущественный некромант Рас Ледяной Шепот. ]], 0.681000, 0.302000, 4, 890, 20360, 767, -1, 0, 12},
    },
    [768] = {
        {11612, "Повелитель времени Дежа", [[ Драконы Бесконечности переманили на свою сторону многих драконидов, но польстившихся на обещания могущества ждали лишь неволя и отчаяние. Одним из немногих, кому удалось избежать незавидной доли, стал повелитель времени Дежа, добившийся влияния благодаря грубой силе и хитрости. ]], 0.450000, 0.610000, 0, 844, 21800, 768, -1, 0, 0},
        {11613, "Темпорус", [[ Несмотря на относительно молодой возраст, Темпорус сыграл важную роль в определении многих ключевых целей драконов Бесконечности. В качестве награды он получил задание уничтожить всех, кто может попытаться вмешаться в планы драконов. ]], 0.553000, 0.620000, 0, 844, 21806, 768, -1, 0, 1},
        {11614, "Эонус", [[ Предводитель драконов Бесконечности поручил могучему и дикому Эонусу лично проследить, чтобы ключевые события в истинном потоке времени были изменены. ]], 0.479000, 0.740000, 0, 844, 21811, 768, -1, 0, 2},
    },
    [769] = {
        {11615, "Мясной Крюк", [[ С тех пор как принц Артас впервые встретил поганищ Плети, они стали еще опаснее. Но ни одно поганище не сравнится с Мясным Крюком: он намного сильнее и проворнее остальных, а яд его смертельно опасен. Некроманты, создавшие Мясного Крюка, не особо беспокоились об интеллекте своего подопечного, однако даже его примитивных зачатков разума достаточно, чтобы он мог делать то, что получается у него лучше всего. ]], 0.561000, 0.597000, 2, 521, 21817, 769, -1, 0, 0},
        {11616, "Салрамм Плоторез", [[ Салрамм Плоторез был одним из первых некромантов, которые обучались в залах Некроситета. Он не делал различий между подопытными пленниками и другими некромантами, обучающимися в Некроситете: все они были лишь набором частей тел для его работы. И сейчас у него есть огромный простор для экспериментов, ведь в его распоряжении - все население Стратхольма... а также чужаки, которые осмелятся ему помешать. ]], 0.591000, 0.393000, 2, 521, 21820, 769, -1, 0, 1},
        {11617, "Хронолорд Эпох", [[ Драконы Бесконечности пытаются изменить прошлое с помощью изощренных методов, но если эти методы себя не оправдают, драконы могут послать убийцу, чтобы тот расправился с Артасом напрямую. И хотя об убийцах, работающих на драконов Бесконечности, известно очень немногое, Хронолорд Эпох, вне всяких сомнений, мастерски управляет временными потоками, что делает его смертельно опасным препятствием на пути Артаса. ]], 0.659000, 0.255000, 2, 521, 21827, 769, -1, 0, 2},
        {11618, "Мал\'Ганис", [[ Судьба Мал'Ганиса уже предрешена. Ненависть Артаса к повелителю ужаса приведет принца прямо в Нордскол, где он обнаружит Ледяную Скорбь. Но это произойдет только в том случае, если Мал'Ганис сочтет Артаса достойным противником. Чтобы не ударить в грязь лицом и начать свой путь к восхождению на Ледяной Трон, Артас должен выжить в бою с Мал'Ганисом. ]], 0.324000, 0.457000, 2, 521, 21834, 769, -1, 0, 3},
    },
    [771] = {
        {11623, "\"Огненный Левиафан\"", [[ Вход во внутренний двор Ульдуара охраняет огромный бронированный танк. Хранитель Мимирон построил "Огненный Левиафан" как часть оружейной платформы "В-0-7 ТР0Н". ]], 0.491000, 0.389000, 1, 529, 20484, 771, -1, 0, 0},
        {11624, "Повелитель горнов Игнис", [[ Как и другие творения титанов в Ульдуаре, Игнис теперь подчиняется воле древнего бога Йогг-Сарона. Этот внушительный огненный гигант обитает в Гигантской кузне и создает армии железных воинов, которые должны покорить Азерот, во имя Йогг-Сарона. ]], 0.383000, 0.266000, 1, 529, 20534, 771, -1, 0, 1},
        {11625, "Острокрылая", [[ Веранус, мать стаи протодраконов Грозовой гряды, служила хранителю Ториму, пока Локен не пленил ее, превратив в грозное оружие. Повелитель горнов Игнис укрепил драконью чешую железными пластинами, сделав Острокрылую еще смертоноснее. ]], 0.541000, 0.268000, 1, 529, 20545, 771, -1, 0, 2},
        {11626, "Разрушитель ХТ-002", [[ Мимирон спроектировал этот автономный механизм для охраны мусорной свалки Ульдуара и наделил его зачатками интеллекта, необходимыми для выполнения нехитрых обязанностей. ХТ-002 считает себя сыном хранителя и, как и положено капризному ребенку, иногда впадает в истерику. ]], 0.485000, 0.145000, 1, 529, 20566, 771, -1, 0, 3},
        {11627, "Железное Собрание", [[ Во главе железных легионов Локена стоят три суровых генерала, каждый из которых представляет одну из созданных титанами рас. Буревестник Брундир, мастер рун Молгейм и гигант Сталелом служат тому, кто на самом деле повелевает хранителем, - зловещему Йогг-Сарону. ]], 0.154000, 0.568000, 2, 529, 20587, 771, -1, 0, 4},
        {11628, "Кологарн", [[ Локен приказал повелителю горнов Игнису выковать этого великана для защиты Обвалившейся галереи. Своими огромными руками Кологарн способен раздавить любого, кто попытается проникнуть во внутреннее святилище Ульдуара. ]], 0.373000, 0.126000, 2, 529, 20607, 771, -1, 0, 5},
        {11629, "Ауриайя", [[ Архивариус Ульдуара блуждает по Кругу Наблюдения в компании диких кошек. Долгие годы, проведенные в одиночестве, сломили Ауриайю, а возрастающее влияние Древнего бога окончательно лишило ее рассудка. ]], 0.511000, 0.569000, 3, 529, 20619, 771, -1, 0, 6},
        {11630, "Ходир", [[ Ходир когда-то главенствовал в Храме Зимы, повелевая снежными великанами Грозовой гряды. Теперь этот хранитель обитает в ледяной пещере в Залах Зимы, и разум его подчинен воле Йогг-Сарона. ]], 0.667000, 0.637000, 3, 529, 20632, 771, -1, 0, 7},
        {11631, "Торим", [[ Годами Торим верил, что великаны убили его любимую жену Сиф. Обрушив гнев на своих союзников, он впал в отчаяние. Когда Торим узнал, что за преступлением стоит его брат Локен, тот заключил хранителя в Ульдуаре, где Древний бог помутил его разум. ]], 0.718000, 0.484000, 3, 529, 20656, 771, -1, 0, 8},
        {11632, "Фрейя", [[ Хранительница Фрейя была защитницей всего живого, а помогали ей в этом трое верных старейшин. И хотя ее оранжерею до сих пор убивает буйная зелень, рассудок ее не устоял перед шепотом Древнего бога. ]], 0.533000, 0.230000, 3, 529, 20711, 771, -1, 0, 9},
        {11633, "Мимирон", [[ Будучи блестящим изобретателем, Мимирон на протяжении всей истории Азерота сконструировал множество механизмов, которые до сих пор вызывают трепет и восхищение. Но попав под влияние Локена, этот хранитель Ульдуара начал создавать только машины войны. ]], 0.436000, 0.414000, 5, 529, 20752, 771, -1, 0, 10},
        {11634, "Генерал Везакс", [[ Странные существа, именуемые безликими, обитают в глубинах Ульдуара. Один из повелителей генерал Везакс, охраняет извилистые коридоры, ведущие в темницу Йогг-Сарона. ]], 0.569000, 0.605000, 4, 529, 20793, 771, -1, 0, 11},
        {11635, "Йогг-Сарон", [[ Сон наяву, Чудовище из ваших кошмаров, Демон с тысячью лиц.
Все должны склониться перед волей господина. Ваши жалкие потуги лишь делают его сильнее... ]], 0.681000, 0.401000, 4, 529, 20805, 771, -1, 0, 12},
        {11636, "Алгалон Наблюдатель", [[ После смерти Локена Пантеону было отправлено предупреждение о том, что Азерот лишился Главного куратора. Вскоре на Азерот прибыл Алгалон Наблюдатель, чьей задачей было выявление признаков поражения планеты порчей. В случае необходимости констеллар запустит алгоритм пересоздания мира, вследствие чего все его обитатели погибнут. ]], 0.788000, 0.466000, 2, 529, 20863, 771, -1, 0, 13},
    },
    [772] = {
        {11640, "Лейтенант Дрейк", [[ Лейтенант Дрейк был амбициозным военным, намеревавшимся снискать славу командира во время Второй войны. Его тщеславие могло сравниться только с его ненавистью к зеленокожим оркам, которые убили стольких его товарищей. Плодом этой ненависти стало его жестокое обращение с заключенными в лагере пленных в крепости Дарнхольд. ]], 0.752000, 0.660000, 0, 845, 20883, 772, -1, 0, 0},
        {11641, "Капитан Скарлок", [[ Бесконечно преданный Аделасу Блэкмуру капитан Скарлок поднялся по служебной лестнице армии Дарнхольда вместе со своим другом Алиденом Перенольдом. Когда Алиден решил заняться руководством боевыми действиями в Альтеракских горах, Скарлок остался подле своего господина и наставника. Он стал самым верным товарищем и советником Аделаса, забрав себе прозвище Копье Блэкмура. ]], 0.693000, 0.691000, 0, 845, 20888, 772, -1, 0, 1},
        {11642, "Охотник Вечности", [[ Загадочный Охотник Вечности - убийца из числа драконов Бесконечности, посланный изменить ход истории и убить Тралла, прежде чем тот сможет покинуть Дарнхольд. Чтобы достичь своей цели, вселяющий ужас дракон погубил несчетное количество жизней, но ему еще предстоит совершить самое важное убийство. Он использует всю свою силу, власть, хитрость и коварство, чтобы положить конец этой реальности. ]], 0.505000, 0.316000, 0, 845, 20902, 772, -1, 0, 2},
    },
    [773] = {
        {11657, "Импорус", [[ Первый из гвардии Мурозонда, могучий воин, яростно сражающийся в ближнем бою и использующий разрушительную магию времени, обращая своих противников в прах. ]], 0.661000, 0.648000, 0, 924, 21202, 773, 10, 0, 0},
        {11658, "Исказитель времени Элонус", [[ Величайший из хрономантов Мурозонда, назначенный им служить одним из двух стражей пути за пределы времени. Могущественный заклинатель, не преследующий противников, предпочитая обстреливать их заклинаниями, пока они сами не вступят в ближний бой. ]], 0.718000, 0.848000, 0, 924, 21215, 773, 10, 0, 1},
        {11659, "Мурозонд", [[ В каждой душе есть место тьме и безумию. Сознание некогда благородного и верного своему долгу Ноздорму подточило видение его собственной смерти, дарованное ему Аман'Тулом. Теперь он - Мурозонд, повелитель драконов Бесконечности, пошедший против судьбы и стремящийся выжить любой ценой - даже если это будет означать приход Конца Времени и конец мира, как мы его знаем.
Здесь, в этой гибнущей временной линии, его труды явно принесли свои плоды - и ему остается лишь последний шаг - стереть эту временную линию... и приняться за следующую. ]], 0.376000, 0.249000, 0, 924, 21238, 773, 10, 0, 2},
    },
    [774] = {
        {11660, "Гогонаш", [[ Не сумев удержать огромного властителя преисподней Аргалота в темнице величественной Аметистовой крепости Даларана, маги Кирин-Тора были вынуждены заключить могущественного демона, в одной и самых крепких темниц - в глубинах Тол'Гарода. К сожалению или к счастью, стража не могла долго сопротивляться жгучей ненависти, исходящей от демона, и в попытках окончить его существование демон освободился. ]], 0.802000, 0.627000, 0, 954, 21288, 774, 3, 0, 0},
        {11661, "Поглотитель разума Ктракс", [[ Это жуткое существо было поймано в глубинах Ульдуара. Его пленили, когда оно впало в оцепенение после поражения Йогг-Сарона. Опасаясь его силы, маги Кирин-Тора решили отправить его в максимально защищенное место - в темницу Тол'Гарода, однако со временем, чудовище по загадочной причине пробудилось, и теперь мощные системы безопасности Тол'Гарода не могут сдержать его.  ]], 0.478000, 0.175000, 0, 954, 21298, 774, 3, 0, 1},
        {11662, "Пожиратель магии", [[ Перевезенный еще будучи маленьким "щенком", пожиратель медленно, но верно рос в глубинах Тол'Гарода, до тех пор, пока по соседству не заселились представители магии Тьмы и Скверны. Излучаемая ими магия небольшими крупицами впитывалась в еще не окрепшее тело пожирателя, изменяя и преображая его сущность. ]], 0.162000, 0.631000, 0, 954, 21322, 774, 3, 0, 2},
        {11686, "Символы зачарований", [[  ]], 0.000000, 0.000000, 0, 0, 0, 774, 3, 0, 3},
    },
    [776] = {
        {11665, "F-Reaper 8000 TX", [[ Где-то в степных холмах одинокий, но гениальный инженер и горняк решил обратить свои познания в механике под менее "военный" профиль. Конечно, результат опыта нельзя назвать однозначно успешным - но все-таки, убийственно-настроенный робот с "некоторыми" способностями к горному делу - это первый шаг в верном направлении! ]], 0.802000, 0.627000, 0, 0, 21375, 776, 1, 0, 0},
        {11666, "Октарион", [[ Эредар-маг, чье увлечение первозданным пламенем переросло в настоящую манию. Отринув Скверну и иные пути Легиона, Октарион полностью погрузился в магию первородной стихии, не замечая как его "я" стремительно преображается.
Октарион нашел нового повелителя в голосе, звучащем в треске первозданного огня. Теперь эредар следует планам своего повелителя, не задавая лишних вопросов - ведь для него больше не важны детали - лишь могущество и возможность использовать его в бою. ]], 0.478000, 0.175000, 0, 0, 21376, 776, 1, 0, 1},
        {11667, "Малар", [[ Высшие эльфы отринули пристрастие к магии после уничтожения Солнечного Колодца. Для противостояния жажде магии требуется недюжинная воля, и высшие эльфы зачастую практически полностью закрывают себя от магической энергии - или напротив, становятся арканистами, тщательно соблюдающими баланс между магической энергией и её влиянием на свои действия.
Но порой, даже опытный арканист может оступиться. Голос из Пустоты нашептал эльфу запретные знания, которые подточили его волю и крепость его рассудка. Для него более нет пути назад. ]], 0.162000, 0.631000, 0, 0, 21383, 776, 1, 0, 2},
        {11668, "Волтрис", [[ Волтрис, некогда маг из числа людей, посвятивший себя познанию магии льда, со временем заполучил в свои руками знания шаманов и в порыве гордыни решил объединить эти знания, став живым воплощением стихии льда, перерожденным.
Неизвестно что именно пошло не так в его ритуале, но перерождение Волтриса не завершилось. Заточенный в кристалл льда, скорлупу которого возможно разрушить лишь снаружи, перерожденный оказался заточен где-то в Зимних Ключах, без надежды на освобождение...
До тех пор, пока в его полусне-полуяви ему не почудился вкрадчивый голос из темноты. ]], 0.802000, 0.627000, 0, 0, 21393, 776, 1, 0, 3},
        {11669, "Инфернос", [[ Повелители Ужаса. Натрезимы. Незримые гости.
Раса, для которой коварство и интриги так же естественны как для людей - дыхание, эти демоны были организованной силой задолго до падения Саргераса и формирования Пылающего Легиона. Сейчас же, они занимают ключевые роли в структуре демонической армии.
Инфернос - один из трех Натрезимов, составляющих триумвират - особую единицу формирования повелителей ужаса, ответственную за покорение отдельных миров. Этот Триумвират ответственен за покорение Азерота - после того, как предыдущий отряд, отвечавший за это, был расколот Плетью, Отрекшимися и силами защитников Азерота. ]], 0.478000, 0.175000, 0, 0, 21411, 776, 1, 0, 4},
        {11670, "Родамирус", [[ После своего падения, Саргерас в своем безумии не только начал организовывать демонов в единую силу для сокрушения миров - но и начал осквернять механизмы, созданные Титанами, совмещая их технологию с мрачным могуществом Скверны и техническими достижениями некоторых демонических рас Легиона.
Родамирус - некогда инструмент для борьбы с демонами, могущественный автоматон, был осквернен и теперь ответственен лишь за одну задачу - очищать миры... но не от демонов, а от всего живого. ]], 0.162000, 0.631000, 0, 0, 21418, 776, 1, 0, 5},
        {11671, "Зорт", [[ Изумрудный Сон - эфемерный мир духов и девственной природы, огромный пласт реальности, что лежит за пределами физического мира. Безопасный и прекрасный рай, отражение Азерота, где никто и ничто не может навредить страннику Сна. Когда-то давно, преследуя свои злокозненные замыслы, Ксавий поразил Изумрудный Сон своей порчей, отравив кусочек его пространства - во всяком случае, так считают друиды, остановившие его и запечатавшие Провал Альн.
Однако Ксавий не осквернил Изумрудный Сон - не в его силах совершить нечто подобное. Он лишь открыл в него лазейку тому, чье дыхание проникло в Сон и превратило его в Изумрудный Кошмар. Там, за провалом Альн, так бесконечно далеко - и совсем близко, находится воплощение самых мрачных ужасов и кошмаров любого разумного существа. Место, надежно запечатанное и недоступное для доступа туда тому, кто уязвим. Лишь заплутавший сновидец может оказаться там и в ужасе проснуться, не помня что произошло - ведь по своей природе сновидец бессмертен. Но если Ксавий уже пробил брешь в печати и впустил тончайшую нить пути к этому месту в Изумрудный Сон. то что же произойдет с тем, кто пройдет по ней - по своей воле или нет - и окажется в Кошмаре Наяву? ]], 0.162000, 0.631000, 0, 0, 21440, 776, 1, 0, 6},
    },
    [777] = {
        {11672, "Норигорн", [[ Много крови было пролито в противостоянии Альянса, Орды и Ренегатов за ресурсы и сокровища острова Тол'Гарод. Капля по капле, кровь достигла силовой линии, что в самом сердце острова, под землей - и кровь нашла отклик. Со скрежетом врата тюрьмы открылись, и открывшийся путь зовет искателей сокровищ из всех фракций. Осталась лишь одна преграда - пробужденный зовом крови Страж силовых линий, Норигорн. ]], 0.162000, 0.631000, 0, 0, 21751, 777, 1, 0, 0},
    },
    [778] = {
        {11673, "Лютый Хлад", [[ Лютый Хлад - один из немногочисленных личей-демонопоклонников, хранящих верность Пылающему Легиону, а не Королю-личу. В бою за Мировое Древо он возглавляет отряды нежити, штурмующие лагерь Альянса, используя всю мощь своей магии смерти. ]], 0.132000, 0.619000, 0, 863, 21567, 778, 2, 0, 0},
        {11674, "Анетерон", [[ Анетерон - генерал Натрезимов, занявший место в иерархии их скрытного ордена после поражения Тихондрия Светокрада. В отличии от своего брата, Анетерон предпочитает прямую конфронтацию интригам и манипулированию, используя для этого свою немалую физическую мощь, магию крови и целое войско темных инферналов, созданных под его личным руководством. В битве за Мировое Древо он возглавляет вторую атаку на лагерь Альянса, стремясь сделать её последней. ]], 0.083000, 0.685000, 0, 863, 21593, 778, 2, 0, 1},
        {11675, "Каз\'рогал", [[ Повелитель Рока Каз'рогал был избран Архимондом как новый лидер авангарда стражей рока - гвардии Легиона, могущественных бойцов ближнего боя, не чурающихся чудовищных в своей эффективности заклинаний. Вооруженный различными демоническими клинками и закованный в инфернальные доспехи, Каз'рогал воплощает в себе идеал гвардии Архимонда.В Битве за Мировое Древо он возглавляет первый натиск на лагерь Орды, в полной уверенности, что этот натиск будет не только первым, но и последним. ]], 0.422000, 0.356000, 0, 863, 21607, 778, 2, 0, 2},
        {11676, "Азгалор ", [[ После смерти Маннорота Азгалор взял на себя контроль за наземными войсками Пылающего Легиона и сопровождал Архимонда на его пути к Нордрассилу на горе Хиджал. Вместе с Лютым Хладом они успешно отражали все нападения смертных рас и все ближе подходили к Мировому Древу.  ]], 0.358000, 0.389000, 0, 863, 21639, 778, 2, 0, 3},
        {11678, "Архимонд", [[ Архимонд - один из величайших и ужаснейших представителей расы эредаров. Его безжалостная и изобретательная натура быстро принесла ему власть и высокое положение в рядах эредаров и, в конце концов, Архимонд стал первым среди них.  ]], 0.766000, 0.287000, 0, 863, 21680, 778, 2, 0, 4},
    },
    [785] = {
        {11691, "Верховный полководец Надж\'ентус", [[ Занимаясь укреплением обороны Чёрного Храма, Иллидари быстро осознали, насколько уязвима его канализация. Малоприятная, но важная миссия по охране стоков была поручена лучшему воину леди Вайш, верховному полководцу Надж'ентусу. Теперь, когда армии Шаттрата нашли путь в храм, Надж'ентус получил шанс оправдать оказанное ему Иллиданом доверие, а также отомстить за гибель своей госпожи. ]], 0.439000, 0.191000, 1, 847, 22255, 785, 2, 0, 0},
        {11692, "Супремус", [[ Хаотичный и опасный, подобно породившей его магии, Супремус был создан с единственной целью: не допустить проникновения врагов Иллидана во внутреннее святилище Черного Храма. Этот огненный колосс не остановится ни перед чем, чтобы обратить незваных гостей в пепел и прах. ]], 0.668000, 0.476000, 0, 564, 22260, 785, 2, 0, 1},
        {11693, "Тень Акамы", [[ В наказание за предательство Иллидан вырвал часть души Акамы и подчинил ее себе при помощи магии. Подпитываемая злобой, тщеславием и жаждой власти вождя Пеплоустов, она держит Акаму и всё его племя в услужении Иллидану, в любой момент угрожая вырваться на волю и поглотить Сломленного изнутри. ]], 0.410000, 0.886000, 2, 847, 22272, 785, 2, 0, 2},
        {11694, "Терон Кровожад", [[ Первый из рыцарей смерти Гул'дана, Терон Кровожад пал от руки Туралиона во время Второй Войны, но сумел избежать небытия и вернулся из мира мертвых. Ныне он называет своим владыкой Иллидана и готовит для него новое поколение рыцарей смерти, однако истинные цели Кровожада остаются загадкой. Может ли быть, что старый рыцарь имеет планы в отношении некоего черепа?.. ]], 0.394000, 0.119000, 4, 847, 22327, 785, 2, 0, 3},
        {11695, "Гуртогг Кипящая Кровь", [[ Тысячи орков испили крови Магтеридона, но ни один из них не достиг такого могущества, как Гуртогг. Он прошел через сотни испытаний боем и стал неоспоримым чемпионом Орды Скверны. Возвышаясь над доверенными ему войсками, Гуртогг готов встретить врагов своего владыки и испытать их силу. ]], 0.535000, 0.464000, 3, 847, 22352, 785, 2, 0, 4},
        {11696, "Реликварий душ", [[ Неприкаянные духи Карабора стягиваются в самое сердце некогда священных залов дренеев. Здесь Иллидан разместил свое нечестивое творение, которое поглощает, разрывает и переваривает души, превращая их в энергию, столь необходимую Предателю в его планах. Остаточные эманации этих измученных душ воплотились в омерзительные поганища, которые готовы сожрать заживо любого, кто отважится спуститься в глубины храма. ]], 0.614000, 0.853000, 3, 847, 22361, 785, 2, 0, 5},
    }
}
